!       Vegetation_height_based_on_empirical_biomass_length_relationship_of_Haga_2007
                aVgEHg =   ( ( cVgHP1*aDVeg )** cVgHP2 )
!       Vegetation_height
                if ( ( UsVgHg == 0 .and.  aVgHgh < uDpthW ) ) then
                uVgHgh = aVgHgh
                else if ( ( UsVgHg == 0 ) ) then
                uVgHgh = ( uDpthW )
                else
                uVgHgh = min ( aVgHgh , uDpthW , aVgEHg )
                endif

!       Vegetation_height_hyp
                if ( ( aInclS == 0 ) ) then
                uVgHgHyp = 0.0
                else if ( (uVgHgh > uDptWH ) ) then
                uVgHgHyp = uDptWH
                else
                uVgHgHyp = uVgHgh
                endif

!       Vegetation_height_epi
                if ( ( aInclS == 0 .and. uVgHgh < uDptWE ) ) then
                uVgHgE = uVgHgh
                else if ( ( aInclS == 0 .and. uVgHgh >= uDptWE ) ) then
                uVgHgE = uDptWE
                else if ( (uVgHgh > uDptWH ) ) then
                uVgHgE = uVgHgh -uDptWH
                else
                uVgHgE = 0.0
                endif

!       Lower_depth_of_vegetation_layer_(maximum_=_water_depth)
                if ( ( aInclS == 1 .and. fDpt2V >= 1 ) ) then
                aDp2VH = uDptWH
                else if ( ( aInclS == 1 .and. fDpt2V < 1 ) ) then
                aDp2VH = max (0.0, uVgHgh - uDptWE )
                else
                aDp2VH = 0.0
                endif

!       Upper_depth_of_vegetation_layer_(minimum_=_0_m_=_surface)
                if ( ( aInclS == 1 .and. fDpt2V >= 1 ) ) then
                aDp1VH = uDptWH - uVgHgHyp
                else
                aDp1VH = 0.0
                endif

!       Lower_depth_of_vegetation_layer_(maximum_=_water_depth)
                if ( (fDpt2V >= 1 ) ) then
                aDp2VE = uDptWE
                else
                aDp2VE = uDptWE - uVgHgE
                endif

!       Upper_depth_of_vegetation_layer_(minimum_=_0_m_=_surface)
                if ( (fDpt2V >= 1 ) ) then
                aDp1VE = uDptWE - uVgHgE
                else
                aDp1VE = 0.0
                endif

!       Vegetation_height_epi
                uVgHgL = cVegL *log( 1.0 + uVgHgh )
!       Vegetation_height_epi
                uVgHLS = cVegL *log( 1.0 + max (uVgHgh, min (uDpthW, cVgHgh) ) )
!       Vegetation_Light
                if ( (  uVgHgL > uVgHgE ) ) then
                uVgHLE = uVgHgE
                else
                uVgHLE = uVgHgL
                endif

!       Vegetation_Light
                uVgHLH =  uVgHgL - uVgHLE
!       Vegetation_biomass_hyp
                uDVgHy = uVgHgHyp / uVgHgh * aDVeg
!       Vegetation_biomass_epi
                uDVgEp = uVgHgE / uVgHgh * aDVeg
!       Vegetation_shading_factor
                if ( ( RdVgSh  ==  1) ) then
                uVgShd = mVgShd
                else
                uVgShd = fVgShd
                endif

!       Contribution_of_algae_to_extinction
                aExtPH = cExtSpDit * oDDitWHyp + cExtSG * oDGrWH + cExtSB * oDBlWH
!       Detrital_contribution_to_extinction
                aExtDH = cExtSpDet * oDDetWHyp
!       Contribution_of_inert_matter_to_extinction
                aExIMH = cExSIM * oDIMWH
!       Extinction_coefficient_without_vegetation
                aExCOH = cExtWt + aExIMH + aExtDH + aExtPH
!       Contribution_of_algae_to_extinction
                aExtPE = cExtSpDit * oDDitWEp + cExtSG * oDGrWE + cExtSB * oDBlWE
!       Detrital_contribution_to_extinction
                aExtDE = cExtSpDet * oDDetWEp
!       Contribution_of_inert_matter_to_extinction
                aExIME = cExSIM * oDIMWE
!       Extinction_coefficient_without_vegetation
                aExCOE = cExtWt + aExIME + aExtDE + aExtPE
!       Extinction_of_Blue_on_surface
                aExtSr = cExtSB * aDBlSr
!       Forcing_function_temperature
                aTmEpi =  cTmAvE - cTmVrE * cos(2.0*Pi*(sTime + TenDys - cTimLg) / DysInY)
!       Forcing_function_temperature
                aTmHyp =  cTmAvH - cTmVrH * cos(2.0*Pi*(sTime + TenDys - cTimLg) / DysInY)
!       Forcing_function_temperature
                if ( (0 == InclSs) ) then
                uTmEpi = cTmAvE
                else if ( (RedTmp == 1) ) then
                uTmEpi = mTmpEp
                else if ( ( aTmEpi > 0.0  ) ) then
                uTmEpi = aTmEpi
                else
                uTmEpi =  0.0
                endif

!       Forcing_function_temperature
                if ( (0 == InclSs) ) then
                uTmHyp = cTmAvH
                else if ( (RedTmp == 1) ) then
                uTmHyp = mTmpHy
                else if ( ( aTmHyp > 0.0  ) ) then
                uTmHyp = aTmHyp
                else
                uTmHyp =  0.0
                endif

!       Forcing_function_temperature
                if ( (aInclS == 1 ) ) then
                uTmBot = uTmHyp
                else
                uTmBot = uTmEpi
                endif

!       Forcing_function_temperature
                uTmSrf = uTmEpi
!       Latitude_conversion_to_radians
                uLAT= cLAT*2*Pi/360
!       Solar_Declination_angle
                if ((InclLt == 1) ) then
                uSlDcA = cPhiR*cos(2*Pi*(Day-cDayR)/DysInY)
                else
                uSlDcA = 0.0
                endif

!       Time_of_sun_rise
                uSunRs = HrsInD/(2*Pi)*acos((sin(uLAT)* sin(uSlDcA))/(cos(uLAT)*cos(uSlDcA)))
!       Time_of_sun_set
                uSunSt=HrsInD-uSunRs
!       Hours_of_sun_per_day
                uSnHrs=uSunSt-uSunRs
!       Integration_of_the_sunpath_over_the_local_rise_and_falls
                if ((InclLt == 1) ) then
                uSnPth = sin(uLAT)*sin( uSlDcA )*( uSunSt-uSunRs)- cos(uLAT) * cos (uSlDcA) * Hr&
                &sInD / (2*Pi) * ( sin (2*Pi*uSunSt/HrsInD ) -sin(2*Pi*uSunRs /HrsInD ))
                else
                uSnPth = 0.0
                endif

!       Transmissivity_atmosphere
                if (((InclLt == 1) .and. (CnstTr == 0)) ) then
                uTrans = (0.6-0.2*(uSnPth/(uSunSt - uSunRs)))*(1-0.4*fClodH) *(1-0.7* fClodM) *(&
                &1-0.4*fClodL)
                else if ( ((InclLt == 1) .and. (CnstTr == 1)) ) then
                uTrans = cTrans
                else
                uTrans = 0.0
                endif

!       Day_length
                if ( (0 == InclSs) ) then
                ufDay = cfDyAv
                else if ( (InclLt == 1) ) then
                ufDay = (uSunSt -uSunRs )/ HrsInD
                else
                ufDay = cfDyAv - cfDyVr * cos( 2.0 *Pi*(sTime+TenDys) / DysInY)
                endif

!       Total_daily_radiation
                if ( (0 == InclSs) ) then
                uLDay = cLDyAv
                else if ( (RedLOt == 1) ) then
                uLDay = 0.0
                else if ( (InclLt == 1) ) then
                uLDay = cSolar*uTrans*uSnPth * ScsPrD /HrsInD
                else
                uLDay = cLDyAv - cLDyVr * cos(2.0*Pi*(sTime+TenDys) / DysInY)
                endif

!       Average_light_intensity_during_daytime
                if ( (0 == InclSs) ) then
                uLOut = uLDay / ScsPrD / ufDay
                else if ( (RedLOt == 1) ) then
                uLOut = mLOut / ufDay
                else
                uLOut = uLDay / ScsPrD / ufDay
                endif

!       Average_PAR_at_zero_depth
                uLPARSr = fPAR * (1.0 - fRefl) * uLOut
!       Light_at_the_bottom_of_Surface
                if ( (InclSr == 1) ) then
                aLPARBS = uLPARSr * exp(- aExtSr)
                else
                aLPARBS = uLPARSr
                endif

!       Light_at_the_bottom_of_Epi
                aLPARBEO = aLPARBS * exp(- aExCOE * uDptWE)
!       Light_at_the_bottom_of_Epi
                aLPARBHO = aLPARBEO * exp(- aExCOH * uDptWH)
!       Light_at_top_of_vegetation_layer
                aLPAR1VE = aLPARBS * exp(- aExCOE * aDp1VE) * ( 1 - uVgShd )
!       Light_at_top_of_vegetation_layer
                aLPAR1VH = aLPAR1VE * exp(- aExCOH * aDp1VH)
!       Light_at_the_bottom_of_Epi
                if (  ( aInclS == 1 .and.  uVgHgh <= uDptWH ) ) then
                aLPARV = aLPAR1VH *   exp(- aExCOH * uVgHLE)
                else
                aLPARV = aLPAR1VE *  exp(- aExCOE * uVgHLE)  *  exp(- aExCOH * uVgHLE)
                endif

!       Average_temperature_for_vegetation
                uTmVgA = ( uVgHgHyp * uTmHyp + uVgHgE * uTmEpi ) / uVgHgh
!       Temperature_function_of_growth_vegetation
                uFnTmV = exp(-0.5/(cSgTmV*cSgTmV) *((uTmVgA-cTmOpV)*(uTmVgA-cTmOpV) - (cTmRef-cT&
                &mOpV)*(cTmRef-cTmOpV)))
!       Temperature_function_of_vegetation_production
                if ( ( UsExpV == 1 ) ) then
                uFnTPV = uFnTmV
                else
                uFnTPV = ( ( cQ10PV )** (0.1 * (uTmVgA - cTmRef)))
                endif

!       Half-sat_light_for_vegetation_production_at_current_temp
                uhLVeg = hLRfVg * uFnTPV
!       Integrated_PI_curve_over_depth_for_vegetation
                if ( ( aInclS == 1 .and.  uVgHgh > uDptWH ) ) then
                aLPIVg = cPMax*(aLPAR1VE- aLPARV + uhLVeg*log((1.0 +aLPARV/ uhLVeg)  /(1.0 +aLPA&
                &R1VE  / uhLVeg) + NearZr  ) )
                else if (  ( aInclS == 1 .and.  uVgHgh <= uDptWH ) ) then
                aLPIVg = cPMax*( aLPAR1VH- aLPARV + uhLVeg* log((1.0 +aLPARV/ uhLVeg)  / (1.0 +a&
                &LPAR1VH  / uhLVeg) ) )
                else
                aLPIVg = cPMax * (aLPAR1VE- aLPARV + uhLVeg*log((1.0 +aLPARV/ uhLVeg)  /(1.0 +aL&
                &PAR1VE  / uhLVeg) + NearZr  ) )
                endif

!       Day_at_which_plants_change_strategy_towards_overwintering
                if ( ( cLAT < 0 .and. Day >= 265 .and. Day <= 356 ) ) then
                aSprng = 1
                else if ( ( cLAT > 0 .and. Day >= 80 .and. Day <= 173) ) then
                aSprng = 1
                else if ( ( cLAT == 0) ) then
                aSprng = 1
                else
                aSprng = 0
                endif

!       Day_at_which_plants_change_strategy_towards_overwintering
                if ( ( sTime < StrtTm + 1.0 ) ) then
                aTmWnV = -999
                else if ( ( UsPhtV == 0  .and.  ( uTmBot >= cTmInV )  .and. aSprng == 1 ) ) then
                        aTmWnV = sTime
                else if ( (UsPhtV == 1  .and.  uSnHrs >= cPhtIV   .and. aSprng == 1 ) ) then
                aTmWnV = sTime
                else if ( (( aLPIVg / uVgHgL )<= cLAllV ) ) then
                aTmWnV = aTmWnV
                else if ( (floor ( sTime+ 0.3 ) - floor (aTmWnV + 0.3) > 1 .and. floor ( sTime+ &
                &0.3 ) - floor (aTmWnV + 0.3) < cVgWnL ) ) then
                aTmWnV = aTmWnV
                else
                aTmWnV = sTime
                endif

!       Counter_for_start_off_plant_growth_in_summer
                if ( ( sTime < StrtTm + 1.0 ) ) then
                aTmInV = -999
                else if ( ( floor ( sTime+ 0.3 ) - floor (aTmWnV + 0.3) > 1 ) ) then
                aTmInV = sTime
                else if ( ( UsPhtV == 0  .and.  uTmBot >= cTmInV ) ) then
                aTmInV = aTmInV
                else if ( ( UsPhtV == 1  .and.    uSnHrs >= cPhtIV  ) ) then
                aTmInV = aTmInV
                else if ( (UsPhtV == 0  .and.  uTmBot < cTmInV .and. ( ( aLPIVg / uVgHgL ) >= cL&
                &AllV ) .and. floor ( sTime+ 0.3 ) - floor (aTmInV + 0.3) > 1) ) then
                aTmInV = aTmInV
                else if ( (UsPhtV == 1  .and.   uSnHrs < cPhtIV .and. ( ( aLPIVg / uVgHgL ) >= c&
                &LAllV ) .and. floor ( sTime+ 0.3 ) - floor (aTmInV + 0.3) > 1) ) then
                aTmInV = aTmInV
                else if ( (floor ( sTime+ 0.3 ) - floor (aTmInV + 0.3) > 1 .and. floor ( sTime+ &
                &0.3 ) - floor (aTmInV + 0.3) < cVgInL ) ) then
                aTmInV = aTmInV
                else
                aTmInV = sTime
                endif

!       Counter_for_termination_of_plant_growth_in_winter_corrected_for_backward_compatibility
                if ( ( UsLWnV <= NearZr ) ) then
                aTmWVC = floor (TimYrs - 1) + cDyWnV
                else
                aTmWVC = aTmWnV
                endif

!       Initial_growth_only_once_a_year
                if ( (Day < 1.0 .or. sTime < StrtTm + 1.0) ) then
                aDyInV = 367
                else if ( (uTmBot >= cTmInV .and. aDyInV > 366) ) then
                aDyInV = Day
                else
                aDyInV = aDyInV
                endif

!       Counter_for_start_off_plant_growth_in_summer_corrected_for_backward_compatibility
                if ( (UsPhtV <= NearZr .and. UsLWnV <= NearZr ) ) then
                aTmIVC =  (TimYrs - 1)  + aDyInV
                else
                aTmIVC = aTmInV
                endif

!       Switch_showing_if_plant_is_in_summer_mode
                if ( ( floor ( aTmIVC + 0.3) < floor (  sTime + 0.3 ) .and. floor ( aTmWVC + 0.3&
                & ) == floor (  sTime  + 0.3 ) ) ) then
                aVegSm = 1
                else
                aVegSm = 0
                endif

!       Switch_showing_if_plant_is_in_winter_mode
                aVegWn =  1 - aVegSm
!       Days_that_plants_have_been_in_summer_mode
                aDysVS = ( floor ( sTime+ 0.3) - floor (aTmIVC + 0.3) ) * aVegSm
!       Days_that_plants_have_been_in_winter_mode
                aDysVW = ( floor ( sTime + 0.3) - floor ( aTmWVC  + 0.3 )  ) * aVegWn
!       Setting_root_fraction
                if ( (0 == InclSs) ) then
                bfRtVg = fRtVgS
                else if ( (aVegWn == 1 .and. aDysVW > cLngAl) ) then
                bfRtVg = fRtVgW
                else if ( (aVegSm == 1 .and. aDysVS <= cLngAl) ) then
                bfRtVg = 0.5*(fRtVgW + fRtVgS) + 0.5*(fRtVgW - fRtVgS) * cos ( Pi /cLngAl * ( sT&
                &ime - aTmIVC ))
                else if ( ( aVegWn == 1 .and. aDysVW == 0) ) then
                bfRtVg = fRtVgW
                else if ( ( aVegWn == 1) ) then
                bfRtVg = 0.5*( fRtVgW + fRtVgS) - 0.5*( fRtVgW - fRtVgS) * cos ( Pi / cLngAl * (&
                & sTime - aTmWVC ))
                else
                bfRtVg = fRtVgS
                endif

!       Shoot_fraction
                bfShtV = 1.0 - bfRtVg
!       Shoot_biomass
                aDShtV = bfShtV * aDVeg
!       Emergent_biomass
                aDEmrV = fEmrgV * aDShtV
!       Floating_biomass
                if (  ( aDp1VE < 0.005 ) ) then
                aDFltV = fFltVg * aDShtV
                else
                aDFltV = 0
                endif

!       Submerged_fraction_of_shoot
                bfSbVg = 1.0 - fFltVg - fEmrgV
!       Submerged_biomass
                aDSbVg = bfSbVg * aDShtV
!       Contribution_of_plant_species_to_extinction_(submerged)
                aExtVH = cExtSV * aDSbVg / uDptWH * (uVgHgHyp /uDpthW )
!       Extinction_coefficient_incl_vegetation
                aExtCH = aExCOH + aExtVH
!       Contribution_of_plant_species_to_extinction_(submerged)
                aExtVE = cExtSV * aDSbVg / uDptWE * (uVgHgE /uDpthW )
!       Extinction_coefficient_incl_vegetation
                aExtCE = aExCOE + aExtVE
!       Light_at_the_bottom_of_Epi
                aLPARBtE = aLPARBS * exp(- aExtCE * uDptWE)
!       Light_at_the_top_of_Hyp
                if ( ( aInclS == 1 ) ) then
                uLPARSH = aLPARBtE
                else
                uLPARSH = 0.0
                endif

!       Light_at_bottom_of_vegetation_layer
                aLPAR2VE = aLPAR1VE * exp(- aExtCE * (aDp2VE - aDp1VE))
!       Light_at_bottom_of_vegetation_layer
                aLPAR2VH = aLPAR1VH * exp(- aExtCH * (aDp2VH - aDp1VH))
!       Forcing_function_wind_speed
                if ( (RdVWnd == 1)) then
                uVWind = mVWind + NearZr
                else
                uVWind = cVWind  + NearZr
                endif

!       Forcing_function_wind_speed_at_surface
                uVWndS = (uVWind * ( ( ( cWndHS / cWndHR ) )** ( cWndHC ) ) ) + NearZr
!       Correction_of_wave_for_wind_direction
                if ( UsMchR == 1 ) then
                aWndCr = ( ((uVWind* cos ( ( cWavDr- cWndDr) *cDgTRd )))** (2) )
                else
                aWndCr = 0.0
                endif

!       Presence_of_stratification
                if ( (RdStrt == 1) ) then
                aStrat = mStrat
                else if ( ((uTmEpi -uTmHyp) >  cStrtT .or. (uTmHyp -uTmEpi) >  cStrtT) ) then
                aStrat = 1.0
                else
                aStrat = 0.0
                endif

!       Seasonal_inflow
                if ( (0 == UsSsnL) ) then
                uQInSs = 0.0
                else if ( (Day < cDyAp1 - 0.5*cLngCh) ) then
                uQInSs = cQInWn
                else if ( (Day < cDyAp1 + 0.5*cLngCh) ) then
                uQInSs = 0.5*(cQInWn + cQInSm) + 0.5*(cQInWn - cQInSm) * cos(Pi/cLngCh * (Day - &
                &cDyAp1))
                else if ( (Day < cDyOc1 - 0.5*cLngCh) ) then
                uQInSs = cQInSm
                else if ( (Day < cDyOc1 + 0.5*cLngCh) ) then
                uQInSs = 0.5*(cQInWn + cQInSm) - 0.5*(cQInWn - cQInSm) * cos(Pi/cLngCh * (Day - &
                &cDyOc1))
                else
                uQInSs = cQInWn
                endif

!       Sinusoid_evaporation
                uQEvSn = cQEvAv - cQEvVr * cos(2.0*Pi * (sTime + TenDys - cTimLg) / DysInY)
!       Evaporation_from_heat_based_on_Thornthwaite
                if ( (10 *uTmEpi /cHeat) <= NearZr ) then
                aQEv = 16 * 2*ufDay * 1 / 30 * ( ( NearZr )** (cAlpha) )
                else
                aQEv = 16 * 2*ufDay * 1 / 30 * ( ( 10 *uTmEpi /cHeat )** (cAlpha) )
                endif

!       Evaporation
                if ( (0 == InclSs) ) then
                uQEv = cQEvAv
                else if ( (RedQEv == 1) ) then
                uQEv = mQEv
                else if ( (clcQEv == 1 ) ) then
                uQEv = aQEv
                else
                uQEv = uQEvSn
                endif

!       Change_in_water_depth
                if ( ( RdDptW == 1 ) ) then
                uDptDM = mDpthW - uDpthW
                else
                uDptDM = 0.0
                endif

!       Correction_for_water_inflow_when_depth_is_measured
                if ( (uDptDM >= 0) ) then
                uQInCr = uDptDM * cMxWOt * mmPerm
                else
                uQInCr = 0.0
                endif

!       Correction_for_water_outflow_when_depth_is_measured
                if ( (uDptDM < 0) ) then
                uQOtCr = -1 * uDptDM * cMxWOt * mmPerm
                else
                uQOtCr = 0.0
                endif

!       Inflow_epilimnion
                if ( ((RedQIn == 1) .or. (RdTrnF == 1)) ) then
                uQInEp = mQInEp + uQInCr
                else if ( (UsSsnL == 1) ) then
                uQInEp = uQInSs + uQInCr
                else
                uQInEp = cQInEp + uQInCr
                endif

!       Inflow_hypolimnion
                if ( (aInclS == 0) ) then
                uQInHy = 0.0
                else if ( ((RedQIn == 1) .or. (RdTrnF == 1)) ) then
                uQInHy = mQInHy
                else
                uQInHy = 0.0
                endif

!       Inflow_total
                aQInTt = uQInEp + uQInHy
!       Inflow_precipitation_to_epilimnion
                if ( (RdQPrc == 1) ) then
                uQPrec = mQPrec
                else
                uQPrec = 0
                endif

!       Inflow_from_groundwater_called_seepage
                if ( (RdQGrn == 1) ) then
                uQInSp = mQInSp
                else
                uQInSp = cQInSp
                endif

!       Outflow_to_groundwater_called_infiltration
                if ( (RdQGrn == 1) ) then
                uQOtIn = mQOtIn
                else
                uQOtIn = cQOtIn
                endif

!       Outflow_epilimnion_via_water_abstraction_filters
                if ( (RdQOtA == 1 .and. mQOtAE > NearZr) ) then
                uQOtAE = mQOtAE
                else
                uQOtAE = 0.0
                endif

!       Outflow_hypolimnion_via_water_abstraction_filters
                if ( (aInclS == 1) ) then
                uQOtAH = 0.0
                else if ( (RdQOtA == 1 .and. mQOtAH > NearZr) ) then
                uQOtAH = mQOtAH
                else
                uQOtAH = 0.0
                endif

!       Net_outflow_epilimnion_via_water_abstraction_filters
                if ( (UsAbsC == 0) ) then
                uQOANE = uQOtAE
                else
                uQOANE = uQOtAE - ( fAbsCE * uQOtAE + fAbsCE * uQOtAH)
                endif

!       Net_outflow_hypolimnion_via_water_abstraction_filters
                if ( (aInclS == 0) ) then
                uQOANH = 0.0
                else if ( (UsAbsC == 0) ) then
                uQOANH =  uQOtAH
                else
