!       Porosity
                bPorSM = (1.0 - fDTSM0) * (fDOSM0 * cRhoOM +(1 - fDOSM0) * cRhoIM) / cRhoWt /(fD&
                &TSM0 + (1.0 - fDTSM0) * (fDOSM0 * cRhoOM +(1 - fDOSM0) * cRhoIM) / cRhoWt)
!       Sediment_porosity_corrected_for_tortuosity
                if ( ( ( bPorSM )** (bPorSM + 1.0)) <= NearZr ) then
                bPrCSM = 1
