                else if ( (Day < cDyAp1 - 0.5*cLngCh) ) then
                uPLdSE = cPLdWn
                else if ( (Day < cDyAp1 + 0.5*cLngCh) ) then
                uPLdSE = 0.5*(cPLdWn + cPLdSm) + 0.5*(cPLdWn - cPLdSm) * cos(Pi/cLngCh * (Day - &
                &cDyAp1))
                else if ( (Day < cDyOc1 - 0.5*cLngCh) ) then
                uPLdSE = cPLdSm
                else if ( (Day < cDyOc1 + 0.5*cLngCh) ) then
                uPLdSE = 0.5*(cPLdWn + cPLdSm) - 0.5*(cPLdWn - cPLdSm) * cos(Pi/cLngCh * (Day - &
                &cDyOc1))
