                if ( (RdTrnF == 1) ) then
                uPLPO4E = mPLPO4E
                else if ( (RedPLd == 0) ) then
                uPLPO4E = fPO4In * uPLdEp
                else if ( (RdNtFr == 1) ) then
                uPLPO4E = mPLPO4E
                else
                uPLPO4E = fPO4In * uPLdEp
                endif

!       P_load_bound_to_org_matter_epilimnion
                if ( (0 == RedPLd) ) then
                uPLdOE = (1.0 - fPO4In) * uPLdEp
                else if ( (RdNtFr == 1) ) then
                uPLdOE = mPLdOE
                else
                uPLdOE = (1.0 - fPO4In) * uPLdEp
                endif

!       (total)_algal_P_input_epilimnion
                if ( (0 == InclSs) ) then
                uPLPTE = (((fPhyIS + fPhyIW)/2)*uPLdOE)
                else if ( (RdPLdP == 1) ) then
                uPLPTE = mPLPTE
                else
                uPLPTE = ((fPhyIS+fPhyIW)/2.0 - (fPhyIS-fPhyIW)/2.0 * cos(2.0*Pi * (sTime + TenD&
                &ys - cTimLg) / DysInY)) * uPLdOE
                endif

!       Detrital_P_input_epilimnion
                if ( (RdTrnF == 1) ) then
                uPLoadDetE = mPLdDetEp
                else
                uPLoadDetE = uPLdOE - uPLPTE
                endif

!       Adsorbed_P_loading_epilimnion
                if ( (RdTrnF == 1) ) then
                uPLAIME = mPLAIME
                else
                uPLAIME = 0.0
                endif

!       P_background_loading_into_the_hypolimnion
                if ( (0 == aInclS) ) then
                uPBcLH = 0.0
                else
                uPBcLH = cPBckL
                endif

!       External_P_concentration
                uPTtIE = uPLdEp / (uQInEp / mmPerm + NearZr)
!       Seasonal_N_load_for_epilimnion
                if ( (0 == UsSsnL) ) then
                uNLdSE = 0.0
                else if ( (Day < cDyAp1 - 0.5*cLngCh) ) then
                uNLdSE = cNLdWn
                else if ( (Day < cDyAp1 + 0.5*cLngCh) ) then
                uNLdSE = 0.5*(cNLdWn + cNLdSm) + 0.5*(cNLdWn - cNLdSm) * cos(Pi/cLngCh * (Day - &
                &cDyAp1))
                else if ( (Day < cDyOc1 - 0.5*cLngCh) ) then
                uNLdSE = cNLdSm
                else if ( (Day < cDyOc1 + 0.5*cLngCh) ) then
                uNLdSE = 0.5*(cNLdWn + cNLdSm) - 0.5*(cNLdWn - cNLdSm) * cos(Pi/cLngCh * (Day - &
                &cDyOc1))
                else
                uNLdSE = cNLdWn
                endif

!       (total)_algal_N_input_epilimnion
                if ( (RdNtFr == 0) ) then
                uNLPTE = (cNPPhI * uPLPTE)
                else
                uNLPTE =  mNLPTE
                endif

!       N_load_epilimnion
                if ( (InclTr == 0) ) then
                uNLdEp = 0.0
                else if ( (RdTrnF == 1) ) then
                uNLdEp = (mNLNH4E + mNLNO3E + mNLdGE + mNLdDitEp + mNLdBE + mNLdDetEp)
                else if ( (RedNLd == 1 .and. RdNtFr == 1) ) then
                uNLdEp = mNLNH4E + mNLNO3E + mNLdOE
                else if ( (RedNLd == 1 .and. RdNtFr == 0) ) then
                uNLdEp = mNLdEp
                else if ( (UsPlsL == 1) ) then
                uNLdEp = 0.0
                else if ( (RedPLd == 1) ) then
                uNLdEp = cNPLdM * uPLdEp
                else if ( (UsSsnL == 1) ) then
                uNLdEp = uNLdSE
                else
                uNLdEp = cNLoad
                endif

!       N_load_detritus_epilimnion
                if ( (RdTrnF == 1) ) then
                uNLoadDetE = mNLdDetEp
                else if ( (RedNLd == 0 ) ) then
                uNLoadDetE = min(cNPDtI * uPLoadDetE, uNLdEp - uNLPTE)
                else if ( (RdNtFr == 1) ) then
                uNLoadDetE = mNLdOE - mNLPTE
                else
                uNLoadDetE = min(cNPDtI * uPLoadDetE, uNLdEp - uNLPTE)
                endif

!       Loading_N_bound_to_org_matter_in_epilimnion
                if ( (0 == RedNLd) ) then
                uNLdOE = uNLPTE + uNLoadDetE
                else if ( (RdNtFr == 1) ) then
                uNLdOE = mNLdOE
                else
                uNLdOE = uNLPTE + uNLoadDetE
                endif

!       N_loading_dissolved_(sum_of_NO2_and_NH4)_in_epilimnion
                if ( (0 == RedNLd) ) then
                uNLdDsE = uNLdEp - uNLdOE
                else if ( (RdNtFr == 1) ) then
                uNLdDsE = 0.0
                else
                uNLdDsE = uNLdEp - uNLdOE
                endif

!       NH4_loading_epilimnion
                if ( (RdTrnF == 1) ) then
                uNLNH4E = mNLNH4E
                else if ( (RedNLd == 0) ) then
                uNLNH4E = fNH4DI * uNLdDsE
                else if ( (RdNtFr == 1) ) then
                uNLNH4E = mNLNH4E
                else
                uNLNH4E = fNH4DI * uNLdDsE
                endif

!       NO3_loading
                if ( (RdTrnF == 1) ) then
                uNLNO3E = mNLNO3E
                else if ( (RedNLd == 0) ) then
                uNLNO3E = (1.0 - fNH4DI) * uNLdDsE
                else if ( (RdNtFr == 1) ) then
                uNLNO3E = mNLNO3E
                else
                uNLNO3E = (1.0 - fNH4DI) * uNLdDsE
                endif

!       N_background_loading_into_the_hypolimnion
                if ( (0 == aInclS) ) then
                uNBcLH = 0.0
                else
                uNBcLH = cNBckL
                endif

!       External_N_conc
                uNTtIE = uNLdEp / (uQInEp / mmPerm + NearZr)
!       Detrital_DW_loading_epilimnion
                if ( (RdTrnF == 1) ) then
                uDLoadDetE = mDLdDetEp
                else if ( (RdDLdD == 1) ) then
                uDLoadDetE = mDLdDetEp
                else
                uDLoadDetE = uNLoadDetE / cNDDtI
                endif

!       (total)_algal_DW_input_epilimnion
                uDLPTE = uNLPTE / cNDPhI
!       Loading_of_DW_of_inorg_matter
                if ( (InclTr == 0) ) then
                uDLIME = 0.0
                else if ( (RdTrnF == 1) ) then
                uDLIME = mDLIME
                else if ( (RdDLIM == 1) ) then
                uDLIME = mDLIME
                else
                uDLIME = cDIMIn * uQInEp / mmPerm
                endif

!       Total_DW_input_epilimnion
                if ( (InclTr == 0) ) then
                uDLdEp = 0.0
                else if ( (RdTrnF == 1) ) then
                uDLdEp = (mDLIME + mDLdDetEp + mDLdDitEp + mDLdGE + mDLdBE)
                else
                uDLdEp = uDLIME + uDLoadDetE + uDLPTE
                endif

!       D_in_diatoms_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uDLoadDitE = mDLdDitEp
                else
                uDLoadDitE = fDtPhI * uDLPTE
                endif

!       P_in_diatoms_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uPLoadDitE = mPLdDitEp
                else
                uPLoadDitE = fDtPhI * uPLPTE
                endif

!       N_in_diatoms_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uNLoadDitE = mNLdDitEp
                else
                uNLoadDitE = fDtPhI * uNLPTE
                endif

!       D_in_greens_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uDLdGE = mDLdGE
                else
                uDLdGE = fGrnPI * uDLPTE
                endif

!       P_in_greens_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uPLdGE = mPLdGE
                else
                uPLdGE = fGrnPI * uPLPTE
                endif

!       N_in_greens_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uNLdGE = mNLdGE
                else
                uNLdGE = fGrnPI * uNLPTE
                endif

!       D_in_bluegreens_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uDLdBE = mDLdBE
                else
                uDLdBE = fBlPhI * uDLPTE
                endif

!       P_in_bluegreens_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uPLdBE = mPLdBE
                else
                uPLdBE = fBlPhI * uPLPTE
                endif

!       N_in_bluegreens_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uNLdBE = mNLdBE
                else
                uNLdBE = fBlPhI * uNLPTE
                endif

!       D_in_zooplankton_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uDLdZE = mDLdZE
                else
                uDLdZE = cDZoIn * uQInEp / mmPerm
                endif

!       P_in_zooplankton_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uPLdZE = mPLdZE
                else
                uPLdZE = cDZoIn * cPDZRf * uQInEp / mmPerm
                endif

!       N_in_zooplankton_loading_for_epilimnion
                if ( (RdTrnF == 1) ) then
                uNLdZE = mNLdZE
                else
                uNLdZE = cDZoIn * cNDZRf * uQInEp / mmPerm
                endif

!       Total_transport_flux_of_Si_in_sio2
                if ( (RdTrnF == 1) ) then
                uSLSO2E = mSLSO2E
                else
                uSLSO2E = cSO2In * uQInEp / mmPerm
                endif

!       Total_transport_flux_of_Si_in_Det
                if ( (RdTrnF == 1) ) then
                uSiLoadDeE = mSLdDE
                else
                uSiLoadDeE = cSDDtI * uDLoadDetE
                endif

!       Total_transport_flux_of_Si_in_Diat
                uSiLoadDiE = cSiDDt * uDLoadDitE
!       Silica_loading_epilimnion
                if ( (InclTr == 0) ) then
                uSLdEp = 0.0
                else
                uSLdEp = uSLSO2E + uSiLoadDeE + uSiLoadDiE
                endif

!       D_in_bluegreens_loading_for_surface
                if ( (RdTrnF == 1) ) then
                uDLdBS = mDLdBS
                else
                uDLdBS = 0.0
                endif

!       P_in_bluegreens_loading_for_surface
                if ( (RdTrnF == 1) ) then
                uPLdBS = mPLdBS
                else
                uPLdBS = 0.0
                endif

!       N_in_bluegreens_loading_for_surface
                if ( (RdTrnF == 1) ) then
                uNLdBS = mNLdBS
                else
                uNLdBS = 0.0
                endif

!       NH4_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uNLNH4H = 0.0
                else if ( (RdTrnF == 1) ) then
                uNLNH4H = mNLNH4H
                else
                uNLNH4H = 0
                endif

!       NO3_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uNLNO3H = 0.0
                else if ( (RdTrnF == 1) ) then
                uNLNO3H = mNLNO3H
                else
                uNLNO3H = 0
                endif

!       PO4_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uPLPO4H = 0.0
                else if ( (RdTrnF == 1) ) then
                uPLPO4H = mPLPO4H
                else
                uPLPO4H = 0
                endif

!       P_adsorbed_onto_IM_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uPLAIMH = 0.0
                else if ( (RdTrnF == 1) ) then
                uPLAIMH = mPLAIMH
                else
                uPLAIMH = 0
                endif

!       Si_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uSLSO2H = 0.0
                else if ( (RdTrnF == 1) ) then
                uSLSO2H = mSLSO2H
                else
                uSLSO2H = 0
                endif

!       O2_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uO2LdH = 0.0
                else if ( (RdTrnF == 1) ) then
                uO2LdH = mO2LdH
                else
                uO2LdH = cO2In * uQInHy / mmPerm
                endif

!       D_in_detritus_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uDLoadDetH = 0.0
                else if ( (RdTrnF == 1) ) then
                uDLoadDetH = mDLdDetHyp
                else
                uDLoadDetH = 0
                endif

!       N_in_detritus_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uNLoadDetH = 0.0
                else if ( (RdTrnF == 1) ) then
                uNLoadDetH = mNLdDetHyp
                else
                uNLoadDetH = 0
                endif

!       P_in_detritus_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uPLoadDetH = 0.0
                else if ( (RdTrnF == 1) ) then
                uPLoadDetH = mPLdDetHyp
                else
                uPLoadDetH = 0
                endif

!       Si_in_detritus_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uSiLoadDeH = 0.0
                else if ( (RdTrnF == 1) ) then
                uSiLoadDeH = mSLdDH
                else
                uSiLoadDeH = 0
                endif

!       D_in_inorg_matter_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uDLIMH = 0.0
                else if ( (RdTrnF == 1) ) then
                uDLIMH = mDLIMH
                else
                uDLIMH = 0
                endif

!       D_in_diatoms_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uDLoadDitH = 0.0
                else if ( (RdTrnF == 1) ) then
                uDLoadDitH = mDLdDitHyp
                else
                uDLoadDitH = 0
                endif

!       N_in_diatoms_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uNLoadDitH = 0.0
                else if ( (RdTrnF == 1) ) then
                uNLoadDitH = mNLdDitHyp
                else
                uNLoadDitH = 0
                endif

!       P_in_diatoms_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uPLoadDitH = 0.0
                else if ( (RdTrnF == 1) ) then
                uPLoadDitH = mPLdDitHyp
                else
                uPLoadDitH = 0
                endif

!       Si_in_diatoms_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uSiLoadDiH = 0.0
                else if ( (RdTrnF == 1) ) then
                uSiLoadDiH = cSiDDt * uDLoadDitH
                else
                uSiLoadDiH = 0
                endif

!       D_in_greens_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uDLdGH = 0.0
                else if ( (RdTrnF == 1) ) then
                uDLdGH = mDLdGH
                else
                uDLdGH = 0
                endif

!       N_in_greens_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uNLdGH = 0.0
                else if ( (RdTrnF == 1) ) then
                uNLdGH = mNLdGH
                else
                uNLdGH = 0
                endif

!       P_in_greens_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uPLdGH = 0.0
                else if ( (RdTrnF == 1) ) then
                uPLdGH = mPLdGH
                else
                uPLdGH = 0
                endif

!       D_in_bluegreens_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uDLdBH = 0.0
                else if ( (RdTrnF == 1) ) then
                uDLdBH = mDLdBH
                else
                uDLdBH = 0
                endif

!       N_in_bluegreens_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uNLdBH = 0.0
                else if ( (RdTrnF == 1) ) then
                uNLdBH = mNLdBH
                else
                uNLdBH = 0
                endif

!       P_in_bluegreens_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uPLdBH = 0.0
                else if ( (RdTrnF == 1) ) then
                uPLdBH = mPLdBH
                else
                uPLdBH = 0
                endif

!       D_in_zooplankton_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uDLdZH = 0.0
                else if ( (RdTrnF == 1) ) then
                uDLdZH = mDLdZH
                else
                uDLdZH = 0
                endif

!       N_in_zooplankton_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uNLdZH = 0.0
                else if ( (RdTrnF == 1) ) then
                uNLdZH = mNLdZH
                else
                uNLdZH = 0
                endif

!       P_in_zooplankton_loading_for_hypolimnion
                if ( (aInclS == 0) ) then
                uPLdZH = 0.0
                else if ( (RdTrnF == 1) ) then
                uPLdZH = mPLdZH
                else
                uPLdZH = 0
                endif

!       Total_DW_load_hypolimnion
                if ( (InclTr == 0) ) then
                uDLdHy = 0.0
                else if ( (aInclS == 0) ) then
                uDLdHy = 0.0
                else if ( (RdTrnF == 1) ) then
                uDLdHy = (mDLIMH + mDLdDetHyp + mDLdDitHyp + mDLdGH + mDLdBH)
                else
                uDLdHy = 0.0
                endif

!       Total_N_load_hypolimnion
                if ( (InclTr == 0) ) then
                uNLdHy = 0.0
                else if ( (aInclS == 0) ) then
                uNLdHy = 0.0
                else if ( (RdTrnF == 1) ) then
                uNLdHy = (mNLNH4H + mNLNO3H + mNLdGH + mNLdDitHyp + mNLdBH + mNLdDetHyp)
                else
                uNLdHy = 0.0
                endif

!       Total_P_load_hypolimnion
                if ( (InclTr == 0) ) then
                uPLdHy = 0.0
                else if ( (aInclS == 0) ) then
                uPLdHy = 0.0
                else if ( (RdTrnF == 1) ) then
                uPLdHy = (mPLPO4H + mPLAIMH + mPLdDitHyp + mPLdGH + mPLdBH + mPLdDetHyp)
                else
                uPLdHy = 0.0
                endif

!       Total_Si_load_hypolimnion
                if ( (InclTr == 0) ) then
                uSLdHy = 0.0
                else if ( (aInclS == 0) ) then
                uSLdHy = 0.0
                else
                uSLdHy = uSLSO2H + uSiLoadDeH + uSiLoadDiH
                endif

!       Dilution_of_DW_IM
                wDDIMH = ukOtHy * oDIMWH
!       Dilution_of_detritus
                wDDilDetH = ukOtHy * oDDetWHyp
!       Dilution_of_Gren
                wDDlGH = ukOtHy * oDGrWH
!       Dilution_of_Blue
                wDDlBH = ukOtHy * oDBlWH
!       Dilution_of_Diat
                wDDilDitH = ukOtHy * oDDitWHyp
!       Total_zooplankton_dilution
                wDDlZH = ukOtHy * oDZHyp
!       Total_zooplankton_dilution
                wPDlZH = ukOtHy * oPZHyp
!       Total_zooplankton_dilution
                wNDlZH = ukOtHy * oNZHyp
!       Dilution_of_SRP
                wPDPO4H = ukOtHy * oPO4WH
!       Dilution_of_detritus
                wPDilDetH = ukOtHy*oPDetWHyp
!       Dilution_of_IM-ads_P
                wPDAIMH = ukOtHy * oPAIMWH
!       Dilution_of_ammonium
                wNDNH4H = ukOtHy * oNH4WH
!       Dilution_of_nitrate
                wNDNO3H = ukOtHy * oNO3WH
!       Dilution_of_detritus
                wNDilDetH = ukOtHy * oNDetWHyp
!       Oxygen_outflow
                wO2OtH = ukOtHy * oO2WHy
!       Dilution_of_Diat
                wPDilDitH = ukOtHy * oPDitWHyp
!       Dilution_of_Diat
                wNDilDitH = ukOtHy * oNDitWHyp
!       Dilution_of_Gren
                wPDlGH = ukOtHy * oPGrWH
!       Dilution_of_Gren
                wNDlGH = ukOtHy * oNGrWH
!       Dilution_of_Blue
                wPDlBH = ukOtHy * oPBlWH
!       Dilution_of_Blue
                wNDlBH = ukOtHy * oNBlWH
!       Dilution_of_Si_in_sio2
                wSDSO2H = ukOtHy * oSO2WH
!       Dilution_of_Si_in_detritus
                wSiDilDetH = ukOtHy * oSDtWH
!       Dilution_of_Si_in_diatoms
                wSiDilDitH = cSiDDt * wDDilDitH
!       Total_algal_dilution
                wDDlPH = wDDilDitH + wDDlGH + wDDlBH
!       Total_algal_dilution
                wPDlPH = wPDilDitH + wPDlGH + wPDlBH
!       Total_algal_dilution
                wNDlPH = wNDilDitH + wNDlGH + wNDlBH
!       Total_SI_dilution_fluxes
                wSDlTH = wSiDilDetH + wSDSO2H + wSiDilDitH
!       Outflow_of_DW
                wDOtTH = ukOtHy * oDSsWH
!       Outflow_of_P
                wPOtTH = ukOtHy * oPTtWH
!       Outflow_of_N
                wNOtTH = ukOtHy * oNTtWH
!       Total_Si_surface_outflow
                wSOtTH = ukOtHy * (oSO2WH + oSDtWH + cSiDDt * oDDitWHyp)
!       Transport_flux_of_D_in_Diat
                if ( (0 == InclTr) ) then
                wDTrDH = 0.0
                else
                wDTrDH = uDLoadDitH / uDptWH - wDDilDitH
                endif

!       Transport_flux_of_P_in_Diat
                if ( (0 == InclTr) ) then
                wPTrDH = 0.0
                else
                wPTrDH = uPLoadDitH / uDptWH - wPDilDitH
                endif

!       Transport_flux_of_N_in_Diat
                if ( (0 == InclTr) ) then
                wNTrDH = 0.0
                else
                wNTrDH = uNLoadDitH / uDptWH - wNDilDitH
                endif

!       Transport_flux_of_D_in_Gren
                if ( (0 == InclTr) ) then
                wDTrGH = 0.0
                else
                wDTrGH = uDLdGH / uDptWH - wDDlGH
                endif

!       Transport_flux_of_P_in_Gren
                if ( (0 == InclTr) ) then
                wPTrGH = 0.0
                else
                wPTrGH = uPLdGH / uDptWH - wPDlGH
                endif

!       Transport_flux_of_N_in_Gren
                if ( (0 == InclTr) ) then
                wNTrGH = 0.0
                else
                wNTrGH = uNLdGH / uDptWH - wNDlGH
                endif

!       Transport_flux_of_D_in_Blue
                if ( (0 == InclTr) ) then
                wDTrBH = 0.0
                else
                wDTrBH = uDLdBH / uDptWH - wDDlBH
                endif

!       Transport_flux_of_P_in_Blue
                if ( (0 == InclTr) ) then
                wPTrBH = 0.0
                else
                wPTrBH = uPLdBH / uDptWH - wPDlBH
                endif

!       Transport_flux_of_N_in_Blue
                if ( (0 == InclTr) ) then
