!       Total_P_flux_from_Vegetation_module_to_PO4_in_water
                if ( (aInclS == 1 .and. InclVg == 1 ) ) then
                wPBPO4WH = (- tPUVWH + tPExVW * uVgHgHyp / uVgHgh + tPMVPO4WH ) /uDptWH
                else
                wPBPO4WH = 0.0
                endif

!       Total_P_flux_from_Vegetation_module_to_water_detritus
                if ( (aInclS == 1 .and. InclVg == 1) ) then
                wPBDWH = (tPMVDWH ) / uDptWH
                else
                wPBDWH = 0.0
                endif

!       Total_N_flux_from_Vegetation_module_to_NH4_in_water
                if ( (aInclS == 1 .and. InclVg == 1 ) ) then
                wNBNH4WH = (- tNUNH4VWH + tNExVW * (uVgHgHyp /uVgHgh ) + tNMVNH4WH ) / uDptWH
                else
                wNBNH4WH = 0.0
                endif

!       Total_N_flux_from_Vegetation_module_to_NO3_in_water
                if ( (aInclS == 1 .and. InclVg == 1) ) then
                wNBNO3WH = - tNUNO3VWH / uDptWH
                else
                wNBNO3WH = 0.0
                endif

!       Total_N_flux_from_Vegetation_module_to_water_detritus
                if ( (aInclS == 1 .and. InclVg == 1) ) then
                wNBDWH = (tNMVDWH ) / uDptWH
                else
                wNBDWH = 0.0
                endif

!       Mortality_flux_becoming_sediment_detritus
                tDMVSH = tDMrVH - tDMVWH
!       Total_N_flux_from_Vegetation_module_to_NH4_in_pore_water
                if ( (aInclS == 1 .and. InclVg == 1 ) ) then
                tDBDSH = tDMVSH
                else
                tDBDSH = 0.0
                endif

!       Total_water_O2_flux_in_vegetation_module
                if ( (aInclS == 1 .and. InclVg == 1 ) ) then
                tO2BWH = tO2PVWH - tO2RVWH + tO2UNO3VWH
                else
                tO2BWH = 0.0
                endif

!       If_T_Use_Loss_function
                if ( (InclWb == 1) ) then
                UseLss = 0.0
                else
                UseLss = 1.0
                endif

!       Temp_function_of_grazing
                uFnTLH = exp(-0.5/(cSgTmL*cSgTmL) *((uTmHyp-cTmOpL)*(uTmHyp-cTmOpL) -(cTmRef-cTm&
                &OpL)*(cTmRef-cTmOpL)))
!       Temp_function_of_grazing
                uFnTLE = exp(-0.5/(cSgTmL*cSgTmL) *((uTmEpi-cTmOpL)*(uTmEpi-cTmOpL) -(cTmRef-cTm&
                &OpL)*(cTmRef-cTmOpL)))
!       P/D_ratio_of_Algae
                rPDBWH = oPBlWH /(oDBlWH+NearZr)
!       N/D_ratio_of_Algae
                rNDBWH = oNBlWH /(oDBlWH+NearZr)
!       P/D_ratio_of_Algae
                rPDBluS = aPBluS /(aDBluS+NearZr)
!       N/D_ratio_of_Algae
                rNDBluS = aNBluS /(aDBluS+NearZr)
!       Temperature_function_of_Algae
                uFnTBH = exp(-0.5/(cSgTmBl*cSgTmBl) *((uTmHyp-cTmOptBl)*(uTmHyp-cTmOptBl) - (cTm&
                &Ref-cTmOptBl)*(cTmRef-cTmOptBl)))
!       Temperature_function_of_Algae
                uFTPBH = uFnTBH
!       Temperature_function_of_Algae
                uFTRBH = uFnTBH
!       Temperature_function_of_Algae
                uFnTBE = exp(-0.5/(cSgTmBl*cSgTmBl) *((uTmEpi-cTmOptBl)*(uTmEpi-cTmOptBl) - (cTm&
                &Ref-cTmOptBl)*(cTmRef-cTmOptBl)))
!       Temperature_function_of_Algae
                uFTPBE = uFnTBE
!       Temperature_function_of_Algae
                uFTRBE = uFnTBE
!       Temperature_function_of_Algae
                uFunTmBlS = exp(-0.5/(cSgTmBl*cSgTmBl) *((uTmBot-cTmOptBl)*(uTmBot-cTmOptBl) - (&
                &cTmRef-cTmOptBl)*(cTmRef-cTmOptBl)))
!       Temperature_function_of_Algae
                uFTmRsBlS = uFunTmBlS
!       Temperature_function_of_Algae
                uFnTmBlSr = exp(-0.5/(cSgTmBl*cSgTmBl) *((uTmSrf-cTmOptBl)*(uTmSrf-cTmOptBl) - (&
                &cTmRef-cTmOptBl)*(cTmRef-cTmOptBl)))
!       Temperature_function_of_Algae
                uFTPBS = uFnTmBlSr
!       Temperature_function_of_Algae
                uFTmRsBlSr = uFnTmBlSr
!       Average_PAR_at_Surface
                aLPARAS = max(0.0,(uLPARSr - aLPARBS)/aExtSr)
!       Average_PAR_at_Epilimnion
                aLPARAE = (aLPARBS - aLPARBtE)/ (aExCOE * uDptWE)
!       Average_PAR_at_Hypolimnion
                aLPARAH = (aLPARBEO -aLPARBtH)/ (aExCOH * uDptWE)
!       N_fixation_Algae
                aAxNLS = cAlphN * aLPARAS
!       N_fixation_Algae
                aAxNLE = cAlphN * aLPARAE
!       N_fixation_Algae
                aAxNLH = cAlphN * aLPARAH
!       N_fixation_Algae
                rNfxBS = cNfxMB - cNfxMB * exp(- aAxNLS) + cNfxDB
!       N_fixation_Algae
                rNfxBE = cNfxMB - cNfxMB * exp(- aAxNLE) + cNfxDB
!       N_fixation_Algae
                rNfxBH = cNfxMB - cNfxMB * exp(- aAxNLH) + cNfxDB
!       Maximum_P_uptake_rate_of_Algae_corrected_for_P/D_ratio
                aVPUMCBH = max(0.0,cVPUMB * uFTPBH *(cPDBlMx - rPDBWH) /(cPDBlMx - cPDBlMn))
!       P_uptake_rate_of_Algae
                aVPUBH = oPO4WH * aVPUMCBH /(aVPUMCBH / cAfPUB + oPO4WH)
!       P_uptake_Algae
                if ( (aInclS == 0) ) then
                wPUpBH = 0.0
                else
                wPUpBH = aVPUBH * oDBlWH
                endif

!       Maximum_N_uptake_rate_of_Algae_corrected_for_N/D_ratio
                aVNUMCBH = max(0.0,cVNUMB * uFTPBH * (cNDBlMx - rNDBWH) /(cNDBlMx - cNDBlMn))
!       Half-sat_dissolved_nitrogen_in_water_for_uptake_by_Algae
                ahNUBH = aVNUMCBH / cAfNUB
!       N_uptake_rate_of_Algae
                aVNUBH = oNDsWH * aVNUMCBH /(ahNUBH + oNDsWH)
!       N_uptake_Algae
                if ( (aInclS == 0) ) then
                wNUpBH = 0.0
                else
                wNUpBH = aVNUBH * oDBlWH
                endif

!       N_uptake_Algae
                tNUpBH = wNUpBH * uDptWH
!       Fraction_ammonium_uptake_by_Algae
                aNH4UBH = oNH4WH * oNO3WH /((ahNUBH + oNH4WH) *(ahNUBH + oNO3WH)) + oNH4WH * ahN&
                &UBH /((oNH4WH + oNO3WH) *(ahNUBH + oNO3WH))
!       Max_growth_rate_of_Algae_at_ambient_temperature
                uMMTBH = cMMxBl * uFTPBH
!       Max_growth_rate_of_Algae_at_ambient_temperature
                uMMTBE = cMMxBl * uFTPBE
!       Droop_function(P)_for_Algae
                aPLmBH = max(0.0,(1.0 - cPDBlMn / rPDBWH) * cPDBlMx /(cPDBlMx - cPDBlMn))
!       Droop_function(N)_for_Algae
                aNLmBH = max(0.0,(1.0 - cNDBlMn / rNDBWH) * cNDBlMx /(cNDBlMx - cNDBlMn))
!       Silica_dependence_of_growth_rate
                aSLmBH = oSO2WH /(hSAssB + oSO2WH)
!       Light_function
                aLLmBH = UsStlB *(exp(1.0) /(aExtCH * uDptWH) *(exp(- aLPARBtH /(cLOpRB * uFTPBH&
                &)) - exp(- uLPARSH /(cLOpRB * uFTPBH)))) +(1.0 - UsStlB) *(1.0 /(aExtCH * uDptWH&
                &) * log((1.0 + uLPARSH / (hLRfBl * uFTPBH)) / (1.0 + aLPARBtH /(hLRfBl * uFTPBH)&
                &)))
!       Growth_rate_at_current_light_AND_temp
                aMTLBH = ufDay *(1.0 - afCvSV) * aLLmBH * uMMTBH
!       Nutrient_limitation_function_of_Algae
                aNtLBH = min(aPLmBH,(min(aNLmBH,aSLmBH)))
!       Growth_rate
                aMBlHy = aNtLBH * aMTLBH
!       Assimilation_Algae
                if ( (aInclS == 0) ) then
                wDAsBH = 0.0
                else
                wDAsBH = aMBlHy*oDBlWH
                endif

!       Chlorophyll-a/DW_ratio_Algae
                rChDBH = cChDBlMx -(cChDBlMx - cChDBlMn) * aLLmBH
!       Chlorophyll-a_conc
                oChlBH = mgPerg * rChDBH * oDBlWH
!       Chlorophyll-a_conc
                aChlBH = mgPerg * rChDBH * aDBlWH
!       Specific_extinction_per_unit_chlorophyll-a
                aExCBH = cExtSB / rChDBH
!       N_fixation_Algae
                aNfxBH  = rNfxBH *aChlBH /ugPerg
!       N_fixation_Algae
                if ( (InclNf == 0) ) then
                tNUBAH = 0.0
                else
                tNUBAH = aNfxBH
                endif

!       N_uptake_Algae
                if ( (InclNf == 0) ) then
                tNUBWH = tNUpBH
                else
                tNUBWH = tNUpBH - tNUBAH
                endif

!       N_uptake_Algae
                wNUBWH = tNUBWH / uDptWH
!       Temp_corrected_respiration_constant_of_Algae
                uDRTBH = kDRspBl * uFTRBH
!       Ammonium_uptake_by_Algae
                if ( (aInclS == 0) ) then
                wNUNH4BH = 0.0
                else
                wNUNH4BH = aNH4UBH * wNUBWH
                endif

!       Nitrate_uptake_by_Algae
                if ( (aInclS == 0) ) then
                wNUNO3BH = 0.0
                else
                wNUNO3BH = wNUBWH - wNUNH4BH
                endif

!       Temp_corrected_respiration_constant_of_Algae
                uDRTBE = kDRspBl * uFTRBE
!       Temp_corrected_respiration_constant_of_Algae
                ukDRsTmBlS = kDRspBl * uFTmRsBlS
!       Respiration_of_Algae_in_water
                if ( (aInclS == 0) ) then
                wDRBWH = 0.0
                else
                wDRBWH = uDRTBH * oDBlWH
                endif

!       Temp_corrected_respiration_constant_of_Algae
                ukDRTmBlSr = kDRspBl * uFTmRsBlSr
!       Daily_grazing_on_Algae
                ukLTBH = UseLss * kLssBl * uFnTLH
!       Daily_grazing_on_Algae
                ukLTBE = UseLss * kLssBl * uFnTLE
!       Algae_grazing_loss
                if ( (aInclS == 0) ) then
                wDLsBH = 0.0
                else
                wDLsBH = ukLTBH * oDBlWH
                endif

!       Mortality_in_water
                if ( (aInclS == 0) ) then
                wDMBWH = 0.0
                else
                wDMBWH = kMrtBW * oDBlWH
                endif

!       Corrected_sedimentation_velocity_of_Algae
                uCVSBH = (cVStBl + uQOtIn /mmPerm - uQInSp / mmPerm) * aFTSOMH * uFnTSH
!       Resuspension_DW_blue-greens
                tDRssB = aDBluS /(aDPhyS+NearZr) * tDRsPT
!       Respiration_of_sediment_Algae
                tDRespBlS = ukDRsTmBlS * aDBluS
!       Mortality_in_sed
                tDMortBlS = kMrtBS * aDBluS
!       Total_loss_rate_of_algae_in_water(excl_dilution)
                ukDDBH = uDRTBH + ukLTBH + kMrtBW +(uCVSBH * uFnTSH) / uDptWH
!       P_excretion_Algae_in_water
                if ( (aInclS == 0) ) then
                wPExcrBWH = 0.0
                else
                wPExcrBWH = (rPDBWH * 2.0 )/(cPDBlMx + rPDBWH) * rPDBWH * wDRBWH
                endif

!       Algae_grazing_loss
                if ( (aInclS == 0) ) then
                wPLsBH = 0.0
                else
                wPLsBH = rPDBWH * wDLsBH
                endif

!       Mortality_Algae_in_water
                if ( (aInclS == 0) ) then
                wPMBWH = 0.0
                else
                wPMBWH = kMrtBW * oPBlWH
                endif

!       Resuspension_of_algae
                tPRssB = rPDBluS * tDRssB
!       P_excretion_of_algae_in_sediment
                tPExcrBluS = (rPDBluS *2.0)/(cPDBlMx + rPDBluS) * rPDBluS * tDRespBlS
!       P_mortality_of_algae_in_sediment
                tPMortBlS = kMrtBS * aPBluS
!       N_excretion_Algae_in_water
                if ( (aInclS == 0) ) then
                wNExcrBWH = 0.0
                else
                wNExcrBWH = (rNDBWH *2.0)/(cNDBlMx + rNDBWH) * rNDBWH * wDRBWH
                endif

!       Algae_grazing_loss
                if ( (aInclS == 0) ) then
                wNLsBH = 0.0
                else
                wNLsBH = rNDBWH * wDLsBH
                endif

!       Mortality_Algae_in_water
                if ( (aInclS == 0) ) then
                wNMBWH = 0.0
                else
                wNMBWH = kMrtBW * oNBlWH
                endif

!       Resuspension_of_algae
                tNRssB = rNDBluS * tDRssB
!       N_excretion_of_algae_in_sediment
                tNExcrBluS = (2.0 * rNDBluS) /(cNDBlMx + rNDBluS) * rNDBluS * tDRespBlS
!       N_mortality_of_algae_in_sediment
                tNMortBlS = kMrtBS * aNBluS
!       Correction_factor_for_IM_settling_rate_(<=_1)
                aFTSOME = min(1.0 / ((aFnDmS +NearZr )** (0.5)), 1.0)
!       Correction_factor_for_OM_settling_rate_(<=_1)
                aFTSIME = aFTSOME
!       Corrected_sedimentation_velocity_of_Algae
                uCVSBE = (cVStBl + uQOtIn /mmPerm - uQInSp / mmPerm) * aFTSOME * uFnTSE
!       N/D_ratio_of_Algae
                rNDGWH = oNGrWH /(oDGrWH+NearZr)
!       P/D_ratio_of_Algae
                rPDGrS = aPGrnS /(aDGrnS+NearZr)
!       N/D_ratio_of_Algae
                rNDGrS = aNGrnS /(aDGrnS+NearZr)
!       Temperature_function_of_Algae
                uFnTGH = exp(-0.5/(cSgTmG*cSgTmG) *((uTmHyp-cTmOpG)*(uTmHyp-cTmOpG) - (cTmRef-cT&
                &mOpG)*(cTmRef-cTmOpG)))
!       Temperature_function_of_Algae
                uFnTGE = exp(-0.5/(cSgTmG*cSgTmG) *((uTmEpi-cTmOpG)*(uTmEpi-cTmOpG) - (cTmRef-cT&
                &mOpG)*(cTmRef-cTmOpG)))
!       Temperature_function_of_Algae
                uFnTGS = exp(-0.5/(cSgTmG*cSgTmG) *((uTmBot-cTmOpG)*(uTmBot-cTmOpG) - (cTmRef-cT&
                &mOpG)*(cTmRef-cTmOpG)))
!       Temperature_function_of_Algae
                uFTPGH = uFnTGH
!       Temperature_function_of_Algae
                uFTRGH = uFnTGH
!       Temperature_function_of_Algae
                uFTPGE = uFnTGE
!       Temperature_function_of_Algae
                uFTRGE = uFnTGE
!       Temperature_function_of_Algae
                uFTRGS = uFnTGS
!       Maximum_N_uptake_rate_of_Algae_corrected_for_N/D_ratio
                aVNUMCGH = max(0.0,cVNUMG * uFTPGH * (cNDGrnMx - rNDGWH) /(cNDGrnMx - cNDGrnMn))
!       Half-sat_dissolved_nitrogen_in_water_for_uptake_by_Algae
                ahNUGH = aVNUMCGH / cAfNUG
!       N_uptake_rate_of_Algae
                aVNUGH = oNDsWH * aVNUMCGH /(ahNUGH + oNDsWH)
!       N_uptake_Algae
                if ( (aInclS == 0) ) then
                wNUpGH = 0.0
                else
                wNUpGH = aVNUGH * oDGrWH
                endif

!       Fraction_ammonium_uptake_by_Algae
                aNH4UGH = oNH4WH * oNO3WH /((ahNUGH + oNH4WH) *(ahNUGH + oNO3WH)) + oNH4WH * ahN&
                &UGH /((oNH4WH + oNO3WH) *(ahNUGH + oNO3WH))
!       Ammonium_uptake_by_Algae
                if ( (aInclS == 0) ) then
                wNUNH4GH = 0.0
                else
                wNUNH4GH = aNH4UGH * wNUpGH
                endif

!       Nitrate_uptake_by_Algae
                if ( (aInclS == 0) ) then
                wNUNO3GH = 0.0
                else
                wNUNO3GH = wNUpGH - wNUNH4GH
                endif

!       Max_growth_rate_of_Algae_at_ambient_temperature
                uMMTGH = cMMxGr * uFTPGH
!       Max_growth_rate_of_Algae_at_ambient_temperature
                uMMTGE = cMMxGr * uFTPGE
!       Droop_function(N)_for_Algae
                aNLmGH = max(0.0,(1.0 - cNDGrnMn / rNDGWH) * cNDGrnMx /(cNDGrnMx - cNDGrnMn))
!       Silica_dependence_of_growth_rate
                aSLmGH = oSO2WH /(hSAssG + oSO2WH)
!       Light_function
                aLLmGH = UsStlG *(exp(1.0) /(aExtCH * uDptWH) *(exp(- aLPARBtH /(cLOpRG * uFTPGH&
                &)) - exp(- uLPARSH /(cLOpRG * uFTPGH)))) +(1.0 - UsStlG) *(1.0 /(aExtCH * uDptWH&
                &) * log((1.0 + uLPARSH / (hLRfGr * uFTPGH)) / (1.0 + aLPARBtH /(hLRfGr * uFTPGH)&
                &)))
!       Growth_rate_at_current_light_AND_temp
                aMTLGH = ufDay *(1.0 - afCvSV) * aLLmGH * uMMTGH
!       Chlorophyll-a/DW_ratio_Algae
                rChDGH = cChDGrnMx -(cChDGrnMx - cChDGrnMn) * aLLmGH
!       Chlorophyll-a_conc
                oChlGH = mgPerg * rChDGH * oDGrWH
!       Specific_extinction_per_unit_chlorophyll-a
                aExCGH = cExtSG / rChDGH
!       Temp_corrected_respiration_constant_of_Algae
                uDRTGH = kDRspG * uFTRGH
!       Temp_corrected_respiration_constant_of_Algae
                uDRTGE = kDRspG * uFTRGE
!       Temp_corrected_respiration_constant_of_Algae
                uDRTGS = kDRspG * uFTRGS
!       Respiration_of_Algae_in_water
                if ( (aInclS == 0) ) then
                wDRGWH = 0.0
                else
                wDRGWH = uDRTGH * oDGrWH
                endif

!       Daily_grazing_on_Algae
                ukLTGH = UseLss * kLssGr * uFnTLH
!       Daily_grazing_on_Algae
                ukLTGE = UseLss * kLssGr * uFnTLE
!       Algae_grazing_loss
                if ( (aInclS == 0) ) then
                wDLsGH = 0.0
                else
                wDLsGH = ukLTGH * oDGrWH
                endif

!       Mortality_in_water
                if ( (aInclS == 0) ) then
                wDMGWH = 0.0
                else
                wDMGWH = kMrtGW * oDGrWH
                endif

!       Corrected_sedimentation_velocity_of_Algae
                uCVSGH = (cVStGr+ uQOtIn /mmPerm - uQInSp / mmPerm) * aFTSOMH * uFnTSH
!       Sedimentation_flux_of_Algae
                if ( (aInclS == 0) ) then
                tDStGH = 0.0
                else
                tDStGH = uCVSGH * oDGrWH
                endif

!       Resuspension_of_Algae
                tDRssG = aDGrnS /(aDPhyS+NearZr) * tDRsPT
!       Respiration_of_sediment_Algae
                tDRsGS = uDRTGS * aDGrnS
!       Mortality_in_sed
                tDMrGS = kMrtGS * aDGrnS
!       Total_loss_rate_of_algae_in_water(excl_dilution)
                ukDDGH = uDRTGH + ukLTGH + kMrtGW +(uCVSGH * uFnTSH) / uDptWH
!       Mortality_Algae_in_water
                if ( (aInclS == 0) ) then
                wPMGWH = 0.0
                else
                wPMGWH = kMrtGW * oPGrWH
                endif

!       Resuspension_of_algae
                tPRssG = rPDGrS * tDRssG
!       P_excretion_of_algae_in_sediment
                tPExGS = (2.0 * rPDGrS) /(cPDGrnMx + rPDGrS) * rPDGrS * tDRsGS
!       P_mortality_of_algae_in_sediment
                tPMrGS = kMrtGS * aPGrnS
!       N_excretion_Algae_in_water
                if ( (aInclS == 0) ) then
                wNExcrGWH = 0.0
                else
                wNExcrGWH = (2.0 * rNDGWH) /(cNDGrnMx + rNDGWH) * rNDGWH * wDRGWH
                endif

!       Algae_grazing_loss
                if ( (aInclS == 0) ) then
                wNLsGH = 0.0
                else
                wNLsGH = rNDGWH * wDLsGH
                endif

!       Mortality_Algae_in_water
                if ( (aInclS == 0) ) then
                wNMGWH = 0.0
                else
                wNMGWH = kMrtGW * oNGrWH
                endif

!       Sedimentation
                if ( (aInclS == 0) ) then
                tNStGH = 0.0
                else
                tNStGH = rNDGWH * tDStGH
                endif

!       Resuspension_of_algae
                tNRssG = rNDGrS * tDRssG
!       N_excretion_of_algae_in_sediment
                tNExGS = (2.0 * rNDGrS) /(cNDGrnMx + rNDGrS) * rNDGrS * tDRsGS
!       N_mortality_of_algae_in_sediment
                tNMrGS = kMrtGS * aNGrnS
!       Corrected_sedimentation_velocity_of_Algae
                uCVSGE = (cVStGr + uQOtIn /mmPerm - uQInSp / mmPerm) * aFTSOME * uFnTSE
!       Sedimentation_flux_of_Algae
                tDStGE = uCVSGE * oDGrWE
!       N/D_ratio_of_Algae
                rNDGWE = oNGrWE /(oDGrWE+NearZr)
!       Sedimentation
                tNStGE = rNDGWE * tDStGE
!       P/D_ratio_of_Algae
                rPDGWE = oPGrWE /(oDGrWE+NearZr)
!       Sedimentation
                tPStGE = rPDGWE * tDStGE
!       Total_PRIM_flux_to_Algae
                if ( (aInclS == 0) ) then
                wNPGWH = 0.0
                else
                wNPGWH = wNUpGH - wNExcrGWH - wNLsGH - wNMGWH -(tNStGH -tNStGE - tNRssG) / uDptW&
                &H
                endif

!       P/D_ratio_of_Algae
                rPDDitWHyp = oPDitWHyp /(oDDitWHyp+NearZr)
!       N/D_ratio_of_Algae
                rNDDitWHyp = oNDitWHyp /(oDDitWHyp+NearZr)
!       P/D_ratio_of_Algae
                rPDDitS = aPDitS /(aDDitS+NearZr)
!       Temperature_function_of_Algae
                uFnTDH = exp(-0.5/(cSgTmD*cSgTmD) *((uTmHyp-cTmOpD)*(uTmHyp-cTmOpD) - (cTmRef-cT&
                &mOpD)*(cTmRef-cTmOpD)))
!       N/D_ratio_of_Algae
                rNDDitS = aNDitS /(aDDitS+NearZr)
!       Temperature_function_of_Algae
                uFnTDE = exp(-0.5/(cSgTmD*cSgTmD) *((uTmEpi-cTmOpD)*(uTmEpi-cTmOpD) - (cTmRef-cT&
                &mOpD)*(cTmRef-cTmOpD)))
!       Temperature_function_of_Algae
                uFnTDS = exp(-0.5/(cSgTmD*cSgTmD) *((uTmBot-cTmOpD)*(uTmBot-cTmOpD) - (cTmRef-cT&
                &mOpD)*(cTmRef-cTmOpD)))
!       Temperature_function_production_of_Algae
                uFTPDH = uFnTDH
!       Temperature_function_respiration_of_Algae
                uFTRDH = uFnTDH
!       Temperature_function_production_of_Algae
                uFTPDE = uFnTDE
!       Temperature_function_respiration_of_Algae
                uFTRDE = uFnTDE
!       Temperature_function_respiration_of_Algae
                uFTRDS = uFnTDS
!       Maximum_P_uptake_rate_of_Algae_corrected_for_P/D_ratio
                aVPUMCDH = max(0.0,cVPUMD * uFTPDH *(cPDDtMx - rPDDitWHyp) /(cPDDtMx - cPDDtMn))
!       P_uptake_rate_of_Algae
                aVPUDH = oPO4WH * aVPUMCDH /(aVPUMCDH / cAfPUD + oPO4WH)
!       P_uptake_Algae
                if ( (aInclS == 0) ) then
                wPUpDH = 0.0
                else
                wPUpDH = aVPUDH * oDDitWHyp
                endif

!       Maximum_N_uptake_rate_of_Algae_corrected_for_N/D_ratio
                aVNUMCDH = max(0.0,cVNUMD * uFTPDH * (cNDDtMx - rNDDitWHyp) /(cNDDtMx - cNDDtMn)&
                &)
!       Half-sat_dissolved_nitrogen_in_water_for_uptake_by_Algae
                ahNUDH = aVNUMCDH / cAfNUD
!       N_uptake_rate_of_Algae
                aVNUDH = oNDsWH * aVNUMCDH /(ahNUDH + oNDsWH)
!       N_uptake_Algae
                if ( (aInclS == 0) ) then
                wNUpDH = 0.0
                else
                wNUpDH = aVNUDH * oDDitWHyp
                endif

!       Fraction_ammonium_uptake_by_Algae
                aNH4UDH = oNH4WH * oNO3WH /((ahNUDH + oNH4WH) *(ahNUDH + oNO3WH)) + oNH4WH * ahN&
                &UDH /((oNH4WH + oNO3WH) *(ahNUDH + oNO3WH))
!       Ammonium_uptake_by_Algae
                if ( (aInclS == 0) ) then
                wNUNH4DH = 0.0
                else
                wNUNH4DH = aNH4UDH * wNUpDH
                endif

!       Nitrate_uptake_by_Algae
                if ( (aInclS == 0) ) then
                wNUNO3DH = 0.0
                else
                wNUNO3DH = wNUpDH - wNUNH4DH
                endif

!       Max_growth_rate_of_Algae_at_ambient_temperature
                uMMTDH = cMMxDt * uFTPDH
!       Max_growth_rate_of_Algae_at_ambient_temperature
                uMMTDE = cMMxDt * uFTPDE
!       Droop_function(P)_for_Algae
                aPLmDH = max(0.0,(1.0 - cPDDtMn / rPDDitWHyp) * cPDDtMx /(cPDDtMx - cPDDtMn))
!       Droop_function(N)_for_Algae
                aNLmDH = max(0.0,(1.0 - cNDDtMn / rNDDitWHyp) * cNDDtMx /(cNDDtMx - cNDDtMn))
!       Silica_dependence_of_growth_rate
                aSLmDH = oSO2WH /(hSAssD + oSO2WH)
!       Light_function
                aLLmDH = UsStlD *(exp(1.0) /(aExtCH * uDptWH) *(exp(- aLPARBtH /(cLOpRD * uFTPDH&
                &)) - exp(- uLPARSH /(cLOpRD * uFTPDH)))) +(1.0 - UsStlD) *(1.0 /(aExtCH * uDptWH&
                &) * log((1.0 + uLPARSH / (hLRfDt * uFTPDH)) / (1.0 + aLPARBtH /(hLRfDt * uFTPDH)&
                &)))
!       Growth_rate_at_current_light_AND_temp
                aMTLDH = ufDay *(1.0 - afCvSV) * aLLmDH * uMMTDH
!       Nutrient_limitation_function_of_Algae
                aNtLDH = min(aPLmDH,(min(aNLmDH,aSLmDH)))
!       Growth_rate
                aMDtHy = aNtLDH * aMTLDH
!       Assimilation_Algae
                if ( (aInclS == 0) ) then
                wDAsDH = 0.0
                else
                wDAsDH = aMDtHy*oDDitWHyp
                endif

!       Chlorophyll-a/DW_ratio_Algae
                rChDDH = cChDDtMx -(cChDDtMx - cChDDtMn) * aLLmDH
!       Chlorophyll-a_conc
                oChlDH = mgPerg * rChDDH * oDDitWHyp
!       Specific_extinction_per_unit_chlorophyll-a
                aExCDH = cExtSpDit / rChDDH
!       Temp_corrected_respiration_constant_of_Algae
                uDRTDH = kDRspD * uFTRDH
!       Temp_corrected_respiration_constant_of_Algae
                uDRTDE = kDRspD * uFTRDE
!       Temp_corrected_respiration_constant_of_Algae
                uDRTDS = kDRspD * uFTRDS
!       Respiration_of_Algae_in_water
                if ( (aInclS == 0) ) then
                wDRDWH = 0.0
                else
                wDRDWH = uDRTDH * oDDitWHyp
                endif

!       Daily_grazing_on_Algae
                ukLTDH = UseLss * kLssDt * uFnTLH
!       Daily_grazing_on_Algae
                ukLTDE = UseLss * kLssDt * uFnTLE
!       Algae_grazing_loss
                if ( (aInclS == 0) ) then
                wDLsDH = 0.0
                else
                wDLsDH = ukLTDH * oDDitWHyp
                endif

!       Mortality_in_water
                if ( (aInclS == 0) ) then
                wDMrDWH = 0.0
                else
                wDMrDWH = kMrtDW * oDDitWHyp
                endif

!       Corrected_sedimentation_velocity_of_Algae
                uCrVSetDiH = (cVSetDit + uQOtIn /mmPerm - uQInSp / mmPerm) * aFTSOMH * uFnTSH
!       Sedimentation_flux_of_Algae
                if ( (aInclS == 0) ) then
                tDSetDitH = 0.0
                else
                tDSetDitH = uCrVSetDiH * oDDitWHyp
                endif

!       Resuspension_of_Algae
                tDResusDit = aDDitS /(aDPhyS+NearZr) * tDRsPT
!       Respiration_of_sediment_Algae
                tDRsDS = uDRTDS * aDDitS
!       Mortality_in_sed
                tDMrDS = kMrtDS * aDDitS
!       Total_loss_rate_of_algae_in_water(excl_dilution)
                ukDDDH = uDRTDH + ukLTDH + kMrtDW +(uCrVSetDiH * uFnTSH) / uDptWH
!       P_excretion_Algae_in_water
                if ( (aInclS == 0) ) then
                wPExcrDWH = 0.0
                else
                wPExcrDWH = (2.0 * rPDDitWHyp) /(cPDDtMx + rPDDitWHyp) * rPDDitWHyp * wDRDWH
                endif

!       Algae_grazing_loss
                if ( (aInclS == 0) ) then
                wPLsDH = 0.0
                else
                wPLsDH = rPDDitWHyp * wDLsDH
                endif

!       Mortality_Algae_in_water
                if ( (aInclS == 0) ) then
                wPMrDWH = 0.0
                else
                wPMrDWH = kMrtDW * oPDitWHyp
                endif

!       Sedimentation
                if ( (aInclS == 0) ) then
                tPSetDitH = 0.0
                else
                tPSetDitH = rPDDitWHyp * tDSetDitH
                endif

!       Resuspension_of_algae
                tPResusDit = rPDDitS * tDResusDit
!       P_excretion_of_algae_in_sediment
                tPExDS = (2.0 * rPDDitS) /(cPDDtMx + rPDDitS) * rPDDitS * tDRsDS
!       P_mortality_of_algae_in_sediment
                tPMrDS = kMrtDS * aPDitS
!       N_excretion_Algae_in_water
                if ( (aInclS == 0) ) then
                wNExcrDWH = 0.0
                else
                wNExcrDWH = (2.0 * rNDDitWHyp) /(cNDDtMx + rNDDitWHyp) * rNDDitWHyp * wDRDWH
                endif

!       Algae_grazing_loss
                if ( (aInclS == 0) ) then
                wNLsDH = 0.0
                else
                wNLsDH = rNDDitWHyp * wDLsDH
                endif

!       Mortality_Algae_in_water
                if ( (aInclS == 0) ) then
                wNMrDWH = 0.0
                else
                wNMrDWH = kMrtDW * oNDitWHyp
                endif

!       Sedimentation
                if ( (aInclS == 0) ) then
                tNSetDitH = 0.0
                else
                tNSetDitH = rNDDitWHyp * tDSetDitH
                endif

!       Resuspension_of_algae
                tNResusDit = rNDDitS * tDResusDit
!       N_excretion_of_algae_in_sediment
                tNExDS = (2.0 * rNDDitS) /(cNDDtMx + rNDDitS) * rNDDitS * tDRsDS
!       N_mortality_of_algae_in_sediment
                tNMrDS = kMrtDS * aNDitS
!       Corrected_sedimentation_velocity_of_Algae
                uCrVSetDiE = (cVSetDit + uQOtIn /mmPerm - uQInSp / mmPerm)  * aFTSOME * uFnTSE
!       Sedimentation_flux_of_Algae
                tDSetDitEp = uCrVSetDiE * oDDitWEp
!       P/D_ratio_of_Algae
                rPDDitWEp = oPDitWEp /(oDDitWEp+NearZr)
!       Sedimentation
                tPSetDitEp = rPDDitWEp * tDSetDitEp
!       N/D_ratio_of_Algae
                rNDDitWEp = oNDitWEp /(oDDitWEp+NearZr)
!       Sedimentation
                tNSetDitEp = rNDDitWEp * tDSetDitEp
!       Total_PRIM_flux_to_algae_in_water
                if ( (aInclS == 0) ) then
                wDPrimDiWH = 0.0
                else
                wDPrimDiWH = wDAsDH - wDRDWH - wDLsDH - wDMrDWH -(tDSetDitH - tDSetDitEp - tDRes&
                &usDit) / uDptWH
                endif

!       Total_PRIM_flux_to_Algae
                if ( (aInclS == 0) ) then
                wPPrimDiWH = 0.0
                else
                wPPrimDiWH = wPUpDH - wPExcrDWH - wPLsDH - wPMrDWH -(tPSetDitH -tPSetDitEp - tPR&
                &esusDit) / uDptWH
                endif

!       Total_PRIM_flux_to_Algae
                if ( (aInclS == 0) ) then
                wNPrimDiWH = 0.0
                else
                wNPrimDiWH = wNUpDH - wNExcrDWH - wNLsDH - wNMrDWH -(tNSetDitH - tNSetDitEp - tN&
                &ResusDit) / uDptWH
                endif

!       Total_chlorophyll-a
                oChlHy = oChlDH + oChlGH + oChlBH
!       Total_algal_respiration_in_water
                wDRPWH = wDRDWH + wDRGWH + wDRBWH
!       Total_algal_mortality_in_water
                wDMPWH = wDMrDWH + wDMGWH + wDMBWH
!       Total_phytoplankton_grazing_loss
                wDLsPH = wDLsDH + wDLsGH + wDLsBH
!       Total_P_mortality_phytoplankton_in_water
                wPMPWH = wPMrDWH + wPMGWH + wPMBWH
!       Total_P_resuspension_of_phytoplankton_in_hypolimnion_water
                tPRssP = tPResusDit + tPRssG + tPRssB
!       Total_N_uptake_phytoplankton
                wNUpPH = wNUpDH + wNUpGH + wNUpBH
!       Total_ammonium-N_uptake_phytoplankton
                wNUNH4PH = wNUNH4DH + wNUNH4GH + wNUNH4BH
!       Total_nitrate-N_uptake_phytoplankton
                wNUNO3PH = wNUNO3DH + wNUNO3GH + wNUNO3BH
!       Total_N_excretion_phytoplankton_in_water
                wNEPWH = wNExcrDWH + wNExcrGWH + wNExcrBWH
!       Total_N_mortality_phytoplankton_in_water
                wNMPWH = wNMrDWH + wNMGWH + wNMBWH
!       Total_N_resuspension_of_phytoplankton_in_hypolimnion_water
                tNRssP = tNResusDit + tNRssG + tNRssB
!       Total_grazing_loss
                wNLsPH = wNLsDH + wNLsGH + wNLsBH
!       Respiration_of_algae_on_bottom
                tDRsPS = tDRsDS + tDRsGS + tDRespBlS
!       Mortality_of_algae_on_bottom
                tDMrPS = tDMrDS + tDMrGS + tDMortBlS
!       Total_P_excretion_sediment_phytoplankton
                tPExPS = tPExDS + tPExGS + tPExcrBluS
!       Total_phytoplankton_mortality
                tPMrPS = tPMrDS + tPMrGS + tPMortBlS
!       Total_N_excretion_sediment_phytoplankton
                tNExPS = tNExDS + tNExGS + tNExcrBluS
!       Total_phytoplankton_mortality
                tNMrPS = tNMrDS + tNMrGS + tNMortBlS
!       Diatoms_silica_uptake
                wSUpDH = cSiDDt * wDAsDH
!       Si_excretion
                wSExcrDWH = cSiDDt * wDRDWH
!       Diatom_grazing_loss
                wSLsDH = cSiDDt * wDLsDH
!       Diatoms_mortality_in_water
                wSMrDWH = cSiDDt * wDMrDWH
!       Diatoms_sedimentation
                tSiSetDitH = cSiDDt * tDSetDitH
!       Diatoms_sedimentation
                tSiResusDi = cSiDDt * tDResusDit
!       C-phycocyanin/DW-ratio_blue-greens
                rCyDBH = cCyDBlMx -(cCyDBlMx - cCyDBlMn) * aLLmBH
!       C-phycocyanin
                oCynHy = rCyDBH * oDBlWH * mgPerg
!       DW_fraction_of_algal_group_of_total_algae
                fDDtHy = oDDitWHyp /(oDDitWHyp + oDGrWH + oDBlWH + NearZr)
!       Flux_to_water_detritus
                wDPrimDeWH = wDMPWH + wDLsPH
!       O2_production_by_phytoplankton
                wO2RPWH = mlO2mC * cCPrDW * wDRPWH * aCO2BODH
!       O2_production_due_to_NO3_uptake_by_phytoplankton
                wO2UNO3PH = O2PNO3 * mlO2mN * wNUNO3PH
!       Soluble_P_flux_from_died_Algae
                wPMPPO4WH = fDssMrtPh * wPMPWH
!       Detrital_P_flux_from_died_Algae
                wPMPDWH = wPMPWH - wPMPPO4WH
!       Soluble_P_flux_from_died_Algae
                tPMPPO4S = fDssMrtPh * tPMrPS
!       Detrital_P_flux_from_died_Algae
                tPMPDS = tPMrPS - tPMPPO4S
!       Pore_water_P
                tPPPO4 = tPExPS + tPMPPO4S
!       Total_P_flux
                tPPrTT = 0.0
!       Ammonium_flux_from_died_Algae
                wNMPNH4WH = fDssMrtPh * wNMPWH
!       Detrital_N_flux_from_died_Algae
                wNMPDWH = wNMPWH - wNMPNH4WH
!       NH4-N_grazing_loss
                wNLPNH4H = fDssLs * wNLsPH
!       Detrital_N_grazing_loss
                wNLPDH = wNLsPH - wNLPNH4H
!       Ammonium_in_water
                wNPNH4WH = - wNUNH4PH + wNEPWH + wNLPNH4H + wNMPNH4WH
!       Nitrate_in_water
                wNPNO3WH = - wNUNO3PH
!       Detritus_in_water
                wNPrimDeWH = wNLPDH + wNMPDWH
!       Ammonium_flux_from_died_Algae
                tNMPNH4S = fDssMrtPh * tNMrPS
!       Detrital_N_flux_from_died_Algae
                tNMPDS = tNMrPS - tNMPNH4S
!       Pore_water_ammonium
                tNPNH4 = tNExPS + tNMPNH4S
!       Pore_water_nitrate
                tNPNO3 = 0.0
!       Total_N_flux
                tNPrTT = 0.0
!       Si_excretion_of_bottom_Algae
                tSExDS = cSiDDt * tDRsDS
!       Mortality_of_bottom_Algae
                tSMrDS = cSiDDt * tDMrDS
!       Total_Si_flux_to_sio2_in_PRIM_module
                if ( (aInclS == 0) ) then
                wSPSO2WH = 0.0
                else
                wSPSO2WH = wSExcrDWH - wSUpDH + tSExDS / uDptWH
                endif

!       Total_Si_flux_to_sed_detritus_in_PRIM_module
                wSiPrDeWH = wSMrDWH + wSLsDH
!       Total_Si_flux
                tSPrTT = 0.0
!       Poole-Atkins_coefficient
                aPACfE = cPACfMn +(cPACfMx - cPACfMn) * hPACof / (hPACof + oDOMWE)
!       Poole-Atkins_coefficient
                aPACfH = cPACfMn +(cPACfMx - cPACfMn) * hPACof / (hPACof + oDOMWH)
!       Max_Secchi_depth
                bSccME = uDptWE
!       Secchi_depth
                aScchE = min(bSccME,aPACfE / aExCOE)
!       Transparency
                aTrnsE = aScchE / uDptWE
!       Max_Secchi_depth
                bSccMH = uDptWH + cScchP
!       Secchi_depth_of_the_hypolimnion
                if ( ( aInclS == 1 .and. uDptWE <= aPACfE / aExCOE ) ) then
                aScchH = min(bSccMH,aPACfH / aExCOH - aScchE)
                else if ( ( aInclS == 1 .and. uDptWE > aPACfE / aExCOE) ) then
                aScchH = 0.0
                else
                aScchH = min(bSccMH,aPACfH / aExCOH)
                endif

!       Secchi_depth_total
                if ( ( aInclS == 1 ) ) then
                aScchT = aScchE +aScchH
                else
                aScchT = aScchE
                endif

!       Transparency_of_the_hypolimnion
                aTrnsH = aScchH / uDptWH
!       Transparency_of_the_total_water_level
                if ( ( aInclS == 1 ) ) then
                aTrnsT = aScchT / uDpthW
                else
                aTrnsT = aScchT / uDptWH
                endif

!       Euphotic_depth
                aDptEH = cEuph * aScchH
!       Relative_euphotic_depth
                aRlDEH = aDptEH / uDptWH
!       Chla_per_m2
                aChlHH = oChlHy * uDptWH
!       %_cover_with_algae
                aCvPWH = cCvSpPhy *(oDPhWH * uDptWH)
!       Average_spec_extinction_of_algae_per_unit_chla
                rExCPH = aExtPH /(oChlHy / mgPerg + NearZr)
!       Temp_function_of_zooplankton
                uFnTZH = exp(-0.5/(cSgTmZ*cSgTmZ) *((uTmHyp-cTmOpZ)*(uTmHyp-cTmOpZ) -(cTmRef-cTm&
                &OpZ)*(cTmRef-cTmOpZ)))
!       Temp_function_of_zooplankton
                uFnTZE = exp(-0.5/(cSgTmZ*cSgTmZ) *((uTmEpi-cTmOpZ)*(uTmEpi-cTmOpZ) -(cTmRef-cTm&
                &OpZ)*(cTmRef-cTmOpZ)))
!       P/D_ratio_herbaceous_zooplankton
                rPDZHy = oPZHyp /(oDZHyp+NearZr)
!       N/C_ratio_herbaceous_zooplankton
                rNDZHy = oNZHyp/(oDZHyp+NearZr)
!       Food_for_zooplankton
                oDFdZH = cPrefDit * oDDitWHyp + cPrfGr * oDGrWH + cPrfBl * oDBlWH + cPrefDet * o&
                &DDetWHyp
!       Filtering_rate
                aFltHy = cFltMx * uFnTZH * hFilt /(hFilt + oDOMWH)
!       Max_assimilation_rate_of_zooplankton_temp_corrected
                uDATZH = fDAssZ * cFltMx * uFnTZH * hFilt
!       Max_assimilation_rate_of_corrected
                uDATZE = fDAssZ * cFltMx * uFnTZE * hFilt
!       Food_saturation_function_of_zooplankton
                aDStZH = oDFdZH /(hFilt + oDOMWH)
!       Respiration_constant_of_zooplankton
                uDRTZH = kDRspZ * uFnTZH
!       Respiration_constant_of_zooplankton
                uDRTZE = kDRspZ * uFnTZE
!       Intrinsic_rate_of_increase_of_zooplankton
                ukDIZH = uDATZH - uDRTZH - kMortZ
!       Intrinsic_rate_of_increase_of_zooplankton
                ukDIZE = uDATZE - uDRTZE - kMortZ
!       Environmental_correction_of_zooplankton
                if ( (aInclS == 0) ) then
                wDEnZH = 0.0
                else
                wDEnZH = max(0.0,ukDIZH / cDCrrZ * oDZHyp*oDZHyp)
                endif

!       Assimilation_of_zooplankton
                if ( (aInclS == 0) ) then
                wDAsZH = 0.0
                else
                wDAsZH = aDStZH *(uDATZH * oDZHyp - wDEnZH)
                endif

!       Consumption_of_zooplankton
                wDCnZH = wDAsZH / fDAssZ
!       DW_detritus_consumption_by_zooplankton
                wDConsDeZH = cPrefDet*oDDetWHyp / oDFdZH * wDCnZH
!       DW_diatoms_consumption_by_zooplankton
                wDConsDiZH = cPrefDit*oDDitWHyp / oDFdZH * wDCnZH
!       DW_greens_consumption_by_zooplankton
                wDCGZH = cPrfGr*oDGrWH / oDFdZH * wDCnZH
!       DW_blue-greens_consumption_by_zooplankton
                wDCBZH = cPrfBl*oDBlWH / oDFdZH * wDCnZH
!       Phytoplankton_consumption_by_zooplankton
                wDCPZH = wDConsDiZH + wDCGZH + wDCBZH
!       Egestion_of_zooplankton
                wDEgZH = wDCnZH - wDAsZH
!       Correction_factor_of_zooplankton_respiration_for_P_and_N_content
                aCDRZH = max(cPDZRf / rPDZHy,cNDZRf / rNDZHy)
!       Zooplankton_respiration
                if ( (aInclS == 0) ) then
                wDRsZH = 0.0
                else
                wDRsZH = aCDRZH * uDRTZH * oDZHyp
                endif

!       Zooplankton_mortality_incl_environmental_correction
                if ( (aInclS == 0) ) then
                wDMrZH = 0.0
                else
                wDMrZH = kMortZ * oDZHyp +(1.0 - aDStZH) * wDEnZH
                endif

!       Zooplankton_food
                oPFdZH = cPrefDit*oPDitWHyp + cPrfGr*oPGrWH + cPrfBl*oPBlWH + cPrefDet * oPDetWH&
                &yp
!       P/D_ratio_of_zooplankton_food
                rPDFZH = oPFdZH /(oDFdZH+NearZr)
!       P_diatom_consumption_by_zooplankton
                wPConsDiZH = rPDDitWHyp * wDConsDiZH
!       P_blue_green_consumption_by_zooplankton
                wPCBZH = rPDBWH * wDCBZH
!       Consumption_of_detrital_P
                wPConsDeZH = rPDDetWHyp * wDConsDeZH
!       P_assimilation_efficiency_of_herbivores
                afPAZH = min(1.0,cPDZRf / rPDFZH * fDAssZ)
!       P_excretion_rate_of_herbivores
                akPEZH = rPDZHy / cPDZRf * kDRspZ * uFnTZH
!       P_excretion
                if ( (aInclS == 0) ) then
                wPExcrZH = 0.0
                else
                wPExcrZH = akPEZH*oPZHyp
                endif

!       Mortality
                wPMrZH = rPDZHy * wDMrZH
!       Soluble_P_mortality
                wPMZPO4H = fDssMZ * wPMrZH
!       Detrital_P_mortality
                wPMZDH = wPMrZH - wPMZPO4H
!       Zooplankton_food
                oNFdZH = cPrefDit*oNDitWHyp + cPrfGr*oNGrWH + cPrfBl*oNBlWH + cPrefDet*oNDetWHyp
!       N/C_ratio_of_zooplankton_food
                rNDFZH = oNFdZH /(oDFdZH+NearZr)
!       N_diatom_consumption_by_zooplankton
                wNConsDiZH = rNDDitWHyp*wDConsDiZH
!       N_green_consumption_by_zooplankton
                wNCGZH = rNDGWH*wDCGZH
!       N_blue_green_consumption_by_zooplankton
                wNCBZH = rNDBWH*wDCBZH
!       Total_N_phytoplankton_consumption_by_zooplankton
                wNCPZH = wNConsDiZH + wNCGZH + wNCBZH
!       Consumption_of_detrital_N
                wNConsDeZH = rNDDetWHyp*wDConsDeZH
!       Total_N_consumption
                wNCnZH = wNCPZH + wNConsDeZH
!       N_assimilation_efficiency_of_herbivores
                afNAZH = min(1.0,cNDZRf / rNDFZH * fDAssZ)
!       Assimilation_by_herbivores
                wNAsZH = afNAZH*wNCnZH
!       N_egestion
                wNEgZH = wNCnZH - wNAsZH
!       Soluble_N_egestion
                wNEZNH4H = fDssEZ*wNEgZH
!       Detrital_N_egestion
                wNEZDH = wNEgZH - wNEZNH4H
!       N_excretion_rate_of_herbivores
                kNExZH = rNDZHy / cNDZRf * kDRspZ * uFnTZH
!       N_excretion
                if ( (aInclS == 0) ) then
                wNExcrZH = 0.0
                else
                wNExcrZH = kNExZH*oNZHyp
                endif

!       Mortality
                wNMrZH = rNDZHy*wDMrZH
!       Soluble_N_mortality
                wNMZNH4H = fDssMZ*wNMrZH
!       Detrital_N_mortality
                wNMZDH = wNMrZH - wNMZNH4H
!       Consumption_of_diatoms
                wSCDZH = cSiDDt * wDConsDiZH
!       Temp_function_of_zoobenthos
                uFnTmB = exp(-0.5/(cSgTmBn*cSgTmBn) *((uTmBot-cTmOptBn)*(uTmBot-cTmOptBn) - (cTm&
                &Ref-cTmOptBn)*(cTmRef-cTmOptBn)))
!       Food_for_zoobenthos
                aDFdBn = aDDetS + aDPhyS
!       P/D_ratio_of_zoobenthos
                rPDBnt = aPBent /(aDBent+NearZr)
!       N/D_ratio_of_zoobenthos
                rNDBnt = aNBent /(aDBent+NearZr)
!       Migration_flux
                tDMgrB = kMgrBn *(cDBntI - aDBent)
!       Food_limitation_function_of_zoobenthos
                aDStBn = aDFdBn /(hDFdBn + aDFdBn)
!       Intrinsic_net_increase_rate_of_zoobenthos
                ukDInB = (kDAssB - kDRspBn) * uFnTmB - kMrtBn
!       Environmental_correction_of_zoobenthos
                tDEnvB = max(0.0,ukDInB / cDCrrB * aDBent*aDBent)
!       Assimilation_of_zoobenthos
                tDAssB = aDStBn *(kDAssB * uFnTmB * aDBent - tDEnvB)
!       Specific_assimilation_rate_of_zoobenthos
                aDAsBS = tDAssB / aDBent
!       Consumption_of_zoobenthos
                tDCnsB = tDAssB / fDAssBn
!       Detritus_consumption_by_zoobenthos
                tDConDeBnt = aDDetS / aDFdBn * tDCnsB
!       Diatoms_consumption_by_zoobenthos
                tDConDiBnt = aDDitS / aDFdBn * tDCnsB
!       Greens_consumption_by_zoobenthos
                tDCnGB = aDGrnS / aDFdBn * tDCnsB
!       Blue-greens_consumption_by_zoobenthos
                tDCnBB = aDBluS / aDFdBn * tDCnsB
!       Phytoplankton_consumption_by_zoobenthos
                tDCnPB = tDConDiBnt + tDCnGB + tDCnBB
!       Egestion_of_zoobenthos
                tDEgsBn = tDCnsB - tDAssB
!       Respiration_of_zoobenthos
                tDRspB = (cPDBnR / rPDBnt) * kDRspBn * uFnTmB * aDBent
!       Zoobenthos_mortality_incl_environmental_correction
                tDMrtB = kMrtBn*aDBent +(1.0 - aDStBn) * tDEnvB
!       Food_for_zoobenthos
                aPFdBn = aPDetS + aPPhyS
!       Average_P/D_ratio_of_zoobenthos_food
                rPDFdB = aPFdBn /(aDFdBn+NearZr)
!       Detrital_P_consumption_by_zoobenthos
                tPConDeBnt = rPDDetS * tDConDeBnt
!       Diatom_P_consumption_by_zoobenthos
                tPConDiBnt = rPDDitS * tDConDiBnt
!       Greens_P_consumption_by_zoobenthos
                tPCnGB = rPDGrS * tDCnGB
!       Blue-greens_P_consumption_by_zoobenthos
                tPCnBB = rPDBluS * tDCnBB
!       Phytoplankton_P_consumption_by_zoobenthos
                tPCnPB = tPConDiBnt + tPCnGB + tPCnBB
!       Total_P_consumption_of_zoobenthos
                tPCnsB = tPConDeBnt + tPCnPB
!       P_assimilation_efficiency_of_zoobenthos
                afPAsB = min(1.0,cPDBnR / rPDFdB * fDAssBn)
!       P_assimilation_of_zoobenthos
                tPAssB = afPAsB * tPCnsB
!       Egestion_of_zoobenthos
                tPEgsBn = tPCnsB - tPAssB
!       SRP_egestion_of_zoobenthos
                tPEgsBnPO4 = fDssEgsBn * tPEgsBn
!       Detrital_P_egestion_of_zoobenthos
                tPEgsBnD = (1.0 - fDssEgsBn) * tPEgsBn
!       P_excretion_of_zoobenthos
                tPExcB = (rPDBnt / cPDBnR) * kDRspBn * uFnTmB * aPBent
!       Mortality_of_zoobenthos
                tPMrtB = rPDBnt * tDMrtB
!       Part_of_died_zoobenthos_P_becoming_dissolved_P
                tPMBPO = fDssMB * tPMrtB
!       Part_of_died_zoobenthos_P_becoming_detrital_P
                tPMrBD = (1.0-fDssMB)*tPMrtB
!       Net_migration_flux
                tPMgrB = kMgrBn *(cPDBnR*cDBntI - aPBent)
!       Food_for_zoobenthos
                aNFdBn = aNDetS + aNPhyS
!       Average_N/D_ratio_of_zoobenthos_food
                rNDFdB = aNFdBn /(aDFdBn+NearZr)
!       Net_migration_flux
                tNMgrB = kMgrBn *(cNDBnR*cDBntI - aNBent)
!       Detrital_N_consumption_by_zoobenthos
                tNConDeBnt = rNDDetS * tDConDeBnt
!       Diatom_N_consumption_by_zoobenthos
                tNConDiBnt = rNDDitS * tDConDiBnt
!       Greens_N_consumption_by_zoobenthos
                tNCnGB = rNDGrS * tDCnGB
!       Blue-greens_N_consumption_by_zoobenthos
                tNCnBB = rNDBluS * tDCnBB
!       Phytoplankton_N_consumption_by_zoobenthos
                tNCnPB = tNConDiBnt + tNCnGB + tNCnBB
!       Total_N_consumption_of_zoobenthos
                tNCnsB = tNConDeBnt + tNCnPB
!       N_assimilation_efficiency_of_zoobenthos
                afNAsB = min(1.0,cNDBnR / rNDFdB * fDAssBn)
!       N_assimilation_of_zoobenthos
                tNAssB = afNAsB * tNCnsB
!       Egestion_of_zoobenthos
                tNEgsBn = tNCnsB - tNAssB
!       NH4_egestion_of_zoobenthos
                tNEgsBnNH4 = fDssEgsBn * tNEgsBn
!       Detrital_N_egestion_of_zoobenthos
                tNEgsBnD = (1.0 - fDssEgsBn) * tNEgsBn
!       N_excretion_of_zoobenthos
                tNExcB = (rNDBnt / cNDBnR) * kDRspBn * uFnTmB * aNBent
!       Mortality_of_zoobenthos
                tNMrtB = rNDBnt * tDMrtB
!       Part_of_died_zoobenthos_N_becoming_ammonium-N
                tNMBNH = fDssMB*tNMrtB
!       Part_of_died_zoobenthos_N_becoming_detrital_N
                tNMrBD = (1.0-fDssMB)*tNMrtB
!       Diatom_consumption_by_zoobenthos
                tSCnDB = cSiDDt * tDConDiBnt
!       Vegetation_dependence_of_fish_feeding
                aFnVgF = max(0.0,1.0 - cRlVgF * aCovVg)
!       Intrinsic_net_increase_rate_of_fish
                ukDIFJ = (kDAsFJ - kDRsFJ) * uFnTmF - kMrtFJ
!       Food_limitation_function_of_adult_fish
                aDStFA = (aFnVgF * aDBent) *(aFnVgF * aDBent) /(hDBnFA * hDBnFA + (aFnVgF * aDBe&
                &nt) *(aFnVgF * aDBent))
!       Intrinsic_net_increase_rate_of_fish
                ukDIFA = (kDAsFA - kDRsFA) * uFnTmF - kMrtFA
!       Fish_harvesting_constant
                if ( (cos(2.0 * Pi * sTime / DysInY) > 0.1) ) then
                ukHrvF = kHrvFW
                else
                ukHrvF = kHrvFS
                endif

!       P_assimilation_efficiency_of_FiAd
                afPAFA = min(1.0,cPDFsR / rPDBnt * fDAsFA)
!       N_assimilation_efficiency_of_FiAd
                afNAFA = min(1.0,cNDFsR / rNDBnt * fDAsFA)
!       Temp_function_of_Pisc
                uFnTmP = exp(-0.5 /(cSgTmP*cSgTmP) *((uTmEpi - cTmOpP)*(uTmEpi - cTmOpP) - (cTmR&
                &ef - cTmOpP)*(cTmRef - cTmOpP)))
!       Carrying_capacity_of_Pisc_for_lake_without_OR_with_marsh_zone_respectively
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                aDCrrP = max(cDCrrPscMn,min(cDCrrPscMx,cDCrPB))
                else if ( (aDShtP < cDPhMP) ) then
                aDCrrP = cDCrrPscMn
                else if ( (aCovVg < cCvVgM) ) then
                aDCrrP = max(cDCrrPscMn,min(cDCrrPscMx,fMarsh *(1.0/PerCnt) * cRlPhP))
                else
                aDCrrP = max(cDCrrPscMn,min(cDCrrPscMx,fMarsh *(1.0/PerCnt) *(cRlPhP + cRlVgP)))
                endif

!       Vegetation_dependence_of_Pisc_growth_rate
                aFnVgP = aDSbVg /(hDVgPs + aDSbVg + NearZr)
!       Intrinsic_net_increase_rate_of_Pisc
                akDIncrPs = (kDAssP * aFnVgP - kDRspPs) * uFnTmP - kMrtPs
!       Fish_harvesting_constant
                if ( (cos(2.0*Pi * sTime / DysInY) > 0.1) ) then
                ukHrvP = kHrvPW
                else
                ukHrvP = kHrvPS
                endif

!       Total_food_web_flux_of_DW_in_Sediment_detritus_in_lake
                if ( (0 == InclWb) ) then
                tDWebDetS = 0.0
                else
                tDWebDetS = - tDConDeBnt + tDEgsBn + tDMrtB
                endif

!       Total_food_web_flux_of_DW_in_sediment_diatoms_in_lake
                if ( (0 == InclWb) ) then
                tDWebDitS = 0.0
                else
                tDWebDitS = - tDConDiBnt
                endif

!       Total_food_web_flux_of_DW_in_sediment_greens_in_lake
                if ( (0 == InclWb) ) then
                tDWbGS = 0.0
                else
                tDWbGS = - tDCnGB
                endif

!       Total_food_web_flux_of_DW_in_sediment_blue-greens_in_lake
                if ( (0 == InclWb) ) then
                tDWebBlS = 0.0
                else
                tDWebBlS = - tDCnBB
                endif

!       Total_food_web_flux_of_sediment_algae
                tDWbPS = tDWebDitS + tDWbGS + tDWebBlS
!       Total_food_web_flux_of_P_in_pore_water_P_in_lake_sediment
                if ( (0 == InclWb) ) then
                tPWPO4 = 0.0
                else
                tPWPO4 = tPExcB + tPEgsBnPO4 + tPMBPO
                endif

!       Total_food_web_flux_of_P_in_Sediment_P_in_lake
                if ( (0 == InclWb) ) then
                tPWebDetS = 0.0
                else
                tPWebDetS = - tPConDeBnt + tPEgsBnD + tPMrBD
                endif

!       Total_food_web_flux_of_P_in_sediment_diatoms_in_lake
                if ( (0 == InclWb) ) then
                tPWebDitS = 0.0
                else
                tPWebDitS = - tPConDiBnt
                endif

!       Total_food_web_flux_of_P_in_sediment_greens_in_lake
                if ( (0 == InclWb) ) then
                tPWbGS = 0.0
                else
                tPWbGS = - tPCnGB
                endif

!       Total_food_web_flux_of_P_in_sediment_blue-greens_in_lake
                if ( (0 == InclWb) ) then
                tPWebBlS = 0.0
                else
                tPWebBlS = - tPCnBB
                endif

!       Total_food_web_flux_of_sediment_algae
                tPWbPS = tPWebDitS + tPWbGS + tPWebBlS
!       Total_food_web_flux_of_N_in_pore_water_ammonium_in_lake_sediment
                if ( (0 == InclWb) ) then
                tNWNH4 = 0.0
                else
                tNWNH4 = tNExcB + tNEgsBnNH4 + tNMBNH
                endif

!       Total_food_web_flux_of_N_in_pore_water_nitrate_in_lake_sediment
                if ( (0 == InclWb) ) then
                tNWNO3 = 0.0
                else
                tNWNO3 = 0.0
                endif

!       Total_food_web_flux_of_N_in_Sediment_N_in_lake_sediment
                if ( (0 == InclWb) ) then
                tNWebDetS = 0.0
                else
                tNWebDetS = - tNConDeBnt + tNEgsBnD + tNMrBD
                endif

!       Total_food_web_flux_of_N_in_sediment_diatoms_in_lake
                if ( (0 == InclWb) ) then
                tNWebDitS = 0.0
                else
                tNWebDitS = - tNConDiBnt
                endif

!       Total_food_web_flux_of_N_in_sediment_greens_in_lake
                if ( (0 == InclWb) ) then
                tNWbGS = 0.0
                else
                tNWbGS = - tNCnGB
                endif

!       Total_food_web_flux_of_N_in_sediment_blue-greens_in_lake
                if ( (0 == InclWb) ) then
                tNWebBlS = 0.0
                else
                tNWebBlS = - tNCnBB
                endif

!       Total_food_web_flux_of_sediment_algae
                tNWbPS = tNWebDitS + tNWbGS + tNWebBlS
!       Total_food_web_flux_of_silica_in_sio2_lake_water
                wSWSO2 = 0.0
!       Total_food_web_flux_of_silica_in_lake_water_detritus
                if ( (0 == InclWb) ) then
                wSWDWH = 0.0
                else
                wSWDWH = wSCDZH
                endif

!       Total_food_web_flux_of_silica_in_sediment_detritus
                if ( (0 == InclWb) ) then
                tSWbDS = 0.0
                else
                tSWbDS = tSCnDB
                endif

!       Total_food_web_flux_of_silica
                if ( (0 == InclWb) ) then
                tSWbTT = 0.0
                else
                tSWbTT = 0.0
                endif

!       Average_selection_factor
                aPrfAH = (cPrefDit * oDDitWHyp + cPrfGr * oDGrWH + cPrfBl * oDBlWH + cPrefDet * &
                &oDDetWHyp) / oDOMWH
!       Total_zooplankton_consumption(check)
                if ( (aInclS == 0) ) then
                wDCZ2H = 0.0
                else
                wDCZ2H = aFltHy * aPrfAH * oDOMWH * oDZHyp
                endif

!       Specific_consumption_rate_of_zooplankton(daily_ration)
                aDCZSH = wDCnZH / oDZHyp
!       Specific_C_assimilation_of_zooplankton
                aDAZSH = wDAsZH / oDZHyp
!       Specific_DW_grazing(daily_grazing)
                aDGrSH = wDCnZH / oDOMWH
!       Specific_N_consumption_OR_daily_ration
                aNCZSH = wNCnZH / oNZHyp
!       Specific_N_grazing_OR_daily_grazing
                aNGrSH = wNCnZH / oNOMWH
!       Shoot/total_-ratio
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                afDShP = aDShtP /(aDRtPh + aDShtP)
                else
                afDShP = 0.0
                endif

!       Shoot/Root_-ratio
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                rDSRPh = aDShtP/aDRtPh
                else
                rDSRPh = 0.0
                endif

!       Shoot_P/D_-ratio
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                rPDShP = aPShtP/aDShtP
                else
                rPDShP = 0.0
                endif

!       Shoot_N/D_-ratio
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                rNDShP = aNShtP/aDShtP
                else
                rNDShP = 0.0
                endif

!       Root_P/D_-ratio
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                rPDRtP = aPRtPh/aDRtPh
                else
                rPDRtP = 0.0
                endif

!       Root_N/D_-ratio
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                rNDRtP = aNRtPh/aDRtPh
                else
                rNDRtP = 0.0
                endif

!       Shoot_length_of_phragmites_marsh_vegetation
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                aLngSP = aDShtP / cDStmP / cDnsSP
                else
                aLngSP = 0.0
                endif

!       Marks_start_of_root_allocation_to_shoot_of_phragmites
                if ( (Day < 1.0 .or. sTime < StrtTm + 1.0) ) then
                bDyInP = 367
                else if ( (uTmEpi >= cTmInP .and. bDyInP > 366) ) then
                bDyInP = Day
                else
                bDyInP = bDyInP
                endif

!       Root_biomass_available_for_allocation_to_shoot
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                aDAllP = 0.0
                else if ( (Day < bDyInP) ) then
                aDAllP = 0.0
                else if ( (Day <= bDyInP + 1.0 / kDAllP) ) then
                aDAllP = fDAllP * aDRtPh
                else
                aDAllP = 0.0
                endif

!       Allocation_flux
                if ( (0 == InclSs) ) then
                tDAllP = 0.0
                else if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tDAllP = 0.0
                else if ( (Day < bDyInP) ) then
                tDAllP = 0.0
                else if ( (Day <= bDyInP + 1.0 / kDAllP) ) then
                tDAllP = kDAllP * aDAllP
                else
                tDAllP = 0.0
                endif

!       Translocation_of_N_initial_growth
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNTrnP = rNDRtP * tDAllP
                else
                tNTrnP = 0.0
                endif

!       Translocation_of_P_initial_growth
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tPTrnP = rPDRtP * tDAllP
                else
                tPTrnP = 0.0
                endif

!       Max_uptake_rate_at_current_N/D_ratio_AND_temp
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                aVNUPM = max(0.0,cVNUPM * ((cQ10PP )** (0.1 *(uTmEpi - cTmRef))) *(cNDPhrMx - rN&
                &DRtP) /(cNDPhrMx - cNDPhrMn))
                else
                aVNUPM = 0.0
                endif

!       Half-saturating_N_concentration
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                ahNUPS = aVNUPM / cAfNUP
                else
                ahNUPS = 0.0
                endif

!       N_uptake_rate(by_roots)
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                aVNUPS = aVNUPM * oNDsSM /(ahNUPS + oNDsSM)
                else
                aVNUPS = 0.0
                endif

!       Total_N_uptake_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNUpPS = aVNUPS * aDRtPh
                else
                tNUpPS = 0.0
                endif

!       NH4_uptake_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNUNH4P = aNH4SM / aNDsSM * tNUpPS
                else
                tNUNH4P = 0.0
                endif

!       NO3_uptake_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNUNO3P = tNUpPS - tNUNH4P
                else
                tNUNO3P = 0.0
                endif

!       N_uptake_shoot
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNUpSP = afDShP * tNUpPS
                else
                tNUpSP = 0.0
                endif

!       N_uptake_root
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNUpRP = tNUpPS - tNUpSP
                else
                tNUpRP = 0.0
                endif

!       Max_uptake_rate_at_current_P/D_ratio_AND_temp
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                aVPUPM = max(0.0,cVPUPM * ((cQ10PP )** (0.1 *(uTmEpi - cTmRef))) *(cPDPhrMx - rP&
                &DRtP) /(cPDPhrMx - cPDPhrMn))
                else
                aVPUPM = 0.0
                endif

!       Half-saturating_P_concentration
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                ahPUPS = aVPUPM / cAfPUP
                else
                ahPUPS = 0.0
                endif

!       P_uptake_rate(by_roots)
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                aVPUPS = aVPUPM * oPO4SM /(ahPUPS + oPO4SM)
                else
                aVPUPS = 0.0
                endif

!       Total_P_uptake_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tPUpPS = aVPUPS * aDRtPh
                else
                tPUpPS = 0.0
                endif

!       P_uptake_shoot
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tPUpSP = afDShP * tPUpPS
                else
                tPUpSP = 0.0
                endif

!       P_uptake_root
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tPUpRP = tPUpPS - tPUpSP
                else
                tPUpRP = 0.0
                endif

!       Temperature_function_production_vegetation
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                uFnTPP = ((cQ10PP )** (0.1 *(uTmEpi - cTmRef)))
                else
                uFnTPP = 0.0
                endif

!       Maintenance_respiration_rate_at_current_temperature
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                ukDRTP = kDRspPh * ((cQ10RP )** (0.1 *(uTmEpi - cTmRef)))
                else
                ukDRTP = 0.0
                endif

!       Max_photosynthetic_rate_at_current_light_AND_temp
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                aMPhtP = 0.0
                else if ( (aLngSP >= uDptWM) ) then
                aMPhtP = cMPhrM * uFnTPP * ufDay
                else
                aMPhtP = 0.0
                endif

!       Droop_function_N-limitation
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                aNLmPP = (1.0 - cNDPhrMn / rNDRtP) * cNDPhrMx /(cNDPhrMx - cNDPhrMn)
                else
                aNLmPP = 0.0
                endif

!       Droop_function_P-limitation
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                aPLmPP = (1.0 - cPDPhrMn / rPDRtP) * cPDPhrMx /(cPDPhrMx - cPDPhrMn)
                else
                aPLmPP = 0.0
                endif

!       Nutrient_reduction_function
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                aNtLmP = min(aNLmPP,aPLmPP)
                else
                aNtLmP = 0.0
                endif

!       Growth_rate
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                aMuPhr = aMPhtP * aNtLmP
                else
                aMuPhr = 0.0
                endif

!       Intrinsic_net_increase_rate_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                akDIncrPh = aMPhtP - ukDRTP - kDMrSP
                else
                akDIncrPh = 0.0
                endif

!       Density_correction_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDDnsP = max(0.0,akDIncrPh / cDShPM * aDShtP * aDShtP)
                else
                tDDnsP = 0.0
                endif

!       Density_correction_of_production
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDDnPP = aMuPhr / cMPhrM * tDDnsP
                else
                tDDnPP = 0.0
                endif

!       Production_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDPrdP = aMuPhr * aDShtP - tDDnPP
                else
                tDPrdP = 0.0
                endif

!       Production_shoot_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDPrSP = afDShP * tDPrdP
                else
                tDPrSP = 0.0
                endif

!       Production_root_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDPrRP = tDPrdP - tDPrSP
                else
                tDPrRP = 0.0
                endif

!       Maintenance_respiration_shoot_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDRsSP = ukDRTP * aDShtP
                else
                tDRsSP = 0.0
                endif

!       Maintenance_respiration_root_of_reed
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDRsRP = ukDRTP * aDRtPh
                else
                tDRsRP = 0.0
                endif

!       Root_O2_respiration
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tO2RRP = mlO2mC * cCPrDW * tDRsRP * afOxSM
                else
                tO2RRP = 0.0
                endif

!       O2_flux_to_sediment
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tO2FlP = tO2RRP
                else
                tO2FlP = 0.0
                endif

!       Counter_for_winter_mode_of_phragmites
                if ( (Day < 180.0) ) then
                bDyRlP = 367
                else if ( (ufDay <= fDayWn .and. bDyRlP > 366) ) then
                bDyRlP = Day
                else
                bDyRlP = bDyRlP
                endif

!       Shoot_biomass_available_for_reallocation_to_root
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                aDRlPh = 0.0
                else if ( (Day < bDyRlP) ) then
                aDRlPh = 0.0
                else if ( (Day <= bDyRlP + 1.0 / kDRlPh) ) then
                aDRlPh = fDRlPh * aDShtP
                else
                aDRlPh = 0.0
                endif

!       Reallocation_of_D_per_day_at_end_of_growing_season
                if ( (0 == InclSs) ) then
                tDRlPh = 0.0
                else if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tDRlPh = 0.0
                else if ( (Day < bDyRlP) ) then
                tDRlPh = 0.0
                else if ( (Day <= bDyRlP + 1.0 / kDRlPh) ) then
                tDRlPh = kDRlPh * aDRlPh
                else
                tDRlPh = 0.0
                endif

!       Retranslocation_of_N_end_growing_season
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNRtrP = rNDShP * tDRlPh
                else
                tNRtrP = 0.0
                endif

!       Retranslocation_of_P_end_growing_season
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tPRtrP = rPDShP * tDRlPh
                else
                tPRtrP = 0.0
                endif

!       Mortality_of_shoots
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDMrSP = kDMrSP * aDShtP
                else
                tDMrSP = 0.0
                endif

!       Mortality_of_shoots
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNMrSP = rNDShP * tDMrSP
                else
                tNMrSP = 0.0
                endif

!       Mortality_of_shoots
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tPMrSP = rPDShP * tDMrSP
                else
                tPMrSP = 0.0
                endif

!       Mortality_of_roots
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDMrRP = kDMrRP * aDRtPh
                else
                tDMrRP = 0.0
                endif

!       Mortality_of_roots
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNMrRP = rNDRtP * tDMrRP
                else
                tNMrRP = 0.0
                endif

!       Mortality_of_roots
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tPMrRP = rPDRtP * tDMrRP
                else
                tPMrRP = 0.0
                endif

!       Loss_flux_of_biomass_by_management
                if ( (0 == InclMr .or. fMarsh > NearZr) ) then
                tDMnSP = 0.0
                else if ( ((Day >= cDyMnP) .and. (Day < cDyMnP + 1.0)) ) then
                tDMnSP = fMnPhr * aDShtP
                else
                tDMnSP = 0.0
                endif

!       Loss_flux_of_N_through_management
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNMnSP = tDMnSP * rNDShP
                else
                tNMnSP = 0.0
                endif

!       Loss_flux_of_P_through_management
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tPMnSP = tDMnSP * rPDShP
                else
                tPMnSP = 0.0
                endif

!       Increase_in_inorganic_matter_in_sediment
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDIMSM = tDSIMM
                else
                tDIMSM = 0.0
                endif

!       Increase_in_sediment_humus_in_marsh
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDHmSM = fRfrDS * tDMDSM - tDMHSM
                else
                tDHmSM = 0.0
                endif

!       Increase_in_sediment_detritus_in_marsh
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDDtSM = tDSetDetM - tDMDSM + tDStPM + tDMrRP
                else
                tDDtSM = 0.0
                endif

!       Turnover_depth_in_marsh
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                vDltSM = (tDIMSM / cRhoIM +(tDHmSM + tDDtSM) / cRhoOM)/(1.0 - bPorS)
                else
                vDltSM = 0.0
                endif

!       Burial_flux_of_DW_in_inorganic_matter_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tDBIMM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tDBIMM = ((tDHmSM + tDDtSM) +(cRhoOM / cRhoIM) * tDIMSM) / ((aDHmSM + aDDtSM) / &
                &aDIMSM + cRhoOM / cRhoIM)
                else
                tDBIMM = ((tDHmSM + tDDtSM) +(cRhoOM / cRhoIM) * tDIMSM) / (fDOrgS /(1.0 - fDOrg&
                &S) + cRhoOM / cRhoIM)
                endif

!       Burial_flux_of_DW_in_organic_matter_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tDBOMM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tDBOMM = (aDHmSM + aDDtSM) / aDIMSM * tDBIMM
                else
                tDBOMM = fDOrgS /(1.0 - fDOrgS) * tDBIMM
                endif

!       Burial_flux_of_DW_in_detritus_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tDBrDM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tDBrDM = aDDtSM /(aDHmSM + aDDtSM) * tDBOMM
                else
                tDBrDM = 0.0
                endif

!       Burial_flux_of_DW_in_humus_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tDBrHM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tDBrHM = tDBOMM - tDBrDM
                else
                tDBrHM = tDBOMM
                endif

!       Total_DW_burial_flux_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tDBrTM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tDBrTM = tDBIMM + tDBOMM
                else
                tDBrTM = tDBIMM + tDBOMM
                endif

!       Burial_flux_of_P_in_humus_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tPBrHM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tPBrHM = rPDHSM * tDBrHM
                else
                tPBrHM = cPDSOM * tDBrHM
                endif

!       Burial_flux_of_P_in_detritus_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tPBrDM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tPBrDM = rPDDSM * tDBrDM
                else
                tPBrDM = 0.0
                endif

!       Burial_flux_of_P_absorbed_onto_inorganic_matter_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tPBAIMM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tPBAIMM = aPAIMSM / aDIMSM * tDBIMM
                else
                tPBAIMM = 0.0
                endif

!       Burial_flux_of_dissolved_P_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tPBPO4M = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tPBPO4M = aPO4SM *(vDltSM / cDptSM)
                else
                tPBPO4M = cPO4Gr *(bPorSM * vDltSM)
                endif

!       Total_P_burial_flux_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tPBrTM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tPBrTM = tPBrDM + tPBrHM + tPBAIMM + tPBPO4M
                else
                tPBrTM = tPBrHM + tPBAIMM + tPBPO4M
                endif

!       Burial_flux_of_N_in_humus_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tNBrHM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tNBrHM = rNDHSM * tDBrHM
                else
                tNBrHM = cNDSOM * tDBrHM
                endif

!       Burial_flux_of_N_in_detritus_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tNBrDM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tNBrDM = rNDDSM * tDBrDM
                else
                tNBrDM = 0.0
                endif

!       Burial_flux_of_dissolved_NH4_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tNBNH4M = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tNBNH4M = aNH4SM *(vDltSM / cDptSM)
                else
                tNBNH4M = cNH4Gr *(bPorSM * vDltSM)
                endif

!       Burial_flux_of_dissolved_NO3_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tNBNO3M = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tNBNO3M = aNO3SM *(vDltSM / cDptSM)
                else
                tNBNO3M = cNO3Gr *(bPorSM * vDltSM)
                endif

!       Total_N_burial_flux_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tNBrTM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tNBrTM = tNBrDM + tNBrHM + tNBNH4M + tNBNO3M
                else
                tNBrTM = tNBrHM + tNBNH4M + tNBNO3M
                endif

!       Burial_flux_of_Si_in_detritus_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tSBrDM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tSBrDM = rSDDSM * tDBrDM
                else
                tSBrDM = 0.0
                endif

!       Total_Si_burial_flux_in_marsh
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                tSBrTM = 0.0
                else if ( (vDltSM >= 0.0) ) then
                tSBrTM = tSBrDM
                else
                tSBrTM = 0.0
                endif

!       Marsh_water_depth_change
                if ( (0 == InclMr .or. fMarsh <= NearZr) ) then
                vDltWM = 0.0
                else if ( (CnstDp == 1) ) then
                vDltWM = 0.0
                else
                vDltWM = - vDltSM
                endif

!       Relative_marsh_water_depth_change
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                aRlDWM = vDltWM / uDptWM
                else
                aRlDWM = 0.0
                endif

!       Dredging_time(every_nth_year)
                if ( (sTime >= cDrdSt * DysPrY) ) then
                bTmDrd = (floor(TimYrs/cDrdIn) * cDrdIn) * DysPrY
                else
                bTmDrd = -9999.999
                endif

!       Average_solid_density_of_soil_material
                bRhSlS = fDOrgS * cRhoOM +(1.0 - fDOrgS) * cRhoIM
!       Mass_balance_totals_of_DW_marsh_water_and_vegetation_module
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tDMrTT = (- tDBrTM - wDMDWM * uDptWM -(1.0 - fRfrDS) * tDMDSM - tDMHSM + tDPrdP &
                &- tDRsSP - tDRsRP - tDMnSP) * fMarsh
                else
                tDMrTT = 0.0
                endif

!       Mass_balance_totals_of_P_marsh_water_and_vegetation_module
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tPMrTT = (- tPIPO4SM + tPSPO4SM - tPDGPO4M - tPBrTM - tPCPO4M - tPMnSP) * fMarsh
                else
                tPMrTT = 0.0
                endif

!       Mass_balance_totals_of_N_marsh_water_and_vegetation_module
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tNMrTT = (- tNINH4SM + tNSNH4SM - tNINO3SM + tNSNO3SM - tNDGNO3M - tNDGNH4M - tN&
                &BrTM - wNDnWM * uDptWM - tNDnSM - tNMnSP) * fMarsh
                else
                tNMrTT = 0.0
                endif

!       Mass_balance_totals_of_SI_marsh_water_and_vegetation_module
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                tSMrTT = - tSBrDM * fMarsh - tISO2WM + tSSO2WM
                else
                tSMrTT = 0.0
                endif

!       Residence_time_of_substances
                uTSbsE = 1.0 / (ukOtEp+NearZr)
!       Marsh_water_exchange_coefficient
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                akExME = kExcMM * hfMrsh /(hfMrsh + fMarsh)
                else
                akExME = 0.0
                endif

!       Relative_marsh_volume
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                afVlME = fMarsh * uDptWM / uDptWE
                else
                afVlME = 0.0
                endif

!       Lake_water_exchange_coefficient
                if ( (InclMr == 1 .and. fMarsh > NearZr) ) then
                akExLE = akExME * afVlME
                else
                akExLE = 0.0
                endif

!       Total_P_phytoplankton_in_lake_water
                oPPhWE = oPDitWEp + oPGrWE + oPBlWE
!       Total_N_phytoplankton_in_lake_water
                oNPhWE = oNDitWEp + oNGrWE + oNBlWE
!       Total_seston
                oDSsWE = oDOMWE + oDIMWE
!       Organic_P_in_water
                oPOMWE = oPPhWE + oPDetWEp
!       Total_seston_P_(incl_adsorbed
                oPSsWE = oPPhWE + oPDetWEp + oPAIMWE
!       Inorganic_P_in_water
                oPInWE = oPO4WE + oPAIMWE
!       Total_P_in_water_(excl_animals_AND_vegetation)
                oPTtWE = oPSsWE + oPO4WE
!       Organic_seston_N
                oNOMWE = oNPhWE + oNDetWEp
!       Total_seston_N
                oNSsWE = oNOMWE
!       Kjeldahl_N_in_water
                oNkjWE = oNSsWE + oNH4WE
!       Total_N_in_water_(without_animals_AND_vegetation)
                oNTtWE = oNkjWE + oNO3WE
!       P/D_ratio_of_water_DIM
                rPDIMWE = oPAIMWE / oDIMWE
!       P/D_ratio_of_water_detritus
                rPDDetWEp = oPDetWEp / (oDDetWEp+NearZr)
!       N/D_ratio_of_water_detritus
                rNDDetWEp = oNDetWEp / (oDDetWEp+NearZr)
!       Si/D_ratio_of_water_detritus
                rSDDWE = oSDtWE / (oDDetWEp+NearZr)
!       Dilution_of_DW_IM
                wDDIME = ukOtEp * oDIMWE
!       Dilution_of_detritus
                wDDilDetEp = ukOtEp * oDDetWEp
!       Dilution_of_Diat
                wDDilDitEp = ukOtEp * oDDitWEp
!       Dilution_of_Gren
                wDDlGE = ukOtEp * oDGrWE
!       Dilution_of_Blue
                wDDlBE = ukOtEp * oDBlWE
!       Total_algal_dilution
                wDDlPE = wDDilDitEp + wDDlGE + wDDlBE
!       Total_algal_dilution
                wDDlZE = ukOtEp * oDZoEp
!       Total_algal_dilution
                wPDlZE = ukOtEp * oPZoEp
!       Total_algal_dilution
                wNDlZE = ukOtEp * oNZoEp
!       Dilution_of_SRP
                wPDPO4E = ukOtEp * oPO4WE
!       Dilution_of_detritus
                wPDilDetEp = ukOtEp*oPDetWEp
!       Dilution_of_IM-ads_P
                wPDAIME = ukOtEp * oPAIMWE
!       Dilution_of_ammonium
                wNDNH4E = ukOtEp * oNH4WE
!       Dilution_of_nitrate
                wNDNO3E = ukOtEp * oNO3WE
!       Dilution_of_detritus
                wNDilDetEp = ukOtEp * oNDetWEp
!       Oxygen_inflow
                if ( (RdTrnF == 1) ) then
                uO2LdE = mO2LdE
                else
                uO2LdE = cO2In * uQInEp / mmPerm
                endif

!       Oxygen_outflow
                wO2OtE = ukOtEp * oO2WEp
!       Dilution_of_Diat
                wPDilDitEp = ukOtEp * oPDitWEp
!       Dilution_of_Diat
                wNDilDitEp = ukOtEp * oNDitWEp
!       Dilution_of_Gren
                wPDlGE = ukOtEp * oPGrWE
!       Dilution_of_Gren
                wNDlGE = ukOtEp * oNGrWE
!       Dilution_of_Blue
                wPDlBE = ukOtEp * oPBlWE
!       Dilution_of_Blue
                wNDlBE = ukOtEp * oNBlWE
!       Total_algal_dilution
                wPDlPE = wPDilDitEp + wPDlGE + wPDlBE
!       Total_algal_dilution
                wNDlPE = wNDilDitEp + wNDlGE + wNDlBE
!       Outflow_of_DW
                wDOtTE = ukOtEp * oDSsWE
