                wDRBWE = uDRTBE * oDBlWE
!       Algae_grazing_loss
                wDLsBE = ukLTBE * oDBlWE
!       Mortality_in_water
                wDMBWE = kMrtBW * oDBlWE
!       Total_loss_rate_of_algae_in_water(excl_dilution)
                ukDDBE = uDRTBE + ukLTBE + kMrtBW +(uCVSBE * uFnTSE) / uDptWE
!       P_excretion_Algae_in_water
                wPExcrBWE = (rPDBWE * 2.0 )/(cPDBlMx + rPDBWE) * rPDBWE * wDRBWE
!       Algae_grazing_loss
                wPLsBE = rPDBWE * wDLsBE
!       Mortality_Algae_in_water
                wPMBWE = kMrtBW * oPBlWE
!       N_excretion_Algae_in_water
                wNExcrBWE = (rNDBWE *2.0)/(cNDBlMx + rNDBWE) * rNDBWE * wDRBWE
!       Algae_grazing_loss
                wNLsBE = rNDBWE * wDLsBE
!       Mortality_Algae_in_water
                wNMBWE = kMrtBW * oNBlWE
!       Total_PRIM_flux_to_algae_in_water
                if ( (aInclS == 1 ) ) then
                wDPBWE = wDAsBE - wDRBWE - wDLsBE - wDMBWE + (tDStBS-tDFlBE + tDFlBH- tDStBE ) /&
                & uDptWE
                else
                wDPBWE = wDAsBE - wDRBWE - wDLsBE - wDMBWE + (tDRssB + tDStBS - tDStBE -  tDFlBE&
                &) / uDptWE
                endif

!       Total_PRIM_flux_to_Algae
                if ( (aInclS == 1 ) ) then
                wPPBWE = wPUpBE - wPExcrBWE - wPLsBE - wPMBWE+ (tPStBS-tPFlBE + tPFlBH- tPStBE )&
                & / uDptWE
                else
                wPPBWE = wPUpBE - wPExcrBWE - wPLsBE - wPMBWE+ (tPRssB + tPStBS - tPStBE -  tPFl&
                &BE) / uDptWE
                endif

!       Total_PRIM_flux_to_Algae
                if ( (aInclS == 1 ) ) then
                wNPBWE = wNUpBE - wNExcrBWE - wNLsBE - wNMBWE + (tNStBS-tNFlBE + tNFlBH- tNStBE &
                &) / uDptWE
                else
                wNPBWE = wNUpBE - wNExcrBWE - wNLsBE - wNMBWE+ (tNRssB + tNStBS - tNStBE -  tNFl&
                &BE) / uDptWE
                endif

!       Dilution_rate_of_substances
                ukDlSr = ukOtEp
!       Dilution_of_Blue
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tDDlBS = 0.0
                else
                tDDlBS = ukDlSr * aDBlSr
                endif

!       Dilution_of_Blue
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tNDlBS = 0.0
                else
                tNDlBS = ukDlSr * aNBlSr
                endif

!       Dilution_of_Blue
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tPDlBS = 0.0
                else
                tPDlBS = ukDlSr * aPBlSr
                endif

!       Transport_flux_of_D_in_Blue
                if ( (0 == InclTr) ) then
                tDTrBS = 0.0
                else if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tDTrBS = 0.0
                else
                tDTrBS = uDLdBS - tDDlBS
                endif

!       Transport_flux_of_P_in_Blue
                if ( (0 == InclTr) ) then
                tPTrBS = 0.0
                else if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tPTrBS = 0.0
                else
                tPTrBS = uPLdBS - tPDlBS
                endif

!       Transport_flux_of_N_in_Blue
                if ( (0 == InclTr) ) then
                tNTrBS = 0.0
                else if ( (InclSr == 0) ) then
                tNTrBS = 0.0
                else
                tNTrBS = uNLdBS - tNDlBS
                endif

!       Max_growth_rate_of_Algae_at_ambient_temperature
                uMMTBS = cMMxBl * uFTPBS
!       Growth_rate_at_current_light_AND_temp
                aMTLBS = ufDay * aLLmBS * uMMTBS
!       Droop_function(P)_for_Algae
                aPLmBS = max(0.0,(1.0 - cPDBlMn / rPDBlSr) * cPDBlMx /(cPDBlMx - cPDBlMn))
!       Droop_function(N)_for_Algae
                aNLmBS = max(0.0,(1.0 - cNDBlMn / rNDBlSr) * cNDBlMx /(cNDBlMx - cNDBlMn))
!       Silica_dependence_of_growth_rate
                aSLmBS = oSO2WE /(hSAssB + oSO2WE)
!       Nutrient_limitation_function_of_Algae
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                aNtLBS = -9999
                else
                aNtLBS = min(aPLmBS,min(aNLmBS,aSLmBS))
                endif

!       P_limitation_of_blue_greens
                aRpPLB = (aPLmBS* aDBlSr + aPLmBE* aDBlWE) / (aDBlSr + aDBlWE)
!       N_limitation_of_blue_greens
                aRpNLmB = (aNLmBS* aDBlSr + aNLmBE* aDBlWE) / (aDBlSr + aDBlWE)
!       Nutrient_limitation_of_blue_greens
                aRpNtLB = (aNtLBS* aDBlSr + aNtLBE* aDBlWE) / (aDBlSr + aDBlWE)
!       Growth_rate
                aMBlSr = aNtLBS * aMTLBS
!       Assimilation_Algae
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tDAsBS = 0.0
                else
                tDAsBS = aMBlSr * aDBlSr
                endif

!       Maximum_N_uptake_rate_of_Algaecorrected_for_N/D_ratio
                aVNUMCBS = max(0.0,cVNUMB * uFTPBS * (cNDBlMx - rNDBlSr) /(cNDBlMx - cNDBlMn))
!       Maximum_P_uptake_rate_of_Algaecorrected_for_P/D_ratio
                aVPUMCBS = max(0.0,cVPUMB * uFTPBS *(cPDBlMx - rPDBlSr) /(cPDBlMx - cPDBlMn))
!       Half-sat_ndissw_for_uptake_by_Algae
                ahNUBS = aVNUMCBS / cAfNUB
!       N_uptake_rate_of_Algae
                aVNUBS = oNDsWE * aVNUMCBS /(ahNUBS + oNDsWE)
!       P_uptake_rate_of_Algae
                aVPUBS = oPO4WE * aVPUMCBS /(aVPUMCBS / cAfPUB + oPO4WE)
!       N_uptake_Algae
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tNUpBS = 0.0
                else
                tNUpBS = aVNUBS * aDBlSr
                endif

!       N_fixation_Algae
                aNfxBS = rNfxBS *aChlBS /ugPerg
!       N_fixation_Algae
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tNUBAS = 0.0
                else if ( (InclNf == 0) ) then
                tNUBAS = 0.0
                else
                tNUBAS = aNfxBS
                endif

!       N_uptake_Algae
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tNUBWS = 0.0
                else if ( (InclNf == 0) ) then
                tNUBWS = tNUpBS
                else
                tNUBWS = tNUpBS - tNUBAS
                endif

!       Fraction_ammonium_uptake_by_Algae
                aNH4UBS = oNH4WE * oNO3WE /((ahNUBS + oNH4WE) *(ahNUBS + oNO3WE)) + oNH4WE * ahN&
                &UBS /((oNH4WE + oNO3WE) *(ahNUBS + oNO3WE))
!       Ammonium_uptake_by_Algae
                tNUNH4B = aNH4UBS * tNUBWS
!       Nitrate_uptake_by_Algae
                tNUNO3B = tNUBWS - tNUNH4B
!       P_uptake_Algae
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tPUpBS = 0.0
                else
                tPUpBS = aVPUBS * aDBlSr
                endif

!       Respiration_of_Algae_on_Surface
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tDRspBlSr = 0.0
                else
                tDRspBlSr = ukDRTmBlSr *aDBlSr
                endif

!       N_excretion_Algae_in_surface_water
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tNExcrBlSr = 0.0
                else
                tNExcrBlSr = (rNDBlSr * 2.0 )/(cNDBlMx + rNDBlSr) * rNDBlSr * tDRspBlSr
                endif

!       P_excretion_Algae_in_surface_water
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tPExcrBlSr = 0.0
                else
                tPExcrBlSr = (rPDBlSr * 2.0 )/(cPDBlMx + rPDBlSr) * rPDBlSr * tDRspBlSr
                endif

!       Mortality_on_Surface
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tDMrtBlSr = 0.0
                else
                tDMrtBlSr = kMrtBW * aDBlSr
                endif

!       N_flux_by_mortality_on_Surface
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tNMrtBlSr = 0.0
                else
                tNMrtBlSr = kMrtBW * aNBlSr
                endif

!       Ammonium_flux_from_died_Algae
                wNMBNH4W = fDssMrtPh * tNMrtBlSr / uDptWE
!       Detrital_N_flux_from_died_Algae
                wNMBDS = ( 1 -fDssMrtPh) * tNMrtBlSr / uDptWE
!       P_flux_by_mortality_on_Surface
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tPMrtBlSr = 0.0
                else
                tPMrtBlSr = kMrtBW * aPBlSr
                endif

!       Temp_function_of_grazing
                uFnTLS = exp(-0.5/(cSgTmL*cSgTmL) *((uTmSrf-cTmOpL)*(uTmSrf-cTmOpL) -(cTmRef-cTm&
                &OpL)*(cTmRef-cTmOpL)))
!       Daily_grazing_on_Algae
                ukLTBS = UseLss * kLssBl * uFnTLS
!       Algae_grazing_loss
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tDLsBS = 0.0
                else
                tDLsBS = ukLTBS * aDBlSr
                endif

!       Algae_grazing_loss
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tPLsBS = 0.0
                else
                tPLsBS = rPDBlSr * tDLsBS
                endif

!       Algae_grazing_loss
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tNLsBS = 0.0
                else
                tNLsBS = rNDBlSr * tDLsBS
                endif

!       Total_flux_from_PRIM_module_to_surface_Algae
                if ( (InclSr == 0) ) then
                tDPrmBlSr = 0.0
                else
                tDPrmBlSr = tDAsBS - tDRspBlSr + tDFlBE - tDStBS- tDMrtBlSr
                endif

!       N_flux_from_PRIM_module_to_surface_Algae
                if ( (InclSr == 0) ) then
                tNPrmBlSr = 0.0
                else
                tNPrmBlSr = tNUpBS - tNExcrBlSr  + tNFlBE - tNStBS - tNMrtBlSr
                endif

!       P_flux_from_PRIM_module_to_surface_Algae
                if ( (InclSr == 0) ) then
                tPPrmBlSr = 0.0
                else
                tPPrmBlSr = tPUpBS - tPExcrBlSr + tPFlBE - tPStBS- tPMrtBlSr
                endif

!       Total_flux_from_PRIM_module_to_sediment_Algae
                if ( ( aInclS == 0) ) then
                tDPrimBlS = tDStBE - tDRssB - tDMortBlS - tDRespBlS
                else
                tDPrimBlS = tDStBH - tDRssB - tDMortBlS - tDRespBlS
                endif

!       Total_flux_from_PRIM_module_to_sediment_Algae
                if ( ( aInclS == 0) ) then
                tPPrimBlS = tPStBE - tPRssB - tPMortBlS - tPExcrBluS
                else
                tPPrimBlS = tPStBH - tPRssB - tPMortBlS - tPExcrBluS
                endif

!       Total_flux_from_PRIM_module_to_sediment_Algae
                if ( (aInclS == 0) ) then
                tNPrimBlS = tNStBE - tNRssB - tNMortBlS - tNExcrBluS
                else
                tNPrimBlS = tNStBH - tNRssB - tNMortBlS - tNExcrBluS
                endif

!       Maximum_P_uptake_rate_of_Algae_corrected_for_P/D_ratio
                aVPUMCGE = max(0.0,cVPUMG * uFTPGE *(cPDGrnMx - rPDGWE) /(cPDGrnMx - cPDGrnMn))
!       P_uptake_rate_of_Algae
                aVPUGE = oPO4WE * aVPUMCGE /(aVPUMCGE / cAfPUG + oPO4WE)
!       P_uptake_Algae
                wPUpGE = aVPUGE * oDGrWE
!       Maximum_N_uptake_rate_of_Algae_corrected_for_N/D_ratio
                aVNUMCGE = max(0.0,cVNUMG * uFTPGE * (cNDGrnMx - rNDGWE) /(cNDGrnMx - cNDGrnMn))
!       Half-sat_dissolved_nitrogen_in_water_for_uptake_by_Algae
                ahNUGE = aVNUMCGE / cAfNUG
!       N_uptake_rate_of_Algae
                aVNUGE = oNDsWE * aVNUMCGE /(ahNUGE + oNDsWE)
!       N_uptake_Algae
                wNUpGE = aVNUGE * oDGrWE
!       Fraction_ammonium_uptake_by_Algae
                aNH4UGE = oNH4WE * oNO3WE /((ahNUGE + oNH4WE) *(ahNUGE + oNO3WE)) + oNH4WE * ahN&
                &UGE /((oNH4WE + oNO3WE) *(ahNUGE + oNO3WE))
!       Ammonium_uptake_by_Algae
                wNUNH4GE = aNH4UGE * wNUpGE
!       Nitrate_uptake_by_Algae
                wNUNO3GE = wNUpGE - wNUNH4GE
!       Droop_function(P)_for_Algae
                aPLmGE = max(0.0,(1.0 - cPDGrnMn / rPDGWE) * cPDGrnMx /(cPDGrnMx - cPDGrnMn))
!       Droop_function(N)_for_Algae
                aNLmGE = max(0.0,(1.0 - cNDGrnMn / rNDGWE) * cNDGrnMx /(cNDGrnMx - cNDGrnMn))
!       Silica_dependence_of_growth_rate
                aSLmGE = oSO2WE /(hSAssG + oSO2WE)
!       Growth_rate_at_current_light_AND_temp
                aMTLGE = ufDay *(1.0 - afCvSV) * aLLmGE * uMMTGE
!       Nutrient_limitation_function_of_Algae
                aNtLGE = min(aPLmGE , (min(aNLmGE,aSLmGE)))
!       Growth_rate
                aMGrnE = aNtLGE * aMTLGE
!       Assimilation_Algae
                wDAsGE = aMGrnE*oDGrWE
!       Specific_extinction_per_unit_chlorophyll-a
                aExCGE = cExtSG / rChDGE
!       Respiration_of_Algae_in_water
                wDRGWE = uDRTGE * oDGrWE
!       Algae_grazing_loss
                wDLsGE = ukLTGE * oDGrWE
!       Mortality_in_water
                wDMGWE = kMrtGW * oDGrWE
!       Total_loss_rate_of_algae_in_water(excl_dilution)
                ukDDGE = uDRTGE + ukLTGE + kMrtGW +(uCVSGE * uFnTSE) / uDptWE
!       P_excretion_Algae_in_water
                wPExcrGWE = (2.0 *rPDGWE) /(cPDGrnMx + rPDGWE) * rPDGWE * wDRGWE
!       Algae_grazing_loss
                wPLsGE = rPDGWE * wDLsGE
!       Mortality_Algae_in_water
                wPMGWE = kMrtGW * oPGrWE
!       N_excretion_Algae_in_water
                wNExcrGWE = (2.0 * rNDGWE) /(cNDGrnMx + rNDGWE) * rNDGWE * wDRGWE
!       Algae_grazing_loss
                wNLsGE = rNDGWE * wDLsGE
!       Mortality_Algae_in_water
                wNMGWE = kMrtGW * oNGrWE
!       Total_PRIM_flux_to_algae_in_water
                if ( (aInclS == 1 ) ) then
                wDPGWE = wDAsGE - wDRGWE - wDLsGE - wDMGWE -(tDStGE ) / uDptWE
                else
                wDPGWE = wDAsGE - wDRGWE - wDLsGE - wDMGWE -(tDStGE - tDRssG) / uDptWE
                endif

!       Total_PRIM_flux_to_Algae
                if ( (aInclS == 1 ) ) then
                wPPGWE = wPUpGE - wPExcrGWE - wPLsGE - wPMGWE -(tPStGE ) / uDptWE
                else
                wPPGWE = wPUpGE - wPExcrGWE - wPLsGE - wPMGWE -(tPStGE - tPRssG) / uDptWE
                endif

!       Total_PRIM_flux_to_Algae
                if ( (aInclS == 1 ) ) then
                wNPGWE = wNUpGE - wNExcrGWE - wNLsGE - wNMGWE -(tNStGE ) / uDptWE
                else
                wNPGWE = wNUpGE - wNExcrGWE - wNLsGE - wNMGWE -(tNStGE - tNRssG) / uDptWE
                endif

!       Total_flux_from_PRIM_module_to_sediment_Algae
                if ( ( aInclS == 0) ) then
                tDPrGS = tDStGE - tDRssG - tDMrGS - tDRsGS
                else
                tDPrGS = tDStGH - tDRssG - tDMrGS - tDRsGS
                endif

!       Total_flux_from_PRIM_module_to_sediment_Algae
                if ( ( aInclS == 0) ) then
                tPPrGS = tPStGE - tPRssG - tPMrGS - tPExGS
                else
                tPPrGS = tPStGH - tPRssG - tPMrGS - tPExGS
                endif

!       Total_flux_from_PRIM_module_to_sediment_Algae
                if ( ( aInclS == 0) ) then
                tNPrGS = tNStGE - tNRssG - tNMrGS - tNExGS
                else
                tNPrGS = tNStGH - tNRssG - tNMrGS - tNExGS
                endif

!       Maximum_P_uptake_rate_of_Algae_corrected_for_P/D_ratio
                aVPUMCDE = max(0.0,cVPUMD * uFTPDE *(cPDDtMx - rPDDitWEp) /(cPDDtMx - cPDDtMn))
!       P_uptake_rate_of_Algae
                aVPUDE = oPO4WE * aVPUMCDE /(aVPUMCDE / cAfPUD + oPO4WE)
!       P_uptake_Algae
                wPUpDE = aVPUDE * oDDitWEp
!       Maximum_N_uptake_rate_of_Algae_corrected_for_N/D_ratio
                aVNUMCDE = max(0.0,cVNUMD * uFTPDE * (cNDDtMx - rNDDitWEp) /(cNDDtMx - cNDDtMn))
!       Half-sat_dissolved_nitrogen_in_water_for_uptake_by_Algae
                ahNUDE = aVNUMCDE / cAfNUD
!       N_uptake_rate_of_Algae
                aVNUDE = oNDsWE * aVNUMCDE /(ahNUDE + oNDsWE)
!       N_uptake_Algae
                wNUpDE = aVNUDE * oDDitWEp
!       Fraction_ammonium_uptake_by_Algae
                aNH4UDE = oNH4WE * oNO3WE /((ahNUDE + oNH4WE) *(ahNUDE + oNO3WE)) + oNH4WE * ahN&
                &UDE /((oNH4WE + oNO3WE) *(ahNUDE + oNO3WE))
!       Ammonium_uptake_by_Algae
                wNUNH4DE = aNH4UDE * wNUpDE
!       Nitrate_uptake_by_Algae
                wNUNO3DE = wNUpDE - wNUNH4DE
!       Droop_function(P)_for_Algae
                aPLmDE = max(0.0,(1.0 - cPDDtMn / rPDDitWEp) * cPDDtMx /(cPDDtMx - cPDDtMn))
!       Droop_function(N)_for_Algae
                aNLmDE = max(0.0,(1.0 - cNDDtMn / rNDDitWEp) * cNDDtMx /(cNDDtMx - cNDDtMn))
!       Silica_dependence_of_growth_rate
                aSLmDE = oSO2WE /(hSAssD + oSO2WE)
!       Growth_rate_at_current_light_AND_temp
                aMTLDE = ufDay *(1.0 - afCvSV) * aLLmDE * uMMTDE
!       Nutrient_limitation_function_of_Algae
                aNtLDE = min(aPLmDE , (min(aNLmDE,aSLmDE)))
!       Growth_rate
                aMDtEp = aNtLDE * aMTLDE
!       Assimilation_Algae
                wDAsDE = aMDtEp*oDDitWEp
!       Specific_extinction_per_unit_chlorophyll-a
                aExCDE = cExtSpDit / rChDDE
!       Respiration_of_Algae_in_water
                wDRDWE = uDRTDE * oDDitWEp
!       Algae_grazing_loss
                wDLsDE = ukLTDE * oDDitWEp
!       Mortality_in_water
                wDMrDWE = kMrtDW * oDDitWEp
!       Total_loss_rate_of_algae_in_water(excl_dilution)
                ukDDDE = uDRTDE + ukLTDE + kMrtDW +(uCrVSetDiE * uFnTSE) / uDptWE
!       P_excretion_Algae_in_water
                wPExcrDWE = (2.0 * rPDDitWEp) /(cPDDtMx + rPDDitWEp) * rPDDitWEp * wDRDWE
!       Algae_grazing_loss
                wPLsDE = rPDDitWEp * wDLsDE
!       Mortality_Algae_in_water
                wPMrDWE = kMrtDW * oPDitWEp
!       N_excretion_Algae_in_water
                wNExcrDWE = (2.0 * rNDDitWEp) /(cNDDtMx + rNDDitWEp) * rNDDitWEp * wDRDWE
!       Algae_grazing_loss
                wNLsDE = rNDDitWEp * wDLsDE
!       Mortality_Algae_in_water
                wNMrDWE = kMrtDW * oNDitWEp
!       Total_PRIM_flux_to_algae_in_water
                if ( (aInclS == 1 ) ) then
                wDPrimDiWE = wDAsDE - wDRDWE - wDLsDE - wDMrDWE -(tDSetDitEp ) / uDptWE
                else
                wDPrimDiWE = wDAsDE - wDRDWE - wDLsDE - wDMrDWE -(tDSetDitEp - tDResusDit) / uDp&
                &tWE
                endif

!       Total_PRIM_flux_to_Algae
                if ( (aInclS == 1 ) ) then
                wPPrimDiWE = wPUpDE - wPExcrDWE - wPLsDE - wPMrDWE -(tPSetDitEp ) / uDptWE
                else
                wPPrimDiWE = wPUpDE - wPExcrDWE - wPLsDE - wPMrDWE -(tPSetDitEp - tPResusDit) / &
                &uDptWE
                endif

!       Total_PRIM_flux_to_Algae
                if ( (aInclS == 1 ) ) then
                wNPrimDiWE = wNUpDE - wNExcrDWE - wNLsDE - wNMrDWE -(tNSetDitEp ) / uDptWE
                else
                wNPrimDiWE = wNUpDE - wNExcrDWE - wNLsDE - wNMrDWE -(tNSetDitEp - tNResusDit) / &
                &uDptWE
                endif

!       Total_flux_from_PRIM_module_to_sediment_Algae
                if ( ( aInclS == 0) ) then
                tDPrimDitS = tDSetDitEp - tDResusDit - tDMrDS - tDRsDS
                else
                tDPrimDitS = tDSetDitH - tDResusDit - tDMrDS - tDRsDS
                endif

!       Total_flux_from_PRIM_module_to_sediment_Algae
                if ( ( aInclS == 0) ) then
                tPPrimDitS = tPSetDitEp - tPResusDit - tPMrDS - tPExDS
                else
                tPPrimDitS = tPSetDitH - tPResusDit - tPMrDS - tPExDS
                endif

!       Total_flux_from_PRIM_module_to_sediment_Algae
                if ( ( aInclS == 0) ) then
                tNPrimDitS = tNSetDitEp - tNResusDit - tNMrDS - tNExDS
                else
                tNPrimDitS = tNSetDitH - tNResusDit - tNMrDS - tNExDS
                endif

!       Total_chlorophyll-a
                if ( ( aInclS == 1 ) ) then
                oChla = (oChlEp * uDptWE + oChlHy * uDptWH + aChlBS) / uDpthW
                else
                oChla = (oChlEp * uDptWE+ aChlBS ) / uDpthW
                endif

!       Chlorophyll-a_in_water
                if ( ( aInclS == 1 ) ) then
                oChlaW = (oChlEp * uDptWE + oChlHy * uDptWH) / uDpthW
                else
                oChlaW = (oChlEp * uDptWE) / uDpthW
                endif

!       Chla_per_m2
                aChlaH = oChla * uDpthW
!       Integrated_PI_curve_for_phytoplankton_growth
                aLPIEp =  (aLPARBS- aLPARBEO + uhLVeg* log((1.0 +aLPARBEO/ uhLVeg)  /(1.0 + aLPA&
                &RBS  / uhLVeg) + NearZr  ) ) / uDptWE
!       Integrated_PI_curve_for_phytoplankton_growth_Hyp
                aLPIHy =  (aLPARBtE- aLPARBHO + uhLVeg* log((1.0 +aLPARBHO/ uhLVeg)  /(1.0 + aLP&
                &ARBtE  / uhLVeg) + NearZr  ) ) / uDptWH
!       Integrated_PI_curve_for_phytoplankton_growth_Epi
                aLPIME =  (aLPARBS- aLPARBtE ) /aExtCE
!       Integrated_PI_curve_for_phytoplankton_growth_Hyp
                aLPIMH =  (aLPARBtE- aLPARBtH) / aExtCH
!       Light_at_measurement_depth
                aLMsEp = aLPARBS * exp(- aExCOE *cDptMC)
!       Light_at_measurement_depth_Hyp
                aLMsHy = aLPARBtE * exp(- aExCOH * (cDptMC -  uDptWE))
!       One_percent_PAR_of_incident_light
                aLPARE = PerCnt * uLPARSr
!       Euphotic_depth
                if ( (aLPARE > aLPARBS) ) then
                aDptEW =  0.0
                else if ( (aLPARE >= aLPARBEO) ) then
                aDptEW = - log(aLPARE/aLPARBS) / aExtCE
                else
                aDptEW = uDptWE - log(aLPARE/aLPARBEO) / aExCOH
                endif

!       Total_chlorophyll-a_at_measurement_depth
                if ( (cDptMC < aDptEW) ) then
                oChlME = aLMsEp/ aLPIME *oChlEp * uDptWE
                else
                oChlME = oChlEp
                endif

!       Total_chlorophyll-a_at_measurement_depth_in_Hyp
                if ( (cDptMC < aDptEW) ) then
                oChlMH =  aLMsHy/ aLPIMH *oChlHy* uDptWH
                else
                oChlMH = oChlHy
                endif

!       Total_chlorophyll-a_at_measurement_depth
                if ( (cDptMC < uDptWE) ) then
                oChlMW = oChlME
                else
                oChlMW = oChlMH
                endif

!       Total_algal_growth
                wDAsPE = wDAsDE + wDAsGE + wDAsBE
!       Total_algal_respiration_in_water
                wDRPWE = wDRDWE + wDRGWE + wDRBWE
!       Total_algal_mortality_in_water
                wDMPWE = wDMrDWE + wDMGWE + wDMBWE
!       Total_phytoplankton_sedimentation
                tDStPE = tDSetDitEp + tDStGE + tDStBE
!       Total_phytoplankton_grazing_loss
                wDLsPE = wDLsDE + wDLsGE + wDLsBE + tDLsBS / uDptWE
!       Total_of_PRIM_processes_of_algae_in_water
                wDPPWE = wDPrimDiWE + wDPGWE + wDPBWE
!       Total_P_uptake_phytoplankton
                wPUpPE = wPUpDE + wPUpGE + wPUpBE
!       Total_P_excretion_phytoplankton_in_water
                wPEPWE = wPExcrDWE + wPExcrGWE + wPExcrBWE
!       Total_P_mortality_phytoplankton_in_water
                wPMPWE = wPMrDWE + wPMGWE + wPMBWE
!       Total_sedimentation_of_algae
                tPStPE = tPSetDitEp + tPStGE + tPStBE
!       Total_grazing_loss
                wPLsPE = wPLsDE + wPLsGE + wPLsBE + tPLsBS / uDptWE
!       Total_of_PRIM_processes_of_algae_in_water
                wPPPWE = wPPrimDiWE + wPPGWE + wPPBWE
!       Total_N_uptake_phytoplankton
                wNUpPE = wNUpDE + wNUpGE + wNUpBE
!       Total_ammonium-N_uptake_phytoplankton
                wNUNH4PE = wNUNH4DE + wNUNH4GE + wNUNH4BE
!       Total_nitrate-N_uptake_phytoplankton
                wNUNO3PE = wNUNO3DE + wNUNO3GE + wNUNO3BE
!       Total_N_excretion_phytoplankton_in_water
                wNEPWE = wNExcrDWE + wNExcrGWE + wNExcrBWE
!       Total_N_mortality_phytoplankton_in_water
                wNMPWE = wNMrDWE + wNMGWE + wNMBWE
!       Total_sedimentation_of_algae
                tNStPE = tNSetDitEp + tNStGE + tNStBE
!       Total_grazing_loss
                wNLsPE = wNLsDE + wNLsGE + wNLsBE + tNLsBS / uDptWE
!       Total_of_PRIM_processes_of_algae_in_water
                wNPPWE = wNPrimDiWE + wNPGWE + wNPBWE
!       Total_flux_of_algae_on_bottom
                tDPrPS = tDPrimDitS + tDPrGS + tDPrimBlS
!       Total_flux_of_algae_on_bottom
                tPPrPS = tPPrimDitS + tPPrGS + tPPrimBlS
!       Total_flux_of_algae_on_bottom
                tNPrPS = tNPrimDitS + tNPrGS + tNPrimBlS
!       Diatoms_silica_uptake
                wSUpDE = cSiDDt * wDAsDE
!       Si_excretion
                wSExcrDWE = cSiDDt * wDRDWE
!       Diatom_grazing_loss
                wSLsDE = cSiDDt * wDLsDE
!       Diatoms_mortality_in_water
                wSMrDWE = cSiDDt * wDMrDWE
!       Diatoms_sedimentation
                tSiSetDitE = cSiDDt * tDSetDitEp
!       Total_Si_flux_to_sed_diatoms_in_PRIM_module
                if ( (aInclS == 1 ) ) then
                wSiPrDiWH = wSUpDH - tSiSetDitH / uDptWH - wSExcrDWH - wSMrDWH - wSLsDH
                else
                wSiPrDiWH = 0.0
                endif

!       Total_Si_flux_to_sed_diatoms_in_PRIM_module
                if ( (aInclS == 1 ) ) then
                wSiPrDiWE = wSUpDE - tSiSetDitE / uDptWE - wSExcrDWE - wSMrDWE - wSLsDE
                else
                wSiPrDiWE = wSUpDE - tSiSetDitE / uDptWE - wSExcrDWE - wSMrDWE - wSLsDE + tSiRes&
                &usDi / uDptWE
                endif

!       C-phycocyanin/DW-ratio_blue-greens
                rCyDBE = cCyDBlMx -(cCyDBlMx - cCyDBlMn) * aLLmBE
!       C-phycocyanin
                oCynEp = rCyDBE * oDBlWE * mgPerg
!       DW_fraction_of_algal_group_of_total_algae
                fDDtEp = oDDitWEp /(oDDitWEp + oDGrWE + oDBlWE + NearZr)
!       Flux_to_water_detritus
                if ( (InclSr == 1) ) then
                wDPrimDeWE = wDMPWE + wDLsPE + tDMrtBlSr / uDptWE
                else
                wDPrimDeWE = wDMPWE + wDLsPE
                endif

!       Flux_to_sediment_detritus
                tDPrimDetS = tDMrPS
!       total_DW_flux_in_Surface
                if ( (InclSr == 1) ) then
                tDPrTS = tDAsBS - tDRspBlSr
                else
                tDPrTS = 0.0
                endif

!       Total_DW_flux
                if ( (aInclS == 0 ) ) then
                tDPrTT =(wDAsPE - wDRPWE) * uDptWE - tDRsPS + tDPrTS
                else
                tDPrTT = (wDAsPE - wDRPWE) * uDptWE + (wDAsPH - wDRPWH) * uDptWH - tDRsPS + tDPr&
                &TS
                endif

!       O2_production_by_phytoplankton
                wO2PPE = mlO2mC * cCPrDW * wDAsPE
!       O2_production_by_phytoplankton
                wO2RPWE = mlO2mC * cCPrDW * wDRPWE * aCO2BODE
!       O2_production_due_to_NO3_uptake_by_phytoplankton
                wO2UNO3PE = O2PNO3 * mlO2mN * wNUNO3PE
!       O2_flux_by_water_algae
                wO2PWE = wO2PPE - wO2RPWE + wO2UNO3PE
!       O2_respiration_by_sediment_algae
                tO2RPS = mlO2mC * cCPrDW * tDRsPS * afOxyS
!       O2_flux_by_sediment_algae
                tO2PrS = tO2RPS
!       O2_flux_from_sediment_algae_to_Hypolimnion
                if ( aInclS == 1 ) then
                tO2PSH = tO2PrS / uDptWH
                else
                tO2PSH = 0.0
                endif

!       O2_flux_from_sediment_algae_to_Epilimnion
                if ( aInclS == 0 ) then
                tO2PSE = tO2PrS / uDptWE
                else
                tO2PSE = 0.0
                endif

!       Soluble_P_flux_from_died_Algae_on_surface
                wPMBPO4W = fDssMrtPh * tPMrtBlSr / uDptWE
!       Detrital_P_flux_from_died_Algae_on_surface
                wPMBDS = ( 1 -fDssMrtPh) * tPMrtBlSr / uDptWE
!       Soluble_P_flux_from_died_Algae
                wPMPPO4WE = fDssMrtPh * wPMPWE
!       Detrital_P_flux_from_died_Algae
                wPMPDWE = wPMPWE - wPMPPO4WE + wPMBDS
!       Soluble_P_grazing_loss
                wPLPPO4E = fDssLs * wPLsPE
!       Detrital_P_grazing_loss
                wPLPDE = wPLsPE - wPLPPO4E
!       SRP_in_water
                wPPPO4WE = - wPUpPE + wPEPWE + wPLPPO4E + wPMPPO4WE - tPUpBS / uDptWE + tPExcrBl&
                &Sr / uDptWE + wPMBPO4W
!       Detritus_in_water
                wPPrimDeWE = wPLPDE + wPMPDWE
!       Sediment_detritus
                tPPrimDetS = tPMPDS
!       Ammonium_flux_from_died_Algae
                wNMPNH4WE = fDssMrtPh * wNMPWE
!       Detrital_N_flux_from_died_Algae
                wNMPDWE = wNMPWE - wNMPNH4WE+ wNMBDS
!       NH4-N_grazing_loss
                wNLPNH4E = fDssLs * wNLsPE
!       Detrital_N_grazing_loss
                wNLPDE = wNLsPE - wNLPNH4E
!       Ammonium_in_water
                wNPNH4WE = - wNUNH4PE + wNEPWE + wNLPNH4E + wNMPNH4WE- tNUNH4B / uDptWE + tNExcr&
                &BlSr / uDptWE + wNMBNH4W
!       Nitrate_in_water
                wNPNO3WE = - wNUNO3PE - tNUNO3B / uDptWE
!       Detritus_in_water
                wNPrimDeWE = wNLPDE + wNMPDWE
!       Sediment_detritus
                tNPrimDetS = tNMPDS
!       Total_Si_flux_to_sio2_in_PRIM_module
                if ( (aInclS == 0) ) then
                wSPSO2WE = wSExcrDWE - wSUpDE + tSExDS / uDptWE
                else
                wSPSO2WE = wSExcrDWE - wSUpDE
                endif

!       Total_Si_flux_to_sed_detritus_in_PRIM_module
                wSiPrDeWE = wSMrDWE + wSLsDE
!       Total_Si_flux_to_sed_diatoms_in_PRIM_module
                if ( (aInclS == 0) ) then
                tSiPrimDiS = tSiSetDitE - tSiResusDi - tSExDS - tSMrDS
                else
                tSiPrimDiS = tSiSetDitH - tSiResusDi - tSExDS - tSMrDS
                endif

!       Sediment_detritus
                tSiPrimDeS = tSMrDS
!       Euphotic_depth
                aDptEE = cEuph * aScchE
!       Relative_euphotic_depth
                aRlDEE = aDptEE / uDptWE
!       Chla_per_m2
                aChlHE = oChlEp * uDptWE
!       %_cover_with_algae
                aCvPWE = cCvSpPhy *(oDPhWE * uDptWE)
!       Average_spec_extinction_of_algae_per_unit_chla
                rExCPE = aExtPE /(oChlEp / mgPerg + NearZr)
!       P/D_ratio_herbaceous_zooplankton
                rPDZEp = oPZoEp /(oDZoEp+NearZr)
!       N/C_ratio_herbaceous_zooplankton
                rNDZEp = oNZoEp/(oDZoEp+NearZr)
!       Food_for_zooplankton
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                aDFdZE = cPrefDit * aDDitWEp + cPrfGr * aDGrWE + cPrfBl * aDBlWE + cPrefDet * aD&
                &DetWEp
                else
                aDFdZE = cPrefDit * aDDitWEp + cPrfGr * aDGrWE + cPrfBl * aDBlWE + cPrfBS * aDBl&
                &Sr + cPrefDet * aDDetWEp
                endif

!       Food_for_zooplankton
                oDFdZE = aDFdZE / uDptWE
!       Filtering_rate
                aFltEp = cFltMx * uFnTZE * hFilt /(hFilt + oDOMWE)
!       Food_saturation_function_of_zooplankton
                aDStZE = oDFdZE /(hFilt + oDOMWE)
!       Environmental_correction_of_zooplankton
                wDEnZE = max(0.0,ukDIZE / cDCrrZ * oDZoEp*oDZoEp)
!       Assimilation_of_zooplankton
                wDAsZE = aDStZE *(uDATZE * oDZoEp - wDEnZE)
!       Consumption_of_zooplankton
                wDCnZE = wDAsZE / fDAssZ
!       DW_detritus_consumption_by_zooplankton
                wDConsDeZE = cPrefDet*oDDetWEp / oDFdZE * wDCnZE
!       DW_diatoms_consumption_by_zooplankton
                wDConsDiZE = cPrefDit*oDDitWEp / oDFdZE * wDCnZE
!       DW_greens_consumption_by_zooplankton
                wDCGZE = cPrfGr*oDGrWE / oDFdZE * wDCnZE
!       DW_blue-greens_consumption_by_zooplankton
                wDCBZE = cPrfBl*oDBlWE / oDFdZE * wDCnZE
!       DW_blue-greens_consumption_by_zooplankton
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                wDCBZS = 0.0
                else
                wDCBZS = cPrfBS *aDBlSr / aDFdZE * wDCnZE
                endif

!       DW_blue-greens_consumption_by_zooplankton
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tDCBZS = 0.0
                else
                tDCBZS = wDCBZS *uDptWE
                endif

!       Phytoplankton_consumption_by_zooplankton
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                wDCPZE = wDConsDiZE + wDCGZE + wDCBZE
                else
                wDCPZE = wDConsDiZE + wDCGZE + wDCBZE + wDCBZS
                endif

!       Egestion_of_zooplankton
                wDEgZE = wDCnZE - wDAsZE
!       Correction_factor_of_zooplankton_respiration_for_P_and_N_content
                aCDRZE = max(cPDZRf / rPDZEp,cNDZRf / rNDZEp)
!       Zooplankton_respiration
                wDRsZE = aCDRZE * uDRTZE * oDZoEp
!       Zooplankton_mortality_incl_environmental_correction
                wDMrZE = kMortZ * oDZoEp +(1.0 - aDStZE) * wDEnZE
!       Zooplankton_food
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                aPFdZE = cPrefDit*aPDitWEp + cPrfGr*aPGrWE + cPrfBl * aPBlWE  + cPrefDet * aPDet&
                &WEp
                else
                aPFdZE = cPrefDit*aPDitWEp + cPrfGr*aPGrWE + cPrfBl*aPBlWE + cPrfBS *aPBlSr + cP&
                &refDet * aPDetWEp
                endif

!       Zooplankton_food
                oPFdZE = aPFdZE / MassEp
!       P/D_ratio_of_zooplankton_food
                rPDFZE = oPFdZE /(oDFdZE+NearZr)
!       P_diatom_consumption_by_zooplankton
                wPConsDiZE = rPDDitWEp * wDConsDiZE
!       P_green_consumption_by_zooplankton
                wPCGZE = rPDGWE * wDCGZE
!       P_blue_green_consumption_by_zooplankton
                wPCBZE = rPDBWE * wDCBZE
!       DW_blue-greens_consumption_by_zooplankton
                wPCBZS = rPDBlSr * wDCBZS
!       DW_blue-greens_consumption_by_zooplankton
                tPCBZS = wPCBZS *uDptWE
!       Total_P_phytoplankton_consumption_by_zooplankton
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                wPCPZE = wPConsDiZE + wPCGZE + wPCBZE
                else
                wPCPZE = wPConsDiZE + wPCGZE + wPCBZE + wPCBZS
                endif

!       Consumption_of_detrital_P
                wPConsDeZE = rPDDetWEp * wDConsDeZE
!       Total_P_consumption
                wPCnZE = wPCPZE + wPConsDeZE
!       P_assimilation_efficiency_of_herbivores
                afPAZE = min(1.0,cPDZRf / rPDFZE * fDAssZ)
!       Assimilation_by_herbivores
                wPAsZE = afPAZE * wPCnZE
!       P_egestion
                wPEgZE = wPCnZE - wPAsZE
!       Soluble_P_egestion
                wPEZPO4E = fDssEZ*wPEgZE
!       Detrital_P_egestion
                wPEZDE = wPEgZE - wPEZPO4E
!       P_excretion_rate_of_herbivores
                akPEZE = rPDZEp / cPDZRf * kDRspZ * uFnTZE
!       P_excretion
                wPExcrZE = akPEZE*oPZoEp
!       Mortality
                wPMrZE = rPDZEp * wDMrZE
!       Soluble_P_mortality
                wPMZPO4E = fDssMZ * wPMrZE
!       Detrital_P_mortality
                wPMZDE = wPMrZE - wPMZPO4E
!       Zooplankton_food
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                aNFdZE = cPrefDit*aNDitWEp + cPrfGr*aNGrWE + cPrfBl*aNBlWE + cPrefDet * aNDetWEp
                else
                aNFdZE = cPrefDit*aNDitWEp + cPrfGr*aNGrWE + cPrfBl*aNBlWE + cPrfBS*aNBlSr + cPr&
                &efDet * aNDetWEp
                endif

!       Zooplankton_food
                oNFdZE = aNFdZE / MassEp
!       N/C_ratio_of_zooplankton_food
                rNDFZE = oNFdZE /(oDFdZE+NearZr)
!       N_diatom_consumption_by_zooplankton
                wNConsDiZE = rNDDitWEp*wDConsDiZE
!       N_green_consumption_by_zooplankton
                wNCGZE = rNDGWE*wDCGZE
!       N_blue_green_consumption_by_zooplankton
                wNCBZE = rNDBWE*wDCBZE
!       N_bluegreen_consumption_by_zoopl
                wNCBZS = rNDBlSr * wDCBZS
!       N_bluegreen_consumption_by_zoopl
                tNCBZS = wNCBZS *uDptWE
!       Total_N_phytoplankton_consumption_by_zooplankton
                if ( (InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                wNCPZE =  wNConsDiZE + wNCGZE + wNCBZE
                else
                wNCPZE = wNConsDiZE + wNCGZE + wNCBZE + wNCBZS
                endif

!       Consumption_of_detrital_N
                wNConsDeZE = rNDDetWEp*wDConsDeZE
!       Total_N_consumption
                wNCnZE = wNCPZE + wNConsDeZE
!       N_assimilation_efficiency_of_herbivores
                afNAZE = min(1.0,cNDZRf / rNDFZE * fDAssZ)
!       Assimilation_by_herbivores
                wNAsZE = afNAZE*wNCnZE
!       N_egestion
                wNEgZE = wNCnZE - wNAsZE
!       Soluble_N_egestion
                wNEZNH4E = fDssEZ*wNEgZE
!       Detrital_N_egestion
                wNEZDE = wNEgZE - wNEZNH4E
!       N_excretion_rate_of_herbivores
                kNExZE = rNDZEp / cNDZRf * kDRspZ * uFnTZE
!       N_excretion
                wNExcrZE = kNExZE*oNZoEp
!       Mortality
                wNMrZE = rNDZEp*wDMrZE
!       Soluble_N_mortality
                wNMZNH4E = fDssMZ*wNMrZE
!       Detrital_N_mortality
                wNMZDE = wNMrZE - wNMZNH4E
!       Consumption_of_diatoms
                wSCDZE = cSiDDt * wDConsDiZE
!       P/D_ratio_of_young_fish
                rPDFJv = aPFiJv /(aDFiJv+NearZr)
!       P/D_ratio_of_adult_fish
                rPDFAd = aPFiAd /(aDFiAd+NearZr)
!       N/D_ratio_of_young_fish
                rNDFJv = aNFiJv /(aDFiJv+NearZr)
!       N/D_ratio_of_adult_fish
                rNDFAd = aNFiAd /(aDFiAd+NearZr)
!       Reproduction_flux
                if ( (0 == InclSs) ) then
                tDRprF = ((1/DysInY)*fRprFs) * aDFiAd
                else if ( (Day >= cDyRpF .and. Day < cDyRpF + 1.0) ) then
                tDRprF = fRprFs * aDFiAd * PerDay
                else
                tDRprF = 0.0
                endif

!       Ageing
                if ( (0 == InclSs) ) then
                tDAgFs = ((1/DysInY)*fAgFsh) * aDFiJv
                else if ( (Day >= 364.0) ) then
                tDAgFs = fAgFsh * aDFiJv *PerDay
                else
                tDAgFs = 0.0
                endif

!       Food_limitation_function_of_young_fish
                if ( (aInclS == 0) ) then
                aDTotZ = oDZoEp * uDptWE
                else
                aDTotZ = oDZoEp * uDptWE + oDZHyp * uDptWH
                endif

!       Food_limitation_function_of_young_fish
                if ( (aInclS == 0) ) then
                aPTotZ = oPZoEp * uDptWE
                else
                aPTotZ = oPZoEp * uDptWE + oPZHyp * uDptWH
                endif

!       Food_limitation_function_of_young_fish
                if ( (aInclS == 0) ) then
                aNTotZ = oNZoEp * uDptWE
                else
                aNTotZ = oNZoEp * uDptWE + oNZHyp * uDptWH
                endif

!       Food_limitation_function_of_young_fish
                aDStFJ = aDTotZ * aDTotZ /(hDZFJv * hDZFJv + aDTotZ * aDTotZ)
!       Environmental_correction_of_fish
                tDEnFJ = max(0.0,ukDIFJ /(cDCrrF - aDFiAd) * aDFiJv*aDFiJv)
!       Assimilation_of_fish
                tDAsFJ = aDStFJ *(kDAsFJ * uFnTmF * aDFiJv - tDEnFJ)
!       Zooplankton_consumption_of_fish
                tDCnFJ = tDAsFJ / fDAsFJ
!       Egestion_of_fish
                tDEgFJ = tDCnFJ - tDAsFJ
!       Respiration_of_fish
                tDRsFJ = (cPDFsR / rPDFJv) * kDRsFJ * uFnTmF * aDFiJv
!       Fish_mortality_incl_environmental_correction
                tDMrFJ = kMrtFJ * aDFiJv +(1.0 - aDStFJ) * tDEnFJ
!       Migration_flux
                tDMgFJ = kMgrFs *(cDFJvI - aDFiJv)
!       Environmental_correction_of_fish
                tDEnFA = max(0.0,ukDIFA /(cDCrrF - aDFiJv) * aDFiAd*aDFiAd)
!       Assimilation_of_fish
                tDAsFA = aDStFA *(kDAsFA * uFnTmF * aDFiAd - tDEnFA)
!       Zoobenthos_consumption_of_fish
                tDCnFA = tDAsFA / fDAsFA
!       Egestion_of_fish
                tDEgFA = tDCnFA - tDAsFA
!       Respiration_of_fish
                tDRsFA = (cPDFsR / rPDFAd) * kDRsFA * uFnTmF * aDFiAd
!       Fish_mortality_incl_environmental_correction
                tDMrFA = kMrtFA * aDFiAd +(1.0 - aDStFA) * tDEnFA
!       Harvesting_of_fish
                tDHrvF = ukHrvF * aDFiAd
!       Migration_flux
                tDMgFA = kMgrFs *(cDFAdI - aDFiAd)
!       Part_of_dead_fish_DW_fixed_in_bones_and_scales
                tDMFJB = fDBone * tDMrFJ
!       Part_of_dead_fish_DW_becoming_detritus
                tDMFJD = tDMrFJ - tDMFJB
!       Part_of_dead_fish_DW_fixed_in_bones_and_scales
                tDMFAB = fDBone * tDMrFA
!       Part_of_dead_fish_DW_becoming_detritus
                tDMFAD = tDMrFA - tDMFAB
!       Reproduction_flux
                tPRprF = rPDFAd * tDRprF
!       Ageing
                tPAgFs = rPDFJv * tDAgFs
!       Net_migration_flux
                tPMgFJ = kMgrFs *(cPDFsR * cDFJvI - aPFiJv)
!       (zooplankton)_P_consumption_by_juvenile_fish
                tPCnFJ = rPDZEp * tDCnFJ
!       P_assimilation_efficiency_of_juvenile_fish
                afPAFJ = min(1.0,cPDFsR / rPDZEp * fDAsFJ)
!       P_assimilation_of_juvenile_fish
                tPAsFJ = afPAFJ * tPCnFJ
!       Egestion_of_juvenile_fish
                tPEgFJ = tPCnFJ - tPAsFJ
!       P_excretion_of_juvenile_fish
                tPExFJ = (rPDFJv / cPDFsR) * kDRsFJ * uFnTmF * aPFiJv
!       Mortality_of_juvenile_fish
                tPMrFJ = rPDFJv * tDMrFJ
!       Net_migration_flux
                tPMgFA = kMgrFs *(cPDFsR * cDFAdI - aPFiAd)
!       (zoobenthos)_P_consumption_by_FiAd
                tPCnFA = rPDBnt * tDCnFA
!       P_assimilation_of_FiAd
                tPAsFA = afPAFA * tPCnFA
!       Egestion_of_FiAd
                tPEgFA = tPCnFA - tPAsFA
!       P_excretion_of_FiAd
                tPExFA = (rPDFAd / cPDFsR) * kDRsFA * uFnTmF * aPFiAd
!       Mortality_of_FiAd
                tPMrFA = rPDFAd * tDMrFA
!       Harvesting_of_FiAd
                tPHrvF = rPDFAd * tDHrvF
!       Part_of_dead_fish_P_fixed_in_bones_AND_scales
                tPMFJB = fPBone * tPMrFJ
!       Part_of_dead_fish_P_becoming_dissolved_P
                tPMFJP = fDssMF *(tPMrFJ - tPMFJB)
!       Part_of_dead_fish_PW_becoming_detritus
                tPMFJD = tPMrFJ - tPMFJB - tPMFJP
!       Part_of_dead_fish_P_fixed_in_bones_AND_scales
                tPMFAB = fPBone * tPMrFA
!       Part_of_dead_fish_P_becoming_dissolved_P
                tPMFAP = fDssMF *(tPMrFA - tPMFAB)
!       Part_of_dead_fish_PW_becoming_detritus
                tPMFAD = tPMrFA - tPMFAB - tPMFAP
!       SRP_egestion_of_fish
                tPEFJP = fDssEF * tPEgFJ
!       Detrital_P_egestion_of_fish
                tPEFJD = tPEgFJ - tPEFJP
!       SRP_egestion_of_fish
                tPEFAP = fDssEF * tPEgFA
!       Detrital_P_egestion_of_fish
                tPEFAD = tPEgFA - tPEFAP
!       Reproduction_flux
                tNRprF = rNDFAd * tDRprF
!       Ageing
                tNAgFs = rNDFJv * tDAgFs
!       Net_migration_flux
                tNMgFJ = kMgrFs *(cNDFsR * cDFJvI - aNFiJv)
!       (zooplankton)_N_consumption_by_juvenile_fish
                tNCnFJ = rNDZEp * tDCnFJ
!       N_assimilation_efficiency_of_juvenile_fish
                afNAFJ = min(1.0,cNDFsR / rNDZEp * fDAsFJ)
!       N_assimilation_of_juvenile_fish
                tNAsFJ = afNAFJ * tNCnFJ
!       Egestion_of_juvenile_fish
                tNEgFJ = tNCnFJ - tNAsFJ
!       N_excretion_of_juvenile_fish
                tNExFJ = (rNDFJv / cNDFsR) * kDRsFJ * uFnTmF * aNFiJv
!       Mortality_of_juvenile_fish
                tNMrFJ = rNDFJv * tDMrFJ
!       Net_migration_flux
                tNMgFA = kMgrFs *(cNDFsR * cDFAdI - aNFiAd)
!       (zoobenthos)_N_consumption_by_FiAd
                tNCnFA = rNDBnt * tDCnFA
!       N_assimilation_of_FiAd
                tNAsFA = afNAFA * tNCnFA
!       Egestion_of_FiAd
                tNEgFA = tNCnFA - tNAsFA
!       N_excretion_of_FiAd
                tNExFA = (rNDFAd / cNDFsR) * kDRsFA * uFnTmF * aNFiAd
!       Mortality_of_FiAd
                tNMrFA = rNDFAd * tDMrFA
!       Harvesting_of_FiAd
                tNHrvF = rNDFAd * tDHrvF
!       Part_of_dead_fish_N_fixed_in_bones_AND_scales
                tNMFAB = fDBone * tNMrFA
!       Part_of_dead_fish_N_becoming_dissolved_N
                tNMFAN = fDssMF *(tNMrFA - tNMFAB)
!       Part_of_dead_fish_NW_becoming_detritus
                tNMFAD = tNMrFA - tNMFAB - tNMFAN
!       Part_of_dead_fish_N_fixed_in_bones_AND_scales
                tNMFJB = fDBone * tNMrFJ
!       Part_of_dead_fish_N_becoming_dissolved_N
                tNMFJN = fDssMF *(tNMrFJ - tNMFJB)
!       Part_of_dead_fish_NW_becoming_detritus
                tNMFJD = tNMrFJ - tNMFJB - tNMFJN
!       NH4_egestion_of_fish
                tNEFJN = fDssEF * tNEgFJ
!       Detrital_egestion_of_fish
                tNEFJD = tNEgFJ - tNEFJN
!       Migration_flux
                tDMgrP = kMgrPs *(cDPscI - aDPisc)
!       Total_fish_biomass
                aDFish = aDFiJv + aDFiAd
!       Food_limitation_function_of_Pisc
                aDStPs = aDFish*aDFish /(hDFshP*hDFshP + aDFish*aDFish)
!       Environmental_correction_of_Pisc
                tDEnvP = max(0.0,akDIncrPs / aDCrrP * aDPisc*aDPisc)
!       Assimilation_of_Pisc
                tDAssP = aDStPs *(kDAssP * aFnVgP * uFnTmP * aDPisc - tDEnvP)
!       Consumption_of_Pisc
                tDCnsP = tDAssP / fDAssP
!       Egestion_of_Pisc
                tDEgsP = tDCnsP - tDAssP
!       Young_fish_consumption_by_Pisc
                tDCnFJP = aDFiJv / aDFish * tDCnsP
!       Adult_fish_consumption_by_Pisc
                tDCnFAP = tDCnsP - tDCnFJP
!       Mortality_of_Pisc(incl_environmental_correction)
                tDMrtP = kMrtPs * aDPisc +(1.0 - aDStPs) * tDEnvP
!       Part_of_dead_fish_DW_fixed_in_bones_AND_scales
                tDMrPB = fDBone * tDMrtP
!       Part_of_dead_Pisc_DW_becoming_detritus
                tDMrPD = tDMrtP - tDMrPB
!       Harvesting_of_Pisc
                tDHrvP = ukHrvP * aDPisc
!       Piscivorous_fish
                aPPisc = cPDPsc * aDPisc
!       Young_fish_consumption_by_Pisc
                tPCnFJP = rPDFJv * tDCnFJP
!       Adult_fish_consumption_by_Pisc
                tPCnFAP = rPDFAd * tDCnFAP
!       Total_P_consumption_by_Pisc
                tPCnsP = tPCnFJP + tPCnFAP
!       Average_P/D_ratio_of_Pisc_food
                rPDFdP = tPCnsP / tDCnsP
!       Piscivorous_fish
                aNPisc = cNDPsc * aDPisc
!       Young_fish_consumption_by_Pisc
                tNCnFJP = rNDFJv * tDCnFJP
!       Adult_fish_consumption_by_Pisc
                tNCnFAP = rNDFAd * tDCnFAP
!       Total_N_consumption_by_Pisc
                tNCnsP = tNCnFJP + tNCnFAP
!       Average_N/D_ratio_of_Pisc_food
                rNDFdP = tNCnsP / tDCnsP
!       Consumption_of_Pisc_corrected_for_N_and_P_limitation
                tDCnPN = (tDAssP / fDAssP) * max (1.0, cNDPsc / rNDFdP * fDAssP, cPDPsc / rPDFdP&
                & * fDAssP)
!       Egestion_of_Pisc_corrected_for_N_and_P_limitation
                tDEgPN = tDCnPN - tDAssP
!       Young_fish_consumption_by_Pisc_corrected_for_N_and_P_limitation
                tDCFJPN = aDFiJv / aDFish * tDCnPN
!       Adult_fish_consumption_by_Pisc_corrected_for_N_and_P_limitation
                tDCFAPN = tDCnPN - tDCFJPN
!       Young_fish_consumption_by_Pisc
                tPCFJPN = rPDFJv * tDCFJPN
!       Adult_fish_consumption_by_Pisc
                tPCFAPN = rPDFAd * tDCFAPN
!       Total_P_consumption_by_Pisc
                tPCnPN = tPCFJPN + tPCFAPN
!       Young_fish_consumption_by_Pisc
                tNCFJPN = rNDFJv * tDCFJPN
!       Adult_fish_consumption_by_Pisc
                tNCFAPN = rNDFAd * tDCFAPN
!       Total_N_consumption_by_Pisc
                tNCnPN = tNCFJPN + tNCFAPN
!       P_assimilation_efficiency_of_Pisc
                afPAsP = min(1.0, ((cPDPsc / rPDFdP * fDAssP) / (tDCnPN / tDCnsP )) )
!       P_assimilation_of_Pisc_corrected_for_N_and_P_limitation
                tPAssP = afPAsP * tPCnPN
!       Egestion_of_Pisc_corrected_for_N_and_P_limitation
                tPEgsP = tPCnPN - tPAssP
!       SRP_egestion_of_Pisc_corrected_for_N_and_P_limitation
                tPEPPO = fDssEP * tPEgsP
!       Detrital_P_egestion_of_Pisc_corrected_for_N_and_P_limitation
                tPEgPD = tPEgsP - tPEPPO
!       Respiration_of_Pisc
                tDRspP = kDRspPs * uFnTmP * aDPisc
!       Respiration_of_Pisc
                tPExcP = cPDPsc * tDRspP
!       Mortality_of_Pisc
                tPMrtP = cPDPsc * tDMrtP
!       Part_of_dead_Pisc_P_fixed_in_bones_AND_scales
                tPMrPB = fPBone * tPMrtP
!       Part_of_dead_fish_P_becoming_dissolved_P
                tPMrPPO4 = fDssMrtPs *(tPMrtP - tPMrPB)
!       Part_of_dead_Pisc_P_becoming_detrital_P
                tPMrPD = tPMrtP - tPMrPB - tPMrPPO4
!       Net_migration_flux
                tPMgrP = kMgrPs *(cPDPsc * cDPscI - aPPisc)
!       Harvesting_of_Pisc
                tPHrvP = cPDPsc * tDHrvP
!       N_assimilation_efficiency_of_Pisc
                afNAsP = min(1.0, ((cNDPsc / rNDFdP * fDAssP) / (tDCnPN / tDCnsP )) )
!       N_assimilation_of_Pisc
                tNAssP = afNAsP * tNCnPN
!       Egestion_of_Pisc
                tNEgsP = tNCnPN - tNAssP
!       SRN_egestion_of_Pisc
                tNEPNH = fDssEP * tNEgsP
!       Detrital_N_egestion_of_Pisc
                tNEgPD = tNEgsP - tNEPNH
!       Respiration_of_Pisc
                tNExcP = cNDPsc * tDRspP
!       Mortality_of_Pisc
                tNMrtP = cNDPsc * tDMrtP
!       Part_of_dead_Pisc_N_fixed_in_bones_AND_scales
                tNMrPB = fDBone * tNMrtP
!       Part_of_dead_fish_N_becoming_dissolved_N
                tNMrPNH4 = fDssMrtPs *(tNMrtP - tNMrPB)
!       Part_of_dead_Pisc_N_becoming_detrital_N
                tNMrPD = tNMrtP - tNMrPB - tNMrPNH4
!       Net_migration_flux
                tNMgrP = kMgrPs *(cNDPsc * cDPscI - aNPisc)
!       Harvesting_of_Pisc
                tNHrvP = cNDPsc * tDHrvP
!       Total_food_web_flux_of_DW_in_Zoobenthos
                if ( (0 == InclWb) ) then
                tDWbBn = 0.0
                else
                tDWbBn = tDMgrB + tDAssB - tDCnFA - tDRspB - tDMrtB
                endif

!       Total_food_web_flux_of_P_in_Zoobenthos
                if ( (0 == InclWb) ) then
                tPWbBn = 0.0
                else
                tPWbBn = tPMgrB + tPAssB - tPCnFA - tPExcB - tPMrtB
                endif

!       Total_food_web_flux_of_N_in_Zoobenthos
                if ( (0 == InclWb) ) then
                tNWbBn = 0.0
                else
                tNWbBn = tNMgrB + tNAssB - tNCnFA - tNExcB - tNMrtB
                endif

!       Total_food_web_flux_of_DW_in_Young_fish
                if ( (0 == InclWb) ) then
                tDWbFJ = 0.0
                else
                tDWbFJ = tDMgFJ + tDRprF - tDAgFs + tDAsFJ - tDRsFJ - tDMrFJ - tDCFJPN
                endif

!       Total_food_web_flux_of_P_in_Young_fish
                if ( (0 == InclWb) ) then
                tPWbFJ = 0.0
                else
                tPWbFJ = tPMgFJ + tPRprF - tPAgFs + tPAsFJ - tPExFJ - tPMrFJ - tPCFJPN
                endif

!       Total_food_web_flux_of_N_in_Young_fish
                if ( (0 == InclWb) ) then
                tNWbFJ = 0.0
                else
                tNWbFJ = tNMgFJ + tNRprF - tNAgFs + tNAsFJ - tNExFJ - tNMrFJ - tNCFJPN
                endif

!       Total_food_web_flux_of_DW_in_Adult_fish
                if ( (0 == InclWb) ) then
                        tDWbFA = 0.0
                else
                        tDWbFA = tDMgFA + tDAsFA - tDRsFA - tDMrFA - tDRprF + tDAgFs - tDCFAPN - tDHrvF
                endif

!       Total_food_web_flux_of_P_in_Adult_fish
                if ( (0 == InclWb) ) then
                        tPWbFA = 0.0
                else
                        tPWbFA = tPMgFA + tPAsFA - tPExFA - tPMrFA - tPRprF + tPAgFs - tPCFAPN - tPHrvF
                endif

!       Total_food_web_flux_of_N_in_Adult_fish
                if ( (0 == InclWb) ) then
                        tNWbFA = 0.0
                else
                        tNWbFA = tNMgFA + tNAsFA - tNExFA - tNMrFA - tNRprF + tNAgFs - tNCFAPN - tNHrvF
                endif

!       Total_food_web_flux_of_DW_in_predatory_fish
                if ( (0 == InclWb) ) then
                tDWebPisc = 0.0
                else
                tDWebPisc = tDMgrP + tDAssP - tDRspP - tDMrtP - tDHrvP
                endif

!       Total_food_web_flux_of_DW_in_Herbivorous_zooplankton
                if ( (0 == InclWb .or. aInclS == 0) ) then
                wDWbZH = 0.0
                else
                wDWbZH = wDAsZH - wDRsZH - wDMrZH - tDCnFJ * (( aDTotZ - oDZoEp * uDptWE) / (aDT&
                &otZ + NearZr)) / uDptWH
                endif

!       Total_food_web_flux_of_DW_in_Detritus_in_lake_water
                if ( (0 == InclWb) ) then
                wDWebDetWH = 0.0
                else
                wDWebDetWH = - wDConsDeZH + wDEgZH + wDMrZH +(tDEgFJ * uFJvEgH + tDEgFA * uFAdEg&
                &H + tDMFJD * uFJvMH + tDMFAD * uFAdMH + tDEgPN * uPscEgH + tDMrPD * uPscMH) / uD&
                &ptWH
                endif

!       Total_food_web_flux_of_DW_in_Diatoms_in_lake_water
                if ( (0 == InclWb) ) then
                wDWebDitWH = 0.0
                else
                wDWebDitWH = - wDConsDiZH
                endif

!       Total_food_web_flux_of_DW_in_Greens_in_lake_water
                if ( (0 == InclWb) ) then
                wDWGWH = 0.0
                else
                wDWGWH = - wDCGZH
                endif

!       Total_food_web_flux_of_DW_in_Blue-greens_in_lake_water
                if ( (0 == InclWb) ) then
                wDWBWH = 0.0
                else
                wDWBWH = - wDCBZH
                endif

!       Total_food_web_flux_of_DW_in_Herbivorous_zooplankton
                if ( (0 == InclWb) ) then
                wDWbZE = 0.0
                else
                wDWbZE = wDAsZE - wDRsZE - wDMrZE - tDCnFJ * (oDZoEp * uDptWE / (aDTotZ + NearZr&
                &) ) / uDptWE
                endif

!       Total_food_web_flux_of_DW_in_Detritus_in_lake_water
                if ( (0 == InclWb) ) then
                wDWebDetWE = 0.0
                else
                wDWebDetWE = - wDConsDeZE + wDEgZE + wDMrZE +(tDEgFJ * ( 1.0 - uFJvEgH ) + tDEgF&
                &A * ( 1.0 - uFAdEgH ) + tDMFJD * ( 1.0 - uFJvMH ) + tDMFAD * ( 1.0 - uFAdMH ) + &
                &tDEgPN * ( 1.0 - uPscEgH ) + tDMrPD * ( 1.0 - uPscMH)) / uDptWE
                endif

!       Total_food_web_flux_of_DW_in_Diatoms_in_lake_water
                if ( (0 == InclWb) ) then
                wDWebDitWE = 0.0
                else
                wDWebDitWE = - wDConsDiZE
                endif

!       Total_food_web_flux_of_DW_in_Greens_in_lake_water
                if ( (0 == InclWb) ) then
                wDWGWE = 0.0
                else
                wDWGWE = - wDCGZE
                endif

!       Total_food_web_flux_of_DW_in_Blue-greens_in_lake_water
                if ( (0 == InclWb) ) then
                wDWBWE = 0.0
                else
                wDWBWE = - wDCBZE
                endif

!       Total_foodweb_flux_of_DW_in_surface_blue-greens_in_lake
                if ( (InclWb == 0 .or. InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tDWbBlSr = 0.0
                else
                tDWbBlSr = - tDCBZS
                endif

!       Total_DW_in_system
                if ( (0 == InclWb) ) then
                tDWbTT = 0.0
                else
                tDWbTT = - wDRsZE * uDptWE - wDRsZH * uDptWH + tDMgFJ + tDMgFA + tDMgrP + tDMgrB&
                & - tDRsFJ - tDRsFA - tDRspP - tDRspB - tDMFJB - tDMFAB- tDMrPB - tDHrvF - tDHrvP
                endif

!       Total_food_web_flux_of_P_in_Herbivorous_zooplankton
                if ( (0 == InclWb .or. aInclS == 0) ) then
                wPWbZH = 0.0
                else
                wPWbZH = wPAsZH - wPExcrZH - wPMrZH - tPCnFJ * (( aPTotZ - oPZoEp * uDptWE ) / (&
                &aPTotZ + NearZr) ) / uDptWH
                endif

!       Total_food_web_flux_of_P_in_SRP_in_water_in_lake_water
                if ( (0 == InclWb) ) then
                wPWPO4WH = 0.0
                else
                wPWPO4WH = wPExcrZH + wPEZPO4H + wPMZPO4H +(tPExFJ *uFJvExH + tPExFA * uFAdExH +&
                & tPEFJP * uFJvEgH + tPEFAP * uFAdEgH + tPMFJP * uFJvMH + tPMFAP * uFAdMH+ tPExcP&
                & * uPscExH + tPEPPO * uPscEgH + tPMrPPO4 * uPscMH ) / uDptWH
                endif

!       Total_food_web_flux_of_P_in_Detritus_in_lake_water
                if ( (0 == InclWb) ) then
                wPWebDetWH = 0.0
                else
                wPWebDetWH = - wPConsDeZH + wPEZDH + wPMZDH +(tPEFJD * uFJvEgH + tPEFAD * uFAdEg&
                &H+ tPMFJD * uFJvMH + tPMFAD * uFAdMH+ tPEgPD * uPscEgH+ tPMrPD * uPscMH) / uDptW&
                &H
                endif

!       Total_food_web_flux_of_P_in_Diatoms_in_lake_water
                if ( (0 == InclWb) ) then
                wPWebDitWH = 0.0
                else
                wPWebDitWH = - wPConsDiZH
                endif

!       Total_food_web_flux_of_P_in_Greens_in_lake_water
                if ( (0 == InclWb) ) then
                wPWGWH = 0.0
                else
                wPWGWH = - wPCGZH
                endif

!       Total_food_web_flux_of_P_in_Blue-greens_in_lake_water
                if ( (0 == InclWb) ) then
                wPWBWH = 0.0
                else
                wPWBWH = - wPCBZH
                endif

!       Total_food_web_flux_of_P_in_Herbivorous_zooplankton
                if ( (0 == InclWb) ) then
                wPWbZE = 0.0
                else
                wPWbZE = wPAsZE - wPExcrZE - wPMrZE - tPCnFJ * (oPZoEp * uDptWE / (aPTotZ + Near&
                &Zr)) / uDptWE
                endif

!       Total_food_web_flux_of_P_in_SRP_in_water_in_lake_water
                if ( (0 == InclWb) ) then
                wPWPO4WE = 0.0
                else
                wPWPO4WE = wPExcrZE + wPEZPO4E + wPMZPO4E +(tPExFJ * ( 1.0 -uFJvExH ) + tPExFA *&
                & ( 1.0 - uFAdExH )+ tPEFJP * ( 1.0 - uFJvEgH ) + tPEFAP * ( 1.0 - uFAdEgH ) + tP&
                &MFJP * ( 1.0 - uFJvMH ) + tPMFAP * ( 1.0 - uFAdMH )+ tPExcP * ( 1.0 - uPscExH ) &
                &+ tPEPPO * ( 1.0 - uPscEgH ) + tPMrPPO4 * ( 1.0 - uPscMH)) / uDptWE
                endif

!       Total_food_web_flux_of_P_in_Detritus_in_lake_water
                if ( (0 == InclWb) ) then
