                else
                wPWebDetWE = - wPConsDeZE + wPEZDE + wPMZDE +(tPEFJD * ( 1.0 - uFJvEgH ) + tPEFA&
                &D * ( 1.0 - uFAdEgH )+ tPMFJD * ( 1.0 - uFJvMH ) + tPMFAD * ( 1.0 - uFAdMH )+ tP&
                &EgPD * ( 1.0 - uPscEgH )+ tPMrPD * ( 1.0 - uPscMH )) / uDptWE
                endif

!       Total_food_web_flux_of_P_in_Diatoms_in_lake_water
                if ( (0 == InclWb) ) then
