                if ( (0 == InclWb) ) then
                wNWNH4WH = 0.0
                else
                wNWNH4WH = wNExcrZH + wNEZNH4H + wNMZNH4H +(tNExFJ * uFJvExH + tNExFA * uFAdExH &
                &+ tNEFJN * uFJvEgH+ tNEFAN * uFAdEgH + tNMFAN *uFAdMH+ tNMFJN*uFJvMH + tNExcP *u&
                &PscExH + tNEPNH *uPscEgH + tNMrPNH4 *uPscMH) / uDptWH
