                wNWebDetWH = - wNConsDeZH + wNEZDH + wNMZDH +(tNEFJD * uFJvEgH +tNEFAD * uFAdEgH&
                &+ tNMFJD * uFJvMH + tNMFAD * uFAdMH + tNEgPD * uPscEgH + tNMrPD * uPscMH) / uDpt&
                &WH
                endif

!       Total_food_web_flux_of_N_in_Diatoms_in_lake_water
                if ( (0 == InclWb) ) then
                wNWebDitWH = 0.0
                else
                wNWebDitWH = - wNConsDiZH
                endif

!       Total_food_web_flux_of_N_in_Greens_in_lake_water
                if ( (0 == InclWb) ) then
                wNWGWH = 0.0
                else
                wNWGWH = - wNCGZH
                endif

!       Total_food_web_flux_of_N_in_Blue-greens_in_lake_water
                if ( (0 == InclWb) ) then
                wNWBWH = 0.0
                else
                wNWBWH = - wNCBZH
                endif

!       Total_food_web_flux_of_N_in_Herbivorous_zooplankton
                if ( (0 == InclWb) ) then
                wNWbZE = 0.0
                else
                wNWbZE = wNAsZE - wNExcrZE - wNMrZE - tNCnFJ * (oNZoEp * uDptWE / (aNTotZ + Near&
                &Zr) ) / uDptWE
                endif

!       Total_food_web_flux_of_N_in_ammonium_in_water_in_lake_water
                if ( (0 == InclWb) ) then
                wNWNH4WE = 0.0
                else
                wNWNH4WE = wNExcrZE + wNEZNH4E + wNMZNH4E +(tNExFJ * ( 1.0 - uFJvExH) + tNExFA *&
                & ( 1.0 - uFAdExH) + tNEFJN * ( 1.0 - uFJvEgH ) + tNEFAN * ( 1.0 - uFAdEgH ) + tN&
                &MFAN * ( 1.0 -uFAdMH ) + tNMFJN* ( 1.0 -uFJvMH) + tNExcP * ( 1.0 -uPscExH ) + tN&
                &EPNH * ( 1.0 -uPscEgH ) + tNMrPNH4 * ( 1.0 -uPscMH)) / uDptWE
                endif

!       Total_food_web_flux_of_N_in_Detritus_in_lake_water
                if ( (0 == InclWb) ) then
                wNWebDetWE = 0.0
                else
                wNWebDetWE = - wNConsDeZE + wNEZDE + wNMZDE +(tNEFJD * ( 1.0 - uFJvEgH ) +tNEFAD&
                & * ( 1.0 - uFAdEgH ) + tNMFJD * ( 1.0 - uFJvMH ) + tNMFAD * ( 1.0 - uFAdMH ) + t&
                &NEgPD * ( 1.0 - uPscEgH ) + tNMrPD * ( 1.0 - uPscMH )) / uDptWE
                endif

!       Total_food_web_flux_of_N_in_Diatoms_in_lake_water
                if ( (0 == InclWb) ) then
                wNWebDitWE = 0.0
                else
                wNWebDitWE = - wNConsDiZE
                endif

!       Total_food_web_flux_of_N_in_Greens_in_lake_water
                if ( (0 == InclWb) ) then
                wNWGWE = 0.0
                else
                wNWGWE = - wNCGZE
                endif

!       Total_food_web_flux_of_N_in_Blue-greens_in_lake_water
                if ( (0 == InclWb) ) then
                wNWBWE = 0.0
                else
                wNWBWE = - wNCBZE
                endif

!       Total_foodweb_flux_of_N_in_surface_blue-greens_in_lake
                if ( (InclWb == 0 .or. InclSr == 0 .or. aDBlSr < cDBlSM) ) then
                tNWbBlSr = 0.0
                else
                tNWbBlSr = - tNCBZS
