                aPGrSE = wPCnZE / oPOMWE
!       Specific_N_consumption_OR_daily_ration
                aNCZSE = wNCnZE / oNZoEp
!       Specific_N_grazing_OR_daily_grazing
                aNGrSE = wNCnZE / oNOMWE
!       Total_settling
                tDStTE = tDSIME + tDSetDetEp + tDStPE
!       Total_settling
                tPStTE = tPSAIME + tPSetDetEp + tPStPE
!       Total_settling
                tNStTE = tNSetDetEp + tNStPE
!       Total_resuspension
                tDRssT = tDRssDd + tDRsPT
!       Total_P_resuspension_flux
                tPRssT = tPResusDet + tPRAIM + tPRssP + tPRPO4
!       Total_N_resuspension_flux
                tNRssT = tNResusDet + tNRNH4 + tNRNO3 + tNRssP
!       Update_dredged_layer
                if ( (sTime == bTmDrd) ) then
