!       Rate_constant_of_deepening
                if ( ((sTime >= bTmDrd) .and. (sTime < bTmDrd + cLngDr) .and. (aDpthS <= cDpthR &
                &- cDepthS)) ) then
                akDrdD = (log(cDpthR / aDpthS)) / cLngDr
                else
                akDrdD = 0.0
                endif

!       Rate_constant_of_dredging(exponential_function)
                if ( ((sTime >= bTmDrd) .and. (sTime < bTmDrd + cLngDr) .and. (aDpthS <= cDpthR &
                &- cDepthS)) ) then
                akDred = (- log(1.0 - fEffDr)) / cLngDr
                else
                akDred = 0.0
                endif

!       Rate_constant_of_dredging_for_zoobenthos
                if ( ((sTime >= bTmDrd) .and. (sTime < bTmDrd + cLngDr) .and. (aDpthS <= cDpthR &
                &- cDepthS)) ) then
                akDrdB = (- log(1.0 - fEffDB)) / cLngDr
                else
                akDrdB = 0.0
                endif

!       Change_in_water_depth_due_to_dredging
                if ( (aInclS == 1) ) then
