                tPDrdV = akDred * aPVeg
!       Dredging_flux_of_N_Veg_on_lake_sediment
                tNDrdV = akDred * aNVeg
!       Total_DW_dredging_flux
                tDDrNT = tDDredDetS - tDDrNS + tDDrPS + tDDrdB + tDDrdV
