!       Total_P_burial_flux_in_lake
                if ( (InclBr == 0) ) then
                tPBrTt = 0.0
                else if ( (vDeltS >= 0.0) ) then
                tPBrTt = tPBrDt + tPBurHum + tPBrAIM + tPBrPO4
