                else
                tSBrDt = 0.0
                endif

!       Total_Si_burial_flux_in_lake
                if ( (InclBr == 0) ) then
                tSBrTt = 0.0
                else if ( (vDeltS >= 0.0) ) then
                tSBrTt = tSBrDt
                else
                tSBrTt = 0.0
