!       Relative_water_depth_change_due_to_sediment_turnover_AND_dredging
                if ( ( aInclS == 1 ) ) then
                aRlDWE = (vDeltW ) / uDptWE
                else
                aRlDWE = (vDeltW + vDrdDW) / uDptWE
