!       Relative_water_depth_change_due_to_sediment_turnover_AND_dredging
                if ( ( aInclS == 0 ) ) then
                aRlDWH = 0.0
                else
                aRlDWH = (vDeltW + vDrdDW) / uDptWH
                endif

!       Total_fish_biomass
                aPFish = aPFiJv + aPFiAd
!       Total_fish_biomass
                aNFish = aNFiJv + aNFiAd
!       Total_DW_in_system
                aDRlTT = uDptWH * aRlDWH * ( oDDetWHyp + oDIMWH + oDDitWHyp + oDGrWH + oDBlWH + &
                &oDZHyp ) + fMarsh * uDptWM * aRlDWM * ( oDDetWM + oDIMWM + oDDitWM + oDGrWM + oD&
                &BlWM + oDZooM) + uDptWE * aRlDWE * (oDDetWEp + oDIMWE + oDDitWEp + oDGrWE + oDBl&
                &WE + oDZoEp )
!       Total_N_in_system
                aNRlTT = uDptWH * aRlDWH * ( oNH4WH + oNO3WH + oNDetWHyp + oNDitWHyp + oNGrWH + &
                &oNBlWH + oNZHyp ) + fMarsh * uDptWM * aRlDWM * ( oNH4WM + oNO3WM + oNDetWM + oND&
                &itWM + oNGrWM + oNBlWM + oNZooM ) + uDptWE * aRlDWE * ( oNH4WE + oNO3WE + oNDetW&
                &Ep + oNDitWEp + oNGrWE + oNBlWE + oNZoEp )
