                aPRlTT = uDptWH * aRlDWH * ( oPO4WH + oPAIMWH + oPDetWHyp + oPDitWHyp + oPGrWH +&
                & oPBlWH + oPZHyp ) + fMarsh * uDptWM * aRlDWM * (oPO4WM + oPAIMWM + oPDetWM + oP&
                &DitWM + oPGrWM + oPBlWM + oPZooM ) + uDptWE * aRlDWE * (oPO4WE + oPAIMWE + oPDet&
                &WEp + oPDitWEp + oPGrWE + oPBlWE + oPZoEp )
