                aSRlTT = uDptWH * aRlDWH * ( oSO2WH + oSDtWH + cSiDDt*oDDitWHyp) + fMarsh * uDpt&
                &WM * aRlDWM * ( oSO2WM + oSiDetWM + cSiDDt*oDDitWM) + uDptWE * aRlDWE * ( oSO2WE&
                & + oSDtWE + cSiDDt*oDDitWEp)
!       Total_Si_in_system
