                dNH4WH = ( wNTNH4WH + wNANH4WH + wNPNH4WH + wNBNH4WH + wNWNH4WH + uNBcLH / uDptW&
                &H - aRlDWH * oNH4WH - wNENH4H - wNENH4WH  - wNAdNH4W / uDptWH  -wNNNH4AH ) * Mss&
                &Hyp
