                dSO2WH = ( wSTSO2H + wSASO2WH + wSPSO2WH - aRlDWH * oSO2WH - wSESO2H - wSESO2WH &
                & - wSAdSO2W / uDptWH   -wSNSO2AH) * MssHyp
!       Derivative_for_O2_oxygen_in_water_in_lake_water
                dO2WHy = ( wO2TWH + wO2AWH + wO2PWH - tO2PSH + tO2BWH / uDptWH - aRlDWH* oO2WHy &
