!       Derivative_for_DW_Detritus_in_lake_water
                dDDetWHyp = ( wDTDWH + wDADWH + wDPrimDeWH + wDBDWH + wDWebDetWH - aRlDWH * oDDe&
                &tWHyp - wDExchDetH - wDExchDeWH  - wDAdvDetW / uDptWH  - wDNetDeAbH) * MssHyp
!       Derivative_for_N_Detritus_in_lake_water
                dNDetWHyp = ( wNTDWH + wNADWH + wNPrimDeWH + wNBDWH + wNWebDetWH -aRlDWH * oNDet&
                &WHyp - wNExchDetH - wNExchDeWH  - wNAdvDetW / uDptWH  -wNNetDeAbH ) * MssHyp
!       Derivative_for_P_Detritus_in_lake_water
                dPDetWHyp = ( wPTDWH + wPADWH + wPPrimDeWH + wPBDWH + wPWebDetWH - aRlDWH * oPDe&
                &tWHyp - wPExchDetH - wPExchDeWH  - wPAdvDetW / uDptWH  - wPNetDeAbH) * MssHyp
