                dSDtWH = ( wSTDWH + wSADWH + wSiPrDeWH + wSWDWH - aRlDWH * oSDtWH - wSiExchDeH -&
                & wSiExDeWH  - wSiAdvDetW / uDptWH  - wSiNtDiAbH) * MssHyp
