!       Derivative_for_DW_Diatoms_in_lake_water
                dDDitWHyp = ( wDTrDH + wDPrimDiWH + wDWebDitWH - aRlDWH * oDDitWHyp - wDExchDitH&
                & - wDExchDiWH  - wDAdvDitW / uDptWH - wDNetDiAbH) * MssHyp
